(938, 6, 'Note: This batter is very crumbly and very hard to work with and get to stay together.  Get it to stay together enough to shape the 3 inch patty on the baking sheet and they will hold together when baking.  The result is a cookie that is soft and chewy on the inside and slightly crisp on the outside.', 203, '2010-12-10 00:39:20', '2010-12-10 00:39:20'),
