(945, 1, '# 1 Dissolve yeast in water, I add a pinch of sugar, and let rest about 5 minutes or until it begins to foam.', 204, '2010-12-12 00:51:57', '2010-12-12 00:51:57'),
(946, 2, 'Stir in salt, oil and half of flour.  Gradually add remaining flour, mixing well.  Knead 8-10 minutes or until smooth and elastic. If using mixer to knead, 5 minutes would be plenty.', 204, '2010-12-12 00:51:57', '2010-12-12 00:51:57'),
(947, 3, 'Place in greased bowl and let rise until double (1/2-1 hour) Punch down and let rise again until double.  Punch down and divide into 1-4 pieces, depending on the size loaves desired.  Roll into an oblong shape and then roll up, starting on long side; pinch to seal, forming long thin loaves.\r\nPlace on greased cookie sheet.\r\n  \r\n\r\n   ', 204, '2010-12-12 00:51:57', '2010-12-12 00:51:57'),
(948, 4, 'Slash top of dough with knife 3-5 times diagonally down each loaf.  Brush with water and let raise till double again (about 1 hour).  Bake at 375°F for 30 minutes.  Use within one day or double wrap and freeze.', 204, '2010-12-12 00:51:57', '2010-12-12 00:51:57'),
(949, 0, 'Dissolve yeast in water, I add a pinch of sugar, and let rest about 5 minutes or until it begins to foam.', 205, '2010-12-12 00:52:45', '2010-12-12 00:52:45'),
(950, 1, 'Stir in salt, oil and half of flour.  Gradually add remaining flour, mixing well.  Knead 8-10 minutes or until smooth and elastic. If using mixer to knead, 5 minutes would be plenty.', 205, '2010-12-12 00:52:45', '2010-12-12 00:52:45'),
(951, 3, 'Slash top of dough with knife 3-5 times diagonally down each loaf.  Brush with water and let raise till double again (about 1 hour).  Bake at 375°F for 30 minutes.  Use within one day or double wrap and freeze.', 205, '2010-12-12 00:52:45', '2010-12-12 00:52:45'),
(952, 6, 'NOTE:  I like to double this recipe so I have leftovers.  This recipe yields only makes 2 servings.', 206, '2010-12-16 01:44:57', '2010-12-16 01:44:57'),
(953, 0, 'Slice the paneer in about 1/8 inch thick and about in one inch squares.  Mix ginger, salt, pepper, coriander, and yogurt with sliced paneer in a bowl, cover it and let the mixture marinate for at least an hour. It is better to have the paneer marinate in a refrigerator.  Blend tomatoes and green chilies to make a puree and keep aside.\r\n', 206, '2010-12-16 01:44:57', '2010-12-16 01:44:57'),
(954, 1, 'Dissolve the corn starch in 2 tablespoons of water and keep aside. Corn starch is used to give thickness to gravy.  Heat 1 tablespoon of oil in flat frying pan on medium heat, making sure to oil the entire surface of the pan.', 206, '2010-12-16 01:44:57', '2010-12-16 01:44:57'),
(955, 2, 'Next put the marinated paneer in frying pan and gently stir-fry for about 3 to 4 minutes until paneer becomes light brown.  Take out the paneer in a bowl and use the same frying pan to make the gravy.\r\n', 206, '2010-12-16 01:44:57', '2010-12-16 01:44:57'),
(956, 3, 'To prepare the gravy, add 1 table spoon of oil in a frying pan. Test the heat by adding one cumin seed to the oil; if seed cracks right away oil is ready.  Add cumin seeds and asafetida after seeds crack add bay leaves and stir for a few seconds.', 206, '2010-12-16 01:44:57', '2010-12-16 01:44:57'),
(957, 4, 'Add the tomato puree, coriander powder, turmeric, paprika, sugar, and cook for about 4 minutes on medium heat.  Add the corn starch mix stir for few minutes till the sauce thickens.', 206, '2010-12-16 01:44:57', '2010-12-16 01:44:57'),
(958, 5, 'Add the stir-fry paneer in the tomato gravy and let it cook for 3 to 4 minutes on low medium heat.  Turn off the heat and add cilantro, salt,  and garam masala stir slowly and cover the pan for few minutes.  Serve hot with your choice of Indian bread or over the rice.', 206, '2010-12-16 01:44:57', '2010-12-16 01:44:57'),
(959, 0, 'Dissolve yeast in water, add a pinch of sugar, and let rest about 5 minutes or until it begins to foam.', 207, '2010-12-16 03:06:36', '2010-12-16 03:06:36'),
(960, 1, 'Stir in salt, oil and half of flour.  Gradually add remaining flour, mixing well.  Knead 8-10 minutes or until smooth and elastic. If using mixer to knead, 5 minutes would be plenty.', 207, '2010-12-16 03:06:36', '2010-12-16 03:06:36'),
(961, 2, 'Slash top of dough with knife 3-5 times diagonally down each loaf.  Brush with water and let raise till double again (about 1 hour).  Bake at 375°F for 30 minutes.  Use within one day or double wrap and freeze.', 207, '2010-12-16 03:06:36', '2010-12-16 03:06:36'),
(962, 0, 'Dissolve yeast in water, add a pinch of sugar, and let rest about 5 minutes or until it begins to foam.', 208, '2010-12-16 03:10:33', '2010-12-16 03:10:33'),
(963, 1, 'Stir in salt, oil and half of flour.  Gradually add remaining flour, mixing well.  Knead 8-10 minutes or until smooth and elastic. If using mixer to knead, 5 minutes would be plenty.  Place in greased bowl and let rise until double (1/2-1 hour) Punch down and let rise again until double.\r\nPunch down and divide into 1-4 pieces, depending on the size loaves desired. Roll into an oblong shape and then roll up, starting on long side; pinch to seal, forming long thin loaves.  Place on greased cookie sheet.', 208, '2010-12-16 03:10:33', '2010-12-16 03:10:33'),
(964, 2, 'Slash top of dough with knife 3-5 times diagonally down each loaf.  Brush with water and let raise till double again (about 1 hour).  Bake at 375°F for 30 minutes.  Use within one day or double wrap and freeze.', 208, '2010-12-16 03:10:33', '2010-12-16 03:10:33'),
(965, 0, 'Heat oven to 350 degrees.  Beat together butter and sugars.  Add pumpkin, eggs, and vanilla; beat.', 209, '2010-12-16 03:40:36', '2010-12-16 03:40:36'),
(966, 1, 'Mix in combined flours, baking soda, and spices, then stir in oats and chocolate chips.  Drop by rounded tablespoonfuls onto greased cookie sheets.  Bake 10 to 12 minutes.  Let cool.', 209, '2010-12-16 03:40:36', '2010-12-16 03:40:36'),
(967, 7, 'This mixture is also amazing if you add raspberry flavoring. I have tried frozen raspberries but it was too tart.', 210, '2010-12-18 16:02:49', '2010-12-18 16:02:49'),
(968, 1, 'Skin & chop up ginger root.', 210, '2010-12-18 16:02:49', '2010-12-18 16:02:49'),
(969, 2, 'Simmer ginger, juices, sugar, & honey in 1 gallon of water for 1 - 2 hrs. The longer you simmer, the stronger the ginger flavor.', 210, '2010-12-18 16:02:49', '2010-12-18 16:02:49'),
(970, 3, 'Remove from heat and strain. Compost the plant material.', 210, '2010-12-18 16:02:49', '2010-12-18 16:02:49'),
(971, 4, 'Add 2 gallons of water.', 210, '2010-12-18 16:02:49', '2010-12-18 16:02:49'),
(972, 5, 'Carbonate / Bottle / Keg your mix', 210, '2010-12-18 16:02:49', '2010-12-18 16:02:49'),
(973, 6, 'Age then enjoy.', 210, '2010-12-18 16:02:49', '2010-12-18 16:02:49'),
(974, 7, 'SOURCE: http://forevermore.net/articles/root-beer-recipe/', 211, '2010-12-19 05:30:26', '2010-12-19 05:30:26'),
(975, 8, '<b>ATTN: DO NOT MAKE THIS RECIPE. Sassafras root bark is a known carcinogen. This web site is for educational purposes only.</b>', 211, '2010-12-19 05:30:26', '2010-12-19 05:30:26'),
(976, 1, 'Mix all ingredients in a large boiler with 2 gallons water.', 211, '2010-12-19 05:30:26', '2010-12-19 05:30:26'),
(977, 2, 'Bring to a boil with constant stirring so sugars do not burn on bottom of pot.', 211, '2010-12-19 05:30:26', '2010-12-19 05:30:26'),
(978, 3, 'Lower temp and simmer mixture for approximately an hour. ', 211, '2010-12-19 05:30:26', '2010-12-19 05:30:26'),
(979, 4, 'Strain and allow to cool to at least 100 deg then add vanilla extract.', 211, '2010-12-19 05:30:26', '2010-12-19 05:30:26'),
(980, 5, 'Pour in keg and add water to 5 gallons.', 211, '2010-12-19 05:30:26', '2010-12-19 05:30:26'),
(981, 6, 'Carbonate (I force carbonate as I don''t like any additional flavor caused by yeast).', 211, '2010-12-19 05:30:26', '2010-12-19 05:30:26'),
(982, 1, 'To make wontons, combine ground chicken through black pepper.  Lay out wonton wrappers (4-8 at a time, depending on work space). ', 212, '2010-12-21 03:36:25', '2010-12-21 03:36:25'),
(983, 2, 'Place 1 tsp of mixture in center.  Moisten edges and fold.  Press edges together to seal.  Overlap tips and moisten with water to seal.  Repeat for all 16 wontons.\r\n', 212, '2010-12-21 03:36:25', '2010-12-21 03:36:25'),
(984, 3, 'To make soup, bring broth and soy sauce to boil.  Reduce to medium-low and add wontons and bok choy. ', 212, '2010-12-21 03:36:25', '2010-12-21 03:36:25'),
(985, 4, 'Simmer, stirring occasionally, until wontons are cooked through and bok choy is tender - about 10 minutes.  Sprinkle with scallions and serve.\r\n', 212, '2010-12-21 03:36:25', '2010-12-21 03:36:25'),
(986, 1, 'Grate the soap and put it in a sauce pan.  Add 6 cups water and heat it until the soap melts.  ', 213, '2010-12-30 04:04:17', '2010-12-30 04:04:17'),
(987, 2, 'Add the washing soda and the borax and stir until it is dissolved.  Remove from heat. ', 213, '2010-12-30 04:04:17', '2010-12-30 04:04:17'),
(988, 3, 'Pour 4 cups hot water into the bucket.   Now add your soap mixture and stir. ', 213, '2010-12-30 04:04:17', '2010-12-30 04:04:17'),
(989, 4, 'Now add 1 gallon plus 6 cups of water and stir.  Let the soap sit for about 24 hours and it will gel.  You use ½ cup per load.\r\n', 213, '2010-12-30 04:04:17', '2010-12-30 04:04:17'),
(990, 5, 'Note:  My soap always makes a more solid gel versus a liquid gel.  I use a blender and work in small batches to liquify the mixture, then store in recycled detergent bottles.  ', 213, '2010-12-30 04:04:17', '2010-12-30 04:04:17'),
(991, 0, 'Grate the soap and put it in a sauce pan.  Add 6 cups water and heat it until the soap melts.  ', 214, '2010-12-30 04:05:33', '2010-12-30 04:05:33'),
(992, 1, 'Add the washing soda and the borax and stir until it is dissolved.  Remove from heat. ', 214, '2010-12-30 04:05:33', '2010-12-30 04:05:33'),
(993, 2, 'Pour 4 cups hot water into the bucket.   Now add your soap mixture and stir. ', 214, '2010-12-30 04:05:33', '2010-12-30 04:05:33'),
(994, 3, 'Now add 1 gallon plus 6 cups of water and stir.  Let the soap sit for about 24 hours and it will gel.  You use ½ cup per load.\r\n', 214, '2010-12-30 04:05:33', '2010-12-30 04:05:33'),
(995, 4, 'Note:  My soap always makes a more solid gel versus a liquid gel.  I use a blender and work in small batches to liquify the mixture, then store in recycled detergent bottles.  ', 214, '2010-12-30 04:05:33', '2010-12-30 04:05:33'),
(996, 0, 'Preheat oven to 450 degrees. ', 216, '2010-12-31 19:30:11', '2010-12-31 19:30:11'),
(997, 1, 'In a large mixing bowl, combine flour, baking powder, baking soda and salt. Using your fingertips, rub the butter into dry ingredients until mixture looks like crumbs. (The faster the better, you don''t want the fats to melt.) Make a well in the center and pour in the chilled buttermilk. Stir just until the dough comes together. The dough will be very sticky. ', 216, '2010-12-31 19:30:11', '2010-12-31 19:30:11'),
(998, 2, 'Turn dough onto floured surface, dust top with flour and gently fold dough over on itself 5 or 6 times. Press into a 1-inch thick round. Cut out biscuits with a 2-inch cutter, being sure to push straight down through the dough. Place biscuits on baking sheet so that they just touch. Reform scrap dough, working it as little as possible and continue cutting. ', 216, '2010-12-31 19:30:11', '2010-12-31 19:30:11'),
(999, 3, 'Bake until biscuits are tall and light gold on top, 15 to 20 minutes.\r\n', 216, '2010-12-31 19:30:11', '2010-12-31 19:30:11'),
(1000, 7, 'Bake in a preheated 350 degree Fahrenheit oven for approximately 20 minutes or until heated all the way through and golden brown on top.', 217, '2010-12-31 19:41:24', '2010-12-31 19:41:24'),
(1001, 1, 'Bring 4 qt. salted water to a rapid boil and cook the macaroni until not quite tender. Drain macaroni and set aside.', 217, '2010-12-31 19:41:24', '2010-12-31 19:41:24'),
(1002, 2, 'In saute pan, melt 4 Tablespoons of Smart Balance. When melted, stir in the breadcrumbs and toast just until lightly browned. Remove breadcrumbs from pan and set aside', 217, '2010-12-31 19:41:24', '2010-12-31 19:41:24'),
(1003, 3, 'Wipe pan clean with paper towel and re-use for next step. Melt remaining Smart Balance, add onions, and stir over low heat until onions are just translucent, but not browned. Stir in the flour and seasonings. ', 217, '2010-12-31 19:41:24', '2010-12-31 19:41:24'),
(1004, 4, 'Continue to cook for an additional 2-3 minutes. Add the wine, then gradually stir in the milk or cream.', 217, '2010-12-31 19:41:24', '2010-12-31 19:41:24'),
(1005, 5, 'Simmer over low heat, stirring constantly until the sauce is thickened and smooth. Add cheese and continue stirring until the cheese melts.', 217, '2010-12-31 19:41:24', '2010-12-31 19:41:24'),
(1006, 6, 'Combine the macaroni with the cheese sauce. Turn out into a generously buttered casserole dish (approximately 1 1/2 quarts). If you have any extra grated cheese, you can sprinkle this on top along with the 1/2 cup of buttered, toasted bread crumbs.', 217, '2010-12-31 19:41:24', '2010-12-31 19:41:24'),
(1007, 6, 'Bake in a preheated 350 degree Fahrenheit oven for approximately 20 minutes or until heated all the way through and golden brown on top.', 218, '2010-12-31 19:41:59', '2010-12-31 19:41:59'),
(1008, 0, 'Bring 4 qt. salted water to a rapid boil and cook the macaroni until not quite tender. Drain macaroni and set aside.', 218, '2010-12-31 19:41:59', '2010-12-31 19:41:59'),
(1009, 1, 'In saute pan, melt 4 Tablespoons of Smart Balance. When melted, stir in the breadcrumbs and toast just until lightly browned. Remove breadcrumbs from pan and set aside', 218, '2010-12-31 19:41:59', '2010-12-31 19:41:59'),
(1010, 2, 'Wipe pan clean with paper towel and re-use for next step. Melt remaining Smart Balance, add onions, and stir over low heat until onions are just translucent, but not browned. Stir in the flour and seasonings and salt and pepper to taste. ', 218, '2010-12-31 19:41:59', '2010-12-31 19:41:59'),
(1011, 3, 'Continue to cook for an additional 2-3 minutes. Add the wine, then gradually stir in the milk or cream.', 218, '2010-12-31 19:41:59', '2010-12-31 19:41:59'),
(1012, 4, 'Simmer over low heat, stirring constantly until the sauce is thickened and smooth. Add cheese and continue stirring until the cheese melts.', 218, '2010-12-31 19:41:59', '2010-12-31 19:41:59'),
(1013, 5, 'Combine the macaroni with the cheese sauce. Turn out into a generously buttered casserole dish (approximately 1 1/2 quarts). If you have any extra grated cheese, you can sprinkle this on top along with the 1/2 cup of buttered, toasted bread crumbs.', 218, '2010-12-31 19:41:59', '2010-12-31 19:41:59'),
(1014, 1, 'Wash the split peas or lentils.  Put peas in a bowl and add enough hot water to cover by 1 inch.  Let soak for 1 hour.  Drain.', 219, '2011-01-13 17:56:17', '2011-01-13 17:56:17'),
(1015, 2, 'Put the split peas or lentils in a deep pot along with the turmeric and 4 1/2 cups of water.  Bring to a boil, stirring well to keep the peas or lentils from lumping.  Reduce heat to medium-low and simmer, partially covered, for 45 minutes or until the peas or lentils are thoroughly cooked and tender when pressed between your fingers. Stir now and then to ensure that they do not stick to the bottom of the pan. Turn off heat, and beat the split peas with a wire whisk or wooden spoon for a minute or until finely pureed.  Measure the puree.  There should be about 5 cups; if not, add enough water to complete the measurement.  Stir in salt, and set aside.  ', 219, '2011-01-13 17:56:17', '2011-01-13 17:56:17'),
(1016, 3, 'When ready to serve, simmer the puree until piping hot.  Check the consistency of the puree if you have made it ahead of time:  keeping often thickens it considerably and you may need to add water.  Transfer the puree to a warm serving bowl, and make the spiced butter (tadka).', 219, '2011-01-13 17:56:17', '2011-01-13 17:56:17'),
(1017, 4, 'Heat oil over medium-high heat until very hot.  Add cumin seeds and fry until they turn dark brown, about 10 seconds.  Add onion, and fry until they turn dark brown, about 20 minutes, stirring constantly to prevent burning.  Stir in red pepper if you are using it and immediately pour this perfumed butter with its spices and onions over the split pea puree.  Garnish with chopped coriander and serve immediately', 219, '2011-01-13 17:56:17', '2011-01-13 17:56:17'),
(1018, 1, 'Put the oil into a medium saucepan and heat to a medium temperature. Add the rice and brown it in the oil while stirring.', 220, '2011-01-17 04:13:48', '2011-01-17 04:13:48'),
(1019, 2, 'Add the garlic when the rice is nearly browned. Add the water, then the rest of the ingredients. Mix well. Cover, with a small air escape, and turn the heat down to medium low', 220, '2011-01-17 04:13:48', '2011-01-17 04:13:48');
INSERT INTO `steps` (`id`, `order_num`, `instruction`, `recipe_id`, `created_at`, `updated_at`) VALUES
(1020, 3, 'Cook the rice for 20 to 30 minutes but check after 20 to see if it is ready.  Note: If you want to use brown rice, increase water to 2 1/2 cups and increase cooking time to 40-45 minutes.', 220, '2011-01-17 04:13:48', '2011-01-17 04:13:48'),
(1021, 4, 'You do not need to stir the rice or lift the lid while it cooks. It is ready when the rice is fluffy, all the water is gone, and the grains are split open (because of the browning).', 220, '2011-01-17 04:13:48', '2011-01-17 04:13:48'),
(1022, 5, 'If it is still sauce-like rather than dry, cook a few minutes more. Adjust the spices and serve hot as a side dish with tacos, enchiladas, or burritos. You can also eat this dish by itself as a snack.', 220, '2011-01-17 04:13:48', '2011-01-17 04:13:48'),
(1023, 7, 'Place oven rack approximately 6 in from burner in oven. Place pizza stone on top rack. Heat oven to 450&deg;F.', 221, '2011-01-18 04:34:33', '2011-01-18 04:34:33'),
(1024, 12, 'Allow to cook approximately 15 min total. Half way through, using peel to rotate pizza 180 deg.', 221, '2011-01-18 04:34:33', '2011-01-18 04:34:33'),
(1025, 8, 'From this point forward, operate one ball of dough at a time.', 221, '2011-01-18 04:34:33', '2011-01-18 04:34:33'),
(1026, 13, 'Use peel to remove pizza from stone & place on cooling rack for 5 min. Return to step 9. This will give the oven / stone time to heat back up.', 221, '2011-01-18 04:34:33', '2011-01-18 04:34:33'),
(1027, 9, 'Spread dough (roll or stretch) to 12 - 14 in diameter (depending on thickness you prefer).', 221, '2011-01-18 04:34:33', '2011-01-18 04:34:33'),
(1028, 14, 'Cut & serve.', 221, '2011-01-18 04:34:33', '2011-01-18 04:34:33'),
(1029, 10, 'Place dough on pizza peel & cover with your choice of toppings.', 221, '2011-01-18 04:34:33', '2011-01-18 04:34:33'),
(1030, 1, 'Dissolve yeast in 1 cup water & allow to set 10 minutes', 221, '2011-01-18 04:34:33', '2011-01-18 04:34:33'),
(1031, 2, 'Mix wheat flour, unbleached flour, salt, and olive oil in large bowl.', 221, '2011-01-18 04:34:33', '2011-01-18 04:34:33'),
(1032, 3, 'Slowly mix in yeast solution and begin kneading. Add additional water as necessary until mixture forms a ball but is only slightly sticky.', 221, '2011-01-18 04:34:33', '2011-01-18 04:34:33'),
(1033, 4, 'Knead dough for approximately 5 minutes total (including above step). If kneading by hand, knead dough approximately 8 minutes.', 221, '2011-01-18 04:34:33', '2011-01-18 04:34:33'),
(1034, 5, 'Transfer dough to large oiled bowl. Cover in plastic wrap and place in refrigerator. Leave minimum 4 hours (preferably overnight). ', 221, '2011-01-18 04:34:33', '2011-01-18 04:34:33'),
(1035, 11, 'Open oven & spread corn meal over pizza stone. Place pizza on stone quickly using peel. Close oven as quickly as possible to not loose heat.', 221, '2011-01-18 04:34:33', '2011-01-18 04:34:33'),
(1036, 6, 'Two hours before cooking, remove dough from refrigerator. Split into four equal pieces. Place on floured surface and cover with towel. Allow to rest for approximately one hour (until dough is room temp & has risen approximately double).', 221, '2011-01-18 04:34:33', '2011-01-18 04:34:33'),
(1037, 0, 'To make Sauce: Heat 1 tablespoon olive oil in saucepan or Dutch oven over medium heat. Sauté 1 1/2 cups onion and 3 garlic cloves in oil 5 to 7 minutes, or until soft. Add dried chilies, and sauté 3 minutes more. Stir in tomatoes and 2 cups water. Season with salt and pepper, and simmer 10 to 15 minutes, or until chiles are soft. Remove from heat, cool 5 minutes, then purée in blender or food processor until smooth.', 222, '2011-01-29 03:18:40', '2011-01-29 03:18:40'),
(1038, 1, 'To make Enchiladas: Preheat oven to broil. Place poblano chiles on baking sheet, and broil 15 to 20 minutes, or until blackened on all sides, turning often. Cool in covered bowl, then peel off skins and remove seeds. Chop chiles into 1/4-inch pieces. Place in bowl queso fresco, 3/4 pound montery jack cheese, and 3 Tablespoons cilantro.', 222, '2011-01-29 03:18:40', '2011-01-29 03:18:40'),
(1039, 2, 'Spread tortillas on baking sheet. Warm 3 minutes in oven to soften.\r\n', 222, '2011-01-29 03:18:40', '2011-01-29 03:18:40'),
(1040, 3, 'Spread 1 cup sauce over bottom of 13- x 9-inch baking dish. Divide cheese mixture among tortillas, and roll loosely. Place filled, rolled tortillas in baking dish. Top with enough sauce to moisten all the stuffed tortillas, and sprinkle with remaining Monterey Jack cheese. Bake 15 to 20 minutes, or until sauce is bubbly and cheese is melted. Sprinkle with remaining cilantro before serving. \r\n', 222, '2011-01-29 03:18:40', '2011-01-29 03:18:40'),
(1041, 4, 'NOTE:  There will be about 2 cups of enchilada sauce remaining for another use.', 222, '2011-01-29 03:18:40', '2011-01-29 03:18:40'),
(1042, 0, 'To make Sauce: Heat 1 tablespoon olive oil in saucepan or Dutch oven over medium heat. Sauté 1 1/2 cups onion and 3 garlic cloves in oil 5 to 7 minutes, or until soft. Add dried chilies, and sauté 3 minutes more. Stir in tomatoes and 2 cups water. Season with salt and pepper, and simmer 10 to 15 minutes, or until chiles are soft. Remove from heat, cool 5 minutes, then purée in blender or food processor until smooth.', 223, '2011-01-29 03:59:00', '2011-01-29 03:59:00'),
(1043, 1, 'To make Enchiladas: Preheat oven to broil. Place poblano chiles on baking sheet, and broil 15 to 20 minutes, or until blackened on all sides, turning often. Cool in covered bowl, then peel off skins and remove seeds. Chop chiles into 1/4-inch pieces. Place in bowl queso fresco, 3/4 pound montery jack cheese, and 3 Tablespoons cilantro.', 223, '2011-01-29 03:59:00', '2011-01-29 03:59:00'),
(1044, 2, 'Spread tortillas on baking sheet. Warm 3 minutes in 350 degree oven to soften.\r\n', 223, '2011-01-29 03:59:00', '2011-01-29 03:59:00'),
(1045, 3, 'Spread 1 cup sauce over bottom of 13- x 9-inch baking dish. Divide cheese mixture among tortillas, and roll loosely. Place filled, rolled tortillas in baking dish. Top with enough sauce to moisten all the stuffed tortillas, and sprinkle with remaining Monterey Jack cheese. Bake 15 to 20 minutes, or until sauce is bubbly and cheese is melted. Sprinkle with remaining cilantro before serving. \r\n', 223, '2011-01-29 03:59:00', '2011-01-29 03:59:00'),
(1046, 4, 'NOTE:  There will be about 2 cups of enchilada sauce remaining for another use.', 223, '2011-01-29 03:59:00', '2011-01-29 03:59:00'),
(1047, 7, 'Serve the veggie burgers on crusty artisan bread along with some spring mix greens.', 224, '2011-02-04 04:34:00', '2011-02-04 04:34:00'),
(1048, 8, 'Cooked burgers should be eaten that same day. You can also save leftover mix in the fridge for up to a week and cook just one or two burgers as you want them.', 224, '2011-02-04 04:34:01', '2011-02-04 04:34:01'),
(1049, 1, 'Bring a large amount of water to a boil. Add a handful of salt and the rice, and reduce the heat to a simmer. Cook the rice until it''s a little beyond al dente. You want it a little over-cooked, but still firm. This should take about 35-40 minutes. Drain the rice and set it aside.', 224, '2011-02-04 04:34:01', '2011-02-04 04:34:01'),
(1050, 2, 'Heat a teaspoon of olive oil in a skillet over medium-high heat. Add the onion, reduce the heat to medium, and cook until the onions are translucent and softened. Stir in the beets. Cover the pot and cook until the beets are completely tender, stirring occasionally. Add the garlic and cook until it is fragrant, about 30 seconds. Deglaze the pan using the cider vinegar.', 224, '2011-02-04 04:34:01', '2011-02-04 04:34:01'),
(1051, 3, 'Empty the black beans into a large bowl and use a fork to mash them up a bit. Add the cooked rice, the beet and onion mixture, the lemon juice, the olive oil, and all the spices. Stir to combine and then taste for seasonings. Add salt and pepper to taste. Once it tastes the way you like it, add the flour and stir until you see no more dry flour.', 224, '2011-02-04 04:34:01', '2011-02-04 04:34:01'),
(1052, 4, 'Heat a cast-iron skillet over the highest heat. Add a few tablespoons of olive oil - the oil should completely coat the bottom of the pan. When you see the oil shimmer and it flows easily, the pan is ready.', 224, '2011-02-04 04:34:01', '2011-02-04 04:34:01'),
(1053, 5, 'Using your hands, scoop up about a cup of the burger mixture and shape it into a patty between your palms. Set it in the pan, where it should begin to sizzle immediately. (If it doesn''t sizzle, wait a minute or two before cooking the rest of the burgers.) Shape and add as many more patties as will fit in your pan. Once all the patties are in the pan, reduce the heat to medium-high.', 224, '2011-02-04 04:34:01', '2011-02-04 04:34:01'),
(1054, 6, 'Cook the patties for 2 minutes, then flip them to the other side. You should see a nice crust on the cooked side. If they break apart a little when you flipped them, just reshape them with the spatula - they''ll hold together once the second side is cooked. If you''re adding cheese, lay a slice over the burgers now. Cook the second side for another 2 minutes.', 224, '2011-02-04 04:34:01', '2011-02-04 04:34:01'),
(1055, 1, 'Preheat oven to 375°F and butter an 8-inch round baking pan. Line bottom with a round of wax paper and butter the paper.\r\n', 225, '2011-02-04 04:38:08', '2011-02-04 04:38:08'),
(1056, 2, 'Chop chocolate into small pieces. In a double boiler or metal bowl set over a saucepan of barely simmering water melt chocolate with butter, stirring, until smooth. Remove top of double boiler or bowl from heat and whisk sugar into chocolate mixture. Add eggs and whisk well. Sift 1/2 cup cocoa powder over chocolate mixture and whisk until just combined. Pour batter into pan and bake in middle of oven 25 minutes, or until top has formed a thin crust. Cool cake in pan on a rack 5 minutes and invert onto a serving plate.\r\n\r\n', 225, '2011-02-04 04:38:08', '2011-02-04 04:38:08'),
(1057, 3, 'Refrigerate cake and serve cold with raspberry sauce or sorbet.', 225, '2011-02-04 04:38:08', '2011-02-04 04:38:08'),
(1058, 0, 'Preheat oven to 375°F and butter an 8-inch round baking pan. Line bottom with a round of wax paper and butter the paper.\r\n', 226, '2011-02-04 04:39:53', '2011-02-04 04:39:53'),
(1059, 2, 'Refrigerate cake and serve cold with raspberry sauce or sorbet.', 226, '2011-02-04 04:39:53', '2011-02-04 04:39:53'),
(1060, 1, 'Preheat oven to 360* F.\r\nMix together pumpkin, egg, sugar, vegetable oil, and vanilla. In a separate bowl, combine flour, cinnamon, salt, baking soda, and baking powder.', 227, '2011-02-04 04:47:12', '2011-02-04 04:47:12'),
(1061, 2, 'Combine wet and dry ingredients until mixed well. Stir in chocolate chips. Drop by spoonful onto a baking sheet and bake for 11-12 minutes. Let the cookies cool completely before putting them away. ', 227, '2011-02-04 04:47:12', '2011-02-04 04:47:12'),
(1062, 0, 'Preheat oven to 360* F.\r\nMix together pumpkin, egg, sugar, vegetable oil, and vanilla. In a separate bowl, combine flour, cinnamon, salt, baking soda, and baking powder.', 228, '2011-02-04 04:48:14', '2011-02-04 04:48:14'),
(1063, 1, 'Combine wet and dry ingredients until mixed well. Stir in chocolate chips. Drop by spoonful onto a baking sheet and bake for 11-12 minutes. Let the cookies cool completely before putting them away. ', 228, '2011-02-04 04:48:14', '2011-02-04 04:48:14'),
(1064, 2, 'Note:  These cookies are soft.  More like muffin tops.  Really good for a quick breakfast or healthy snack.', 228, '2011-02-04 04:48:14', '2011-02-04 04:48:14'),
(1065, 1, 'Preheat oven to 400 degrees.  Place bread in a large bowl. Add olive oil and seasonings and toss to coat.  Place in preheated oven and bake for 10-15 minutes until brown and crisp.', 229, '2011-02-08 04:15:50', '2011-02-08 04:15:50'),
(1066, 0, 'Preheat oven to 400 degrees.  Place bread in a large bowl. Add olive oil and seasonings and toss to coat.  Place in preheated oven and bake for 10-15 minutes until brown and crisp.', 230, '2011-02-08 04:17:03', '2011-02-08 04:17:03'),
(1067, 6, 'Cover mixture with water & stir well.', 231, '2011-02-11 20:12:35', '2011-02-11 20:12:35'),
(1068, 7, 'Turn crockpot on low. (note: Leaving your crockpot on as you sleep is dangerous.)', 231, '2011-02-11 20:12:35', '2011-02-11 20:12:35'),
(1069, 8, 'Stir when you have time during cooking.', 231, '2011-02-11 20:12:35', '2011-02-11 20:12:35'),
(1070, 9, 'Cook until beans are tender, about 16 hours.', 231, '2011-02-11 20:12:35', '2011-02-11 20:12:35'),
(1071, 0, 'In the morning, place the beans in water to soak 10-12 hrs. That evening, drain the beans & place them in the crock pot.', 231, '2011-02-11 20:12:35', '2011-02-11 20:12:35'),
(1072, 1, 'Chop the bell pepper & the onion. Place in crock pot.', 231, '2011-02-11 20:12:35', '2011-02-11 20:12:35'),
(1073, 2, 'Mince the garlic & the jalepenos. Place in crock pot.', 231, '2011-02-11 20:12:35', '2011-02-11 20:12:35'),
(1074, 3, 'Place the dry TVP in the crock pot.', 231, '2011-02-11 20:12:35', '2011-02-11 20:12:35'),
(1075, 4, 'Place 2 cans tomato in the crock pot.', 231, '2011-02-11 20:12:35', '2011-02-11 20:12:35'),
(1076, 5, 'Add seasonings to crock pot.', 231, '2011-02-11 20:12:35', '2011-02-11 20:12:35'),
(1077, 0, 'Bring a large pot of salted water to boil. Add the penne and cook until it is tender but still firm to the bite, stirring occasionally, about 12 minutes.', 232, '2011-02-11 20:13:13', '2011-02-11 20:13:13'),
(1078, 1, 'Mince the garlic in a food processor. Add the goat cheese, cream cheese, 3/4 teaspoon of salt, 1/2 teaspoon of pepper, and half of the spinach leaves. Blend until the mixture is smooth and creamy. Set the cheese and spinach mixture aside.', 232, '2011-02-11 20:13:13', '2011-02-11 20:13:13'),
(1079, 2, 'Meanwhile, coarsly chop the remaining spinach leaves and place them in a large bowl.', 232, '2011-02-11 20:13:13', '2011-02-11 20:13:13'),
(1080, 3, 'Drain the pasta, reserving 1 cup of the cooking liquid. Spoon the pasta atop the spinach leaves in the bowl. Scrape the cheese and spinach mixture over the pasta mixture and toss to coat, adding enough reserved cooking liquid to moisten. Season the pasta, to taste, with salt and pepper. Sprinkle with the Parmesan or Romano cheese and serve.', 232, '2011-02-11 20:13:13', '2011-02-11 20:13:13'),
(1081, 4, 'Note: Experiment with different types of goat cheese with this recipe. It is wonderful!', 232, '2011-02-11 20:13:13', '2011-02-11 20:13:13'),
(1082, 6, 'SOURCE: http://forevermore.net/articles/root-beer-recipe/', 233, '2011-02-11 20:14:54', '2011-02-11 20:14:54'),
(1083, 7, '<b>ATTN: DO NOT MAKE THIS RECIPE. Sassafras root bark is a known carcinogen. This web site is for educational purposes only.</b>', 233, '2011-02-11 20:14:54', '2011-02-11 20:14:54'),
(1084, 0, 'Mix all ingredients in a large boiler with 2 gallons water.', 233, '2011-02-11 20:14:54', '2011-02-11 20:14:54'),
(1085, 1, 'Bring to a boil with constant stirring so sugars do not burn on bottom of pot.', 233, '2011-02-11 20:14:54', '2011-02-11 20:14:54'),
(1086, 2, 'Lower temp and simmer mixture for approximately an hour. ', 233, '2011-02-11 20:14:54', '2011-02-11 20:14:54'),
(1087, 3, 'Strain and allow to cool to at least 100 deg then add vanilla extract.', 233, '2011-02-11 20:14:54', '2011-02-11 20:14:54'),
(1088, 4, 'Pour in keg and add water to 5 gallons.', 233, '2011-02-11 20:14:54', '2011-02-11 20:14:54'),
(1089, 5, 'Carbonate (I force carbonate as I don''t like any additional flavor caused by yeast).', 233, '2011-02-11 20:14:54', '2011-02-11 20:14:54'),
(1090, 0, 'Combine first 6 ingredients in a large bowl; stir well.', 234, '2011-02-21 16:18:05', '2011-02-21 16:18:05'),
(1091, 1, 'Combine milk, oil, and egg; stir well. Add to flour mixture, stirring until smooth', 234, '2011-02-21 16:18:05', '2011-02-21 16:18:05'),
(1092, 2, 'Spoon about 1/3 cup batter for each pancake onto a hot nonstick griddle or nonstick skillet.', 234, '2011-02-21 16:18:05', '2011-02-21 16:18:05'),
(1093, 3, 'Turn pancakes when the tops are covered with bubbles and the edges look cooked. ', 234, '2011-02-21 16:18:05', '2011-02-21 16:18:05'),
(1094, 1, 'Preheat oven to 350 degrees.  In large bowl, with mixer on medium speed, beat butter and sugar 2 minutes or until creamy, occasionally scraping the bowl.  Reduce speed to low; beat in eggs, flour, baking soda, cinnamon, almond extract, and 1/2 teaspoon salt.', 235, '2011-02-27 23:35:46', '2011-02-27 23:35:46'),
(1095, 2, 'Drop dough by rounded measuring tablespoons, 2 inches apart, onto ungreased cookie sheet.  Bake cookies 14 to 15 minutes or until tops are golden.  Cool cookies on wire racks.  Repeat with remaining dough.', 235, '2011-02-27 23:35:47', '2011-02-27 23:35:47'),
(1096, 1, 'Remove any tough ends or hard outer husks of lemon grass, uct into 2-inch pieces, and smash with the side of a knife. Tie lemongrass in a loose bundle with cheesecloth.', 236, '2011-03-02 03:24:37', '2011-03-02 03:24:37'),
(1097, 2, 'Rinse chicken and place in a medium soup pot.  Add 6 cups cold water to cover chicken.  Season with salt and pepper.  Bring to a boil and skim the surface thoroughly of any impurities that rise.', 236, '2011-03-02 03:24:37', '2011-03-02 03:24:37'),
(1098, 3, 'Lower the heat and add carrot, onion, garlic, ginger, and the lemongrass bundle.  Adjust heat so water barely bubbles. Cover and poach chicken for 25 minutes.  Lift chicken out of the pot and transfer to a plate.  When it''s cool enough to handle, pull meat off the bones and shred the meat into large pieces.  Set aside.', 236, '2011-03-02 03:24:37', '2011-03-02 03:24:37'),
(1099, 4, 'Add soy sauce to broth and return to a boil.  Add noodles , scallions, shiitakes, and bok choy; cook for 4 minutes, stirring occasionally, or until noodles are tender.  Add chicken and heat through.  Discard lemongrass bundles. Stir in the cilantro or basil before serving.', 236, '2011-03-02 03:24:38', '2011-03-02 03:24:38'),
(1100, 1, 'Place rice, two cups of water, and the cinnamon stick in a blender and blend for 30 seconds.  Add remaining water and process for additional 30 seconds.', 237, '2011-03-06 04:34:37', '2011-03-06 04:34:37'),
(1101, 2, 'Pour in a picture and let soak overnight.  Remove from fridge and bring to room temperature.  ', 237, '2011-03-06 04:34:37', '2011-03-06 04:34:37'),
(1102, 3, 'Stir the mixture and then run through a fine mesh sieve.  Add sugar and vanilla and stir until sugar has dissolved.   Serve over ice.  Place leftovers in picture in the fridge.  ', 237, '2011-03-06 04:34:37', '2011-03-06 04:34:37'),
(1103, 1, 'Place 2 racks in upper and lower thirds of oven and preheat to 350 degrees.  Line 2 baking sheets with parchment paper.  ', 238, '2011-03-08 18:36:30', '2011-03-08 18:36:30'),
(1104, 2, 'Sift dry ingredients into a large bowl, pouring back into bowl any remaining bits of grain or other ingredients into sifter.', 238, '2011-03-08 18:36:30', '2011-03-08 18:36:30'),
(1105, 3, 'Add butter and sugar to bowl of a standing mixer fitted with a paddle attachment.  With mixer on low speed, mix until butter and sugars are blended, about 2 minutes.  Use a spatula to scrape down sides of bowl.  Add eggs one at a time, mixing until each is combined.  Mix in vanilla.  Add flour mixture to bowl and blend on low speed until flour is barely combined, about 30 seconds.  Scrape down sides and bottom of bowl.', 238, '2011-03-08 18:36:30', '2011-03-08 18:36:30'),
(1106, 4, 'Add chocolate all at once to batter.  Mix on low speed until chocolate is evenly combined.  Use a spatula to scrape down sides and bottoms of bowl, then scrape batter onto a work surface and use your hands to fully incorporate all ingredients.', 238, '2011-03-08 18:36:30', '2011-03-08 18:36:30'),
(1107, 5, 'Scoop mounds of dough about 3 tablespoons in size onto baking sheet, leaving 3 inches between then, or about 6 to a sheet.', 238, '2011-03-08 18:36:30', '2011-03-08 18:36:30'),
(1108, 6, 'Bake cookies for 16 to 20 minutes, rotating sheets halfway through, until cookies are evenly dark brown.  Transfer cookies, still on parchment, to cooling rack to cool and repeat with remaining dough.  ', 238, '2011-03-08 18:36:30', '2011-03-08 18:36:30'),
(1109, 1, 'Combine all ingredients except honey in a medium bowl that has been sprayed with nonstick spray.', 239, '2011-03-08 18:42:24', '2011-03-08 18:42:24'),
(1110, 2, 'Bring honey to a boil in small saucepan.  Reduce heat to low and simmer for about 8 minutes, until the honey reaches 275 degrees on a candy thermometer.  ', 239, '2011-03-08 18:42:24', '2011-03-08 18:42:24'),
(1111, 3, 'Pour over cereal mixture and quickly stir to coat evenly.  Press into 8 X 8 inch pan that has been sprayed with canola oil or nonstick spray.  Cool completely and cut into bars before serving.', 239, '2011-03-08 18:42:24', '2011-03-08 18:42:24'),
(1112, 0, 'Preheat oven to 360* F.\r\nMix together pumpkin, egg, sugar, vegetable oil, and vanilla. In a separate bowl, combine flour, cinnamon, salt, baking soda, and baking powder.', 240, '2011-03-09 19:58:21', '2011-03-09 19:58:21'),
(1113, 1, 'Combine wet and dry ingredients until mixed well. Stir in chocolate chips. Drop by spoonful onto a baking sheet and bake for 11-12 minutes. Let the cookies cool completely before putting them away. ', 240, '2011-03-09 19:58:21', '2011-03-09 19:58:21'),
(1114, 2, 'Note:  These cookies are soft.  More like muffin tops.  Really good for a quick breakfast or healthy snack.', 240, '2011-03-09 19:58:21', '2011-03-09 19:58:21'),
(1115, 1, 'Place all ingredients in a blender and process until smooth.  ENJOY!', 241, '2011-03-11 16:07:51', '2011-03-11 16:07:51'),
(1116, 0, 'Place all ingredients in a blender and process until smooth.  ENJOY!', 242, '2011-03-11 16:33:24', '2011-03-11 16:33:24'),
(1117, 1, 'Cook pasta in generously salted water until al dente.  Reserve 1 cup of pasta water.  ', 243, '2011-03-13 04:23:27', '2011-03-13 04:23:27'),
(1118, 2, 'Toss pasta with remaining ingredients.  Adjust consistency with reserved pasta water as desired.', 243, '2011-03-13 04:23:27', '2011-03-13 04:23:27'),
(1119, 3, 'Season with salt and pepper.  Serve topped with cheese.', 243, '2011-03-13 04:23:27', '2011-03-13 04:23:27'),
(1120, 7, 'Add cooked rice to pan; cook 2 minutes, stirring constantly.\r\n\r\n', 244, '2011-03-21 02:13:41', '2011-03-21 02:13:41'),
(1121, 8, 'Add tofu, egg and soy sauce mixture; cook 30 seconds, stirring constantly.\r\nServe hot with extra green onions for garnish.', 244, '2011-03-21 02:13:41', '2011-03-21 02:13:41'),
(1122, 1, 'Loosely wrap tofu cubes in an absorbent kitchen towel for 15 minutes to remove moisture.', 244, '2011-03-21 02:13:41', '2011-03-21 02:13:41'),
(1123, 2, 'Heat 1 tablespoon canola oil in a large nonstick skillet over medium-high heat.\r\n', 244, '2011-03-21 02:13:41', '2011-03-21 02:13:41'),
(1124, 3, 'Add tofu and sprinkle with sea salt.  Cook until lightly browned on all sides. Remove from pan.\r\n ', 244, '2011-03-21 02:13:41', '2011-03-21 02:13:41'),
(1125, 4, 'Add eggs to pan; cook 1 minute or until done, breaking eggs into small pieces.  Set aside with tofu.\r\n  ', 244, '2011-03-21 02:13:41', '2011-03-21 02:13:41'),
(1126, 5, 'Add 1 tablespoon canola oil to pan.  Add 1 c onions, peas and carrots, garlic and ginger; saute 2 minutes.\r\n\r\n', 244, '2011-03-21 02:13:41', '2011-03-21 02:13:41'),
(1127, 6, 'While vegetable mixture cooks, combine sake, soy sauce, hoisin sauce, and sesame oil.\r\n\r\n', 244, '2011-03-21 02:13:41', '2011-03-21 02:13:41'),
(1128, 1, 'In a large bowl, using an electric mixer, beat together butter, peanut butter, brown sugar, and vanilla until creamy. Beat in eggs and water.', 245, '2011-03-29 18:34:19', '2011-03-29 18:34:19'),
(1129, 2, 'Mix together flours, oats, wheat germ, salt, cinnamon, and baking soda. Mix into peanut butter mixture. Stir in chocolate chips. Drop by ice cream scoopfuls 2 1/2 inches apart on greased cookie sheets. Flatten slightly.', 245, '2011-03-29 18:34:19', '2011-03-29 18:34:19'),
(1130, 3, 'Bake at 350 degrees F (175 degrees C) for 18 - 20 minutes. Cool on cookie sheet for 2 minutes, then transfer to cooling racks. Store in an airtight container.', 245, '2011-03-29 18:34:19', '2011-03-29 18:34:19'),
(1131, 4, 'Note:  I make smaller cookies (heaping tablespoon) and bake for 12 minutes.', 245, '2011-03-29 18:34:19', '2011-03-29 18:34:19'),
(1132, 1, 'Preheat oven to 400 degrees.  Drain artichoke hearts, reserving 1 Tbsp. oil.  Toss artichokes in oil on a rimmed baking sheet; bake until dark brown, about 15 minutes.  ', 246, '2011-04-05 01:26:49', '2011-04-05 01:26:49'),
(1133, 2, 'Prepare hummus by combining drained and rinsed chickpeas with tahini, oil, garlic, lemon juice, salt, pepper, and water.  Process until smooth scraping down the sides as necessary.', 246, '2011-04-05 01:26:49', '2011-04-05 01:26:49'),
(1134, 3, 'To prepare sandwiches, spread 2 Tbsp. hummus on each slice of olive bread.  top with artichokes, pepperoncini peppers, sun-dried tomatoes, and feta.  Place in 400 degree oven for 2-5 minutes to warm through.', 246, '2011-04-05 01:26:49', '2011-04-05 01:26:49'),
(1135, 1, 'Preheat oven to 350 degrees.  Combine 1 cup of sugar, oil, and egg in a medium bowl, and stir with a whisk until smooth.  Stir in milk and yogurt.', 247, '2011-04-11 02:30:32', '2011-04-11 02:30:32'),
(1136, 2, 'Lightly spoon flour into dry measuring cups, and level with a knife.  Combine flour, 1/4 cup coconut, orange rind, baking soda, and 1/2 teaspoon salt in a large bowl, stirring with a whisk.  Make a well in the center of flour mixture, and add milk mixture to flour mixture, stirring just until moist.  ', 247, '2011-04-11 02:30:32', '2011-04-11 02:30:32'),
(1137, 3, 'Spoon batter into a 9 x 5 inch loaf pan coated with cooking spray.  Sprinkle with remaining 1 tablespoon coconut.  Bake at 350 degrees for 50 minutes or until a wooden pick inserted in center comes out clean.  Cool in pan 10 minutes.  ', 247, '2011-04-11 02:30:32', '2011-04-11 02:30:32'),
(1138, 1, 'Bring a large pot of salted water to a boil.  Cook noodles until tender; drain and return to pot.  Stir in butter; cover and set aside.', 248, '2011-04-11 02:43:47', '2011-04-11 02:43:47'),
(1139, 2, 'Meanwhile, in a medium bowl, combine pork with 1 tablespoon paprika; season with salt and pepper, and toss to coat.  In a large skillet, heat 1 tablespoon olive oil over medium-high heat; cook pork, tossing occasionally, until lightly browned on all sides, 3 to 5 minutes.  Transfer to a plate (reserve skillet).', 248, '2011-04-11 02:43:47', '2011-04-11 02:43:47'),
(1140, 3, 'Return skillet to stove; reduce heat to medium.  Add remaining tablespoon oil and onion; cook until onion is soft, 4 to 5 minutes.  Add pork, remaining tablespoon paprika, tomatoes, and 1/2 cup water; bring to a boil.  Reduce to a simmer; cook, until sauce is slightly thickened, 2 to 4 minutes.', 248, '2011-04-11 02:43:47', '2011-04-11 02:43:47'),
(1141, 4, 'Remove skillet from heat, and stir in sour cream; season with salt and pepper.  Serve paprikash over noodles, garnish with parsley, is desired.', 248, '2011-04-11 02:43:47', '2011-04-11 02:43:47'),
(1142, 0, 'Bring a large pot of salted water to a boil.  Cook noodles until tender; drain and return to pot.  Stir in butter; cover and set aside.', 249, '2011-04-11 02:49:33', '2011-04-11 02:49:33'),
(1143, 1, 'Meanwhile, in a medium bowl, combine pork with 1 tablespoon paprika; season with salt and pepper, and toss to coat.  In a large skillet, heat 1 tablespoon olive oil over medium-high heat; cook pork, tossing occasionally, until lightly browned on all sides, 3 to 5 minutes.  Transfer to a plate (reserve skillet).', 249, '2011-04-11 02:49:33', '2011-04-11 02:49:33'),
(1144, 2, 'Return skillet to stove; reduce heat to medium.  Add remaining tablespoon oil and onion; cook until onion is soft, 4 to 5 minutes.  Add pork, remaining tablespoon paprika, tomatoes, and 1/2 cup water; bring to a boil.  Reduce to a simmer; cook, until sauce is slightly thickened, 2 to 4 minutes.', 249, '2011-04-11 02:49:33', '2011-04-11 02:49:33'),
(1145, 3, 'Remove skillet from heat, and stir in sour cream; season with salt and pepper.  Serve paprikash over noodles, garnish with parsley, is desired.', 249, '2011-04-11 02:49:33', '2011-04-11 02:49:33'),
(1146, 0, 'Bring a large pot of salted water to a boil.  Cook noodles until tender; drain and return to pot.  Stir in butter; cover and set aside.', 250, '2011-04-11 02:50:12', '2011-04-11 02:50:12'),
(1147, 1, 'Meanwhile, in a medium bowl, combine pork with 1 tablespoon paprika; season with salt and pepper, and toss to coat.  In a large skillet, heat 1 tablespoon olive oil over medium-high heat; cook pork, tossing occasionally, until lightly browned on all sides, 3 to 5 minutes.  Transfer to a plate (reserve skillet).', 250, '2011-04-11 02:50:12', '2011-04-11 02:50:12'),
(1148, 2, 'Return skillet to stove; reduce heat to medium.  Add remaining tablespoon oil and onion; cook until onion is soft, 4 to 5 minutes.  Add pork, remaining tablespoon paprika, tomatoes, and 1/2 cup water; bring to a boil.  Reduce to a simmer; cook, until sauce is slightly thickened, 2 to 4 minutes.', 250, '2011-04-11 02:50:12', '2011-04-11 02:50:12'),
(1149, 3, 'Remove skillet from heat, and stir in sour cream; season with salt and pepper.  Serve paprikash over noodles, garnish with parsley, is desired.', 250, '2011-04-11 02:50:12', '2011-04-11 02:50:12'),
(1150, 1, 'Preheat oven to 350 degrees.  In a large mixing bowl, beat together with electric mixer, oil, applesauce, and brown sugar. Add egg, vanilla, and juices, then beat again. Sift together oat bran, 7 grain cereal, flours, baking soda, salt, and spices. Mix these ingredients with the wet mixture. Stir in oats. Fold in raisins (and any other optional ingredients).', 251, '2011-04-14 03:33:34', '2011-04-14 03:33:34'),
(1151, 2, 'Place dough on ungreased cookie sheets by the tablespoonful. Bake 15 minutes or until golden. Remove cookies from the sheet immediately and let cool. Yield: 3 dozen large cookies.', 251, '2011-04-14 03:33:34', '2011-04-14 03:33:34'),
(1152, 1, 'Heat the oil in a large nonstick saucepan.  Add the mustard seeds and once they are popping, turn the heat down and add the onion and cinnamon.  Cook the onion until golden, about 8 minutes.', 252, '2011-04-15 02:42:14', '2011-04-15 02:42:14'),
(1153, 2, 'Meanwhile, using a blender, make a fine paste of the ginger, garlic and cayenne with 3 tbsp. water.  Add this to the cooked onions along with the cumin, coriander, turmeric and garam masala.  Cook until reduced, then fry over low heat for 2 minutes or until the oil is released.  Add the tomatoes and 1/2 cup water; cook until completely reduced, about 10 minutes, and fry the paste for 4 to 5 minutes or until the oil rises to the top.', 252, '2011-04-15 02:42:14', '2011-04-15 02:42:14'),
(1154, 3, 'Stir in the coconut milk and remaining 1/2 cup water, bring to a gentle simmer, and allow the flavors to marry and develop for 5 minutes.  Add the fish, and cook until done, abound 4 or 5 minutes. Add kosher salt and black pepper to taste, then serve.', 252, '2011-04-15 02:42:14', '2011-04-15 02:42:14'),
(1155, 4, 'Note:  this is also good made with prawns, mussels, clams, or squid in place of the fish.', 252, '2011-04-15 02:42:14', '2011-04-15 02:42:14'),
(1156, 1, 'Preheat oven to 400 degrees and grease 12 muffin cups.', 253, '2011-04-19 20:25:44', '2011-04-19 20:25:44'),
(1157, 2, 'Soak wheat bran in milk for 20 minutes. Add to same bowl the brown sugar, the egg, lightly beaten, the canola oil, vanilla, banana and orange zest.\r\n\r\n', 253, '2011-04-19 20:25:44', '2011-04-19 20:25:44'),
(1158, 3, 'In another bowl, combine dry ingredients. Add dry to wet and stir to combine. Put batter in muffin tin and bake for 20 minutes.', 253, '2011-04-19 20:25:44', '2011-04-19 20:25:44'),
(1159, 1, 'Preheat oven to 400°F. Coat 12 muffin cups with cooking spray.', 254, '2011-04-21 20:16:14', '2011-04-21 20:16:14'),
(1160, 2, 'Whisk eggs and brown sugar in a medium bowl until smooth. Whisk in bananas, buttermilk, wheat bran, oil and vanilla.', 254, '2011-04-21 20:16:14', '2011-04-21 20:16:14'),
(1161, 3, 'Whisk whole-wheat flour, all-purpose flour, baking powder, baking soda, cinnamon and salt in a large bowl. Make a well in the dry ingredients; add the wet ingredients and stir with a rubber spatula until just combined. Stir in chocolate chips, if using. Scoop the batter into the prepared muffin cups (they’ll be quite full). Sprinkle with walnuts, if using.', 254, '2011-04-21 20:16:14', '2011-04-21 20:16:14'),
(1162, 4, 'Bake the muffins until the tops are golden brown and spring back when touched lightly, 15 to 25 minutes. Let cool in the pan for 5 minutes. Loosen edges and turn muffins out onto a wire rack to cool slightly before serving.', 254, '2011-04-21 20:16:14', '2011-04-21 20:16:14'),
(1163, 1, 'In a large bowl, mix together flours, salt, and yeast.  (Add raisins now if mixing by hand; if using mixer or food processor, add after dough is removed from mixer or processor.', 255, '2011-04-22 03:35:18', '2011-04-22 03:35:18'),
(1164, 2, 'In a saucepan over medium heat, combine milk, water, honey and butter  Heat until lukewarm, between 105 and 110 degrees.  (Butter does not have to be completely melted.)  Add to dry ingredients and mix by hand or with mixer until thoroughly blended.  Add enough flour  to make a soft dough.  ', 255, '2011-04-22 03:35:18', '2011-04-22 03:35:18'),
(1165, 3, 'On a lightly floured board, knead dough until smooth and elastic, about 10 minutes.   Alternatively, use mixer with dough hook for 5 minutes, adding the raisins at this time.  Place dough in a large oiled bowl, turn, cover with towel, and let rise in a warm place until doubled in size, from 45 minutes to 2 hours.  Punch dough down.  Divide dough in half.  On lightly floured board, roll each ball of dough into  circle, about 3/4 inch thick.', 255, '2011-04-22 03:35:18', '2011-04-22 03:35:18'),
(1166, 4, 'TO MAKE FILLING:  In a small bowl, combine sugar, cinnamon and vanilla.  Brush each half of dough with half the sugar-cinnamon mixture.  Roll up as you would a jellyroll or dough for cinnamon rolls.  Place each rolled loaf seam side down in a lightly oiled 9 X 5 inch or 8 1/2 by 4 1/4 inch bread pan.  Cover pans with a paper towel, let dough rise in a warm place until doubled in size; time will vary depending on warmth and humidity of the room.  Preheat the oven to 375 degrees.  Bake loaves about 35 minutes, or until deep golden brown.  Finished loaves will sound hollow when thumped with your finger.  Cool pans about 10 minutes, remove from pans, coll on wire racks.  Wrap well if freezing loaves.', 255, '2011-04-22 03:35:18', '2011-04-22 03:35:18'),
(1167, 1, 'Preheat oven to 350 degrees.  In a medium bowl, whisk together flour, cocoa, baking powder, and 1/4 teaspoon salt. Set aside.', 257, '2011-04-29 19:34:15', '2011-04-29 19:34:15'),
(1168, 2, 'Using and electric mixer, beat butter and sugar until light and fluffy.  eat in egg and vanilla.  With mixer on low, gradually add flour mixture; mix just until combined.', 257, '2011-04-29 19:34:15', '2011-04-29 19:34:15'),
(1169, 3, 'Form balls of dough (each equal to 1 teaspoon), and place on two baking sheets, about 2 inches apart.  Dip the bottom of a glass in water, and flatten balls into 1 1/2 inch rounds (about 1/4 inch thick).  Bake until slightly firm to the touch, 8 to 10 minutes, rotating sheets halfway through. Immediately transfer cookies to a wire rack to cool completely.', 257, '2011-04-29 19:34:15', '2011-04-29 19:34:15'),
(1170, 4, 'Make chocolate coating:  Place chocolate, peppermint extract, and remaining 1/8 teaspoon salt in a large heatproof bowl set over (not in) a saucepan of simmering water.  Heat, stirring occasionally, until smooth, 2 to 3 minutes; remove from heat.', 257, '2011-04-29 19:34:15', '2011-04-29 19:34:15'),
(1171, 5, 'Line a baking sheet with parchment or waxed paper.  Set each cookie across the tines of a fork, dunk in chocolate, then tap underside of fork on side of the bowl to allow excess chocolate to drip off.  Place cookies on prepared baking sheet, and decorate with sprinkles, if desired.  Refrigerate until chocolate has hardened, about 30 minutes, and keep chilled until ready to serve.', 257, '2011-04-29 19:34:15', '2011-04-29 19:34:15'),
(1172, 0, 'Preheat oven to 350 degrees.  In a medium bowl, whisk together flour, cocoa, baking powder, and 1/4 teaspoon salt. Set aside.', 258, '2011-04-29 19:35:59', '2011-04-29 19:35:59'),
(1173, 1, 'Using and electric mixer, beat butter and sugar until light and fluffy.  Beat in egg and vanilla.  With mixer on low, gradually add flour mixture; mix just until combined.', 258, '2011-04-29 19:35:59', '2011-04-29 19:35:59'),
(1174, 2, 'Form balls of dough (each equal to 1 teaspoon), and place on two baking sheets, about 2 inches apart.  Dip the bottom of a glass in water, and flatten balls into 1 1/2 inch rounds (about 1/4 inch thick).  Bake until slightly firm to the touch, 8 to 10 minutes, rotating sheets halfway through. Immediately transfer cookies to a wire rack to cool completely.', 258, '2011-04-29 19:35:59', '2011-04-29 19:35:59'),
(1175, 3, 'Make chocolate coating:  Place chocolate, peppermint extract, and remaining 1/8 teaspoon salt in a large heatproof bowl set over (not in) a saucepan of simmering water.  Heat, stirring occasionally, until smooth, 2 to 3 minutes; remove from heat.', 258, '2011-04-29 19:35:59', '2011-04-29 19:35:59'),
(1176, 4, 'Line a baking sheet with parchment or waxed paper.  Set each cookie across the tines of a fork, dunk in chocolate, then tap underside of fork on side of the bowl to allow excess chocolate to drip off.  Place cookies on prepared baking sheet, and decorate with sprinkles, if desired.  Refrigerate until chocolate has hardened, about 30 minutes, and keep chilled until ready to serve.', 258, '2011-04-29 19:35:59', '2011-04-29 19:35:59'),
(1177, 1, 'Line  a 12-cup muffin tin with paper liners.  ', 259, '2011-04-29 20:12:28', '2011-04-29 20:12:28'),
(1178, 2, 'Melt butter in a small saucepan over medium.  Stir in peanut butter, graham cracker crumbs, and maple or raw sugar; mix well.  Remove from heat.   Divide mixture evenly among muffin cups, about 2 tablespoons per cup.  ', 259, '2011-04-29 20:12:28', '2011-04-29 20:12:28'),
(1179, 3, 'Combine chocolate and milk in another saucepan.  Stir over medium heat until chocolate has melted.  Spoon evenly over peanut butter mixture.  Top with chopped nuts.  Refrigerate until set, about 2 hours.', 259, '2011-04-29 20:12:28', '2011-04-29 20:12:28'),
(1180, 0, 'In a large pot, combine chickpeas, bay leaf, saffron and 7 cups water.  Cover, bring to a boil.  Reduce heat, and simmer, partially covered, 1 1/2 hours, until chickpeas are almost tender.  Be sure to check periodically and add water if needed.', 261, '2011-04-29 20:31:54', '2011-04-29 20:31:54'),
(1181, 1, 'In a medium skillet, heat oil over medium heat.  Add onions, and cook stirring often, until softened, about 7 minutes.  Add garlic, pepper flakes, cumin, coriander, ginger and cinnamon.  Cook, stirring often, until fragrant, 2 to 3 minutes.  Stir onion mixture into chickpeas, and simmer until chickpeas are completely tender, about 30 minutes.  Remove beans from heat, stir in 1 1/2 teaspoons salt, and let stand 5 minutes.', 261, '2011-04-29 20:31:54', '2011-04-29 20:31:54'),
(1182, 2, 'Remove bay leaf.  Transfer half of soup to a food processor or blender, and process until smooth.  Pour puree back into soup.  Add additional water, if necessary, to thin soup.  Add lemon juice and more salt if desired.  Stir in parsley.  Serve hot, garnished with extra parsley.', 261, '2011-04-29 20:31:54', '2011-04-29 20:31:54'),
(1183, 0, 'Preheat oven to 375°F and butter an 8-inch round baking pan. Line bottom with a round of wax paper and butter the paper.\r\n', 262, '2011-05-03 18:47:11', '2011-05-03 18:47:11'),
(1184, 2, 'Dust cake with additional cocoa powder and serve with sorbet if desired. (Cake keeps, after being cooled completely, in an airtight container, 1 week.)\r\n', 262, '2011-05-03 18:47:11', '2011-05-03 18:47:11'),
(1185, 0, 'Preheat oven to 375°F and butter an 8-inch round baking pan. Line bottom with a round of wax paper and butter the paper.\r\n', 263, '2011-05-03 18:48:15', '2011-05-03 18:48:15'),
(1186, 2, 'Dust cake with additional cocoa powder and serve with sorbet if desired. (Cake keeps, after being cooled completely, in an airtight container, 1 week.)', 263, '2011-05-03 18:48:16', '2011-05-03 18:48:16'),
(1187, 0, 'Heat oven to 350 degrees.  Grease 13 X 9 X 2 inch baking pan.', 264, '2011-05-03 22:25:02', '2011-05-03 22:25:02'),
(1188, 1, 'Stir together cocoa and baking soda in a large bowl; stir in 1/3 cup butter.  Add boiling water; stir until mixture thickens.  Stir in sugar, eggs and remaining 1/3 cup butter; stir  until smooth.  Add flour, vanilla and salt; blend completely.  Stir in chocolate chips.  Pour into prepared pan.', 264, '2011-05-03 22:25:02', '2011-05-03 22:25:02'),
(1189, 2, 'Bake 35 to 40 minutes or until brownies begin to pull away from sides of pan.  Cool completely in pan on wire rack.  Frost if desired.  Cut into squares.  ', 264, '2011-05-03 22:25:02', '2011-05-03 22:25:02'),
(1190, 1, 'Soak dried tomatoes in water for 15 to 20 minutes.  Drain, then chop finely.', 265, '2011-05-04 18:16:38', '2011-05-04 18:16:38'),
(1191, 2, 'Stir tarragon and tomatoes into cheese.  Add salt and black pepper to taste.', 265, '2011-05-04 18:16:39', '2011-05-04 18:16:39'),
(1192, 3, 'Serve with your favorite cracker or whole wheat baguette that has been sliced and warmed.', 265, '2011-05-04 18:16:39', '2011-05-04 18:16:39'),
(1193, 0, 'Heat oven to 350°F. Grease and flour two 9-inch round baking pans.\r\n', 266, '2011-05-09 00:42:39', '2011-05-09 00:42:39'),
(1194, 1, 'Stir together sugar, flour, cocoa, baking powder, baking soda and salt in large bowl. Add eggs, milk, oil and vanilla; beat on medium speed of mixer 2 minutes. Stir in boiling water (batter will be thin). Pour batter into prepared pans. ', 266, '2011-05-09 00:42:39', '2011-05-09 00:42:39'),
(1195, 2, 'Bake 30 to 35 minutes or until wooden pick inserted in center comes out clean. Cool 10 minutes; remove from pans to wire racks. Cool completely. Frost with "PERFECTLY CHOCOLATE" CHOCOLATE FROSTING in this database. 10 to 12 servings. ', 266, '2011-05-09 00:42:39', '2011-05-09 00:42:39'),
(1196, 0, 'Blend garlic & jalapeno in food processor', 267, '2011-05-11 19:01:39', '2011-05-11 19:01:39'),
(1197, 1, 'Blend in garbanzo beans & tahini', 267, '2011-05-11 19:01:39', '2011-05-11 19:01:39'),
(1198, 2, 'Add lemon juice and yogurt until you like the consistency', 267, '2011-05-11 19:01:39', '2011-05-11 19:01:39'),
(1199, 3, 'Add sea salt to taste.', 267, '2011-05-11 19:01:39', '2011-05-11 19:01:39'),
(1200, 4, 'Use yogurt to soften the hummus after it has been in the refrigerator.', 267, '2011-05-11 19:01:39', '2011-05-11 19:01:39'),
(1201, 5, 'NOTE:  For variety, add roasted garlic or roasted red bell pepper.  Also, if hummus thickens in refrigerator, stir in plain yogurt to moisten.', 267, '2011-05-11 19:01:39', '2011-05-11 19:01:39'),
(1202, 7, 'Add tofu, egg and soy sauce mixture; cook 30 seconds, stirring constantly.\r\nServe hot with extra green onions for garnish.', 268, '2011-05-21 00:15:00', '2011-05-21 00:15:00'),
(1203, 0, 'Loosely wrap tofu cubes in an absorbent kitchen towel for 15 minutes to remove moisture.', 268, '2011-05-21 00:15:00', '2011-05-21 00:15:00'),
(1204, 1, 'Heat 1 tablespoon canola oil in a large nonstick skillet over medium-high heat.\r\n', 268, '2011-05-21 00:15:00', '2011-05-21 00:15:00'),
(1205, 7, 'Add cooked rice to pan; cook 2 minutes, stirring constantly.', 269, '2011-05-24 02:56:43', '2011-05-24 02:56:43'),
(1206, 8, 'Add tofu, egg and soy sauce mixture; cook 30 seconds, stirring constantly.\r\nServe hot with extra green onions for garnish.', 269, '2011-05-24 02:56:43', '2011-05-24 02:56:43'),
(1207, 1, 'Loosely wrap tofu cubes in an absorbent kitchen towel for 15 minutes to remove moisture.', 269, '2011-05-24 02:56:43', '2011-05-24 02:56:43'),
(1208, 2, 'Heat 1 tablespoon canola oil in a large nonstick skillet over medium-high heat.', 269, '2011-05-24 02:56:43', '2011-05-24 02:56:43'),
(1209, 3, 'Add tofu and sprinkle with sea salt.  Cook until lightly browned on all sides. Remove from pan.\r\n ', 269, '2011-05-24 02:56:43', '2011-05-24 02:56:43'),
(1210, 4, 'Add eggs to pan; cook 1 minute or until done, breaking eggs into small pieces.  Set aside with tofu.', 269, '2011-05-24 02:56:43', '2011-05-24 02:56:43'),
(1211, 5, 'Add 1 tablespoon canola oil to pan.  Add 1 c onions, peas and carrots, garlic and ginger; saute 2 minutes.', 269, '2011-05-24 02:56:43', '2011-05-24 02:56:43'),
(1212, 6, 'While vegetable mixture cooks, combine sake, soy sauce, hoisin sauce, chili sauce and sesame oil.', 269, '2011-05-24 02:56:43', '2011-05-24 02:56:43'),
(1213, 1, 'Preheat oven to 375°F and butter an 8-inch round baking pan. Line bottom with a round of wax paper and butter paper.\r\n\r\n', 270, '2011-05-24 03:03:46', '2011-05-24 03:03:46'),
(1214, 2, 'Chop chocolate into small pieces. In a double boiler or metal bowl set over a saucepan of barely simmering water melt chocolate with butter, stirring, until smooth. Remove top of double boiler or bowl from heat and whisk sugar into chocolate mixture. Add eggs and whisk well. Sift 1/2 cup cocoa powder over chocolate mixture and whisk until just combined. Pour batter into pan and bake in middle of oven 25 minutes, or until top has formed a thin crust. Cool cake in pan on a rack 5 minutes and invert onto a serving plate.\r\n\r\n\r\n', 270, '2011-05-24 03:03:46', '2011-05-24 03:03:46'),
(1215, 3, 'Dust cake with additional cocoa powder and serve with sorbet if desired. (Cake keeps, after being cooled completely, in an airtight container, 1 week.)\r\n\r\n', 270, '2011-05-24 03:03:46', '2011-05-24 03:03:46'),
(1216, 0, 'Preheat oven to 350 degrees and grease a 9x13 pan.', 271, '2011-05-24 19:35:07', '2011-05-24 19:35:07'),
(1217, 1, 'Beat together eggs and butter, stir together dry ingredients except fruit. Add flour to eggs, stir to combine, then stir in fruit, nuts, and chips. ', 271, '2011-05-24 19:35:07', '2011-05-24 19:35:07'),
(1218, 2, 'Spread evenly in pan, bake 30 minutes.  Bars will still be soft when done. Cool, cut into 24 pieces, wrap in GLAD press and seal and freeze. Enjoy!!', 271, '2011-05-24 19:35:07', '2011-05-24 19:35:07'),
(1219, 1, 'Add soap and essential oils to a 32 oz. spray bottle.  Add water until almost filled.  Place cap on bottle and shake gently until mixed.  Use to clean tub, tile and metal surfaces.', 272, '2011-05-24 21:17:25', '2011-05-24 21:17:25'),
(1220, 6, 'Add salt and water and bring to a boil.  Cover and simmer 40 minutes, or until rice is tender.', 273, '2011-05-26 21:06:28', '2011-05-26 21:06:28'),
(1221, 7, 'Remove bay leaf and cardamom pods, which will have floated to the top.', 273, '2011-05-26 21:06:28', '2011-05-26 21:06:28'),
(1222, 8, 'Gently stir in the tofu, cashews, and cilantro and cook for 5 - 10 minutes.', 273, '2011-05-26 21:06:28', '2011-05-26 21:06:28'),
(1223, 0, 'Do Ahead:  Soak brown basmati rice 4-6 hours.  Drain rice, rinse 3 times, set aside.', 273, '2011-05-26 21:06:28', '2011-05-26 21:06:28'),
(1224, 1, 'Drain and cut tofu into small cubes. Place between a folded clean dry towel while prepping vegetables.  Marinate tofu in soy sauce for 15 minutes to 1 hour before cooking.', 273, '2011-05-26 21:06:28', '2011-05-26 21:06:28'),
(1225, 2, 'Heat 1 tablespoon of oil in a non stick frying pan over medium-high heat.  Lightly brown tofu pieces on 2 sides and set aside.', 273, '2011-05-26 21:06:28', '2011-05-26 21:06:28'),
(1226, 3, 'Saute veggies, including jalapeno and fresh ginger, in 2 tablespoons oil for 5 to 10 minutes.', 273, '2011-05-26 21:06:28', '2011-05-26 21:06:28'),
(1227, 4, 'Add remaining spices and herbs, except cilantro, and saute another 2 minutes.', 273, '2011-05-26 21:06:28', '2011-05-26 21:06:28'),
(1228, 5, 'Add rinsed, drained rice, saute another 2 minutes. ', 273, '2011-05-26 21:06:28', '2011-05-26 21:06:28'),
(1229, 1, 'Cook orzo according to package directions, omitting salt and fat.  Drain and rinse, drain well.  Place orzo, corn, and next 3 ingredients (through beans) in a large bowl; toss.  ', 274, '2011-07-06 16:25:54', '2011-07-06 16:25:54'),
(1230, 2, 'Combine buttermilk, 2 tablespoons cilantro, and next 8 ingredients (through garlic) in a small bowl, stirring with a whisk.  Drizzle over orzo mixture; toss.  ', 274, '2011-07-06 16:25:54', '2011-07-06 16:25:54'),
(1231, 3, 'Place in serving bowls and top with remaining cilantro, parsley, and chopped avocado pieces.', 274, '2011-07-06 16:25:54', '2011-07-06 16:25:54'),
(1232, 0, 'Place all ingredients in a medium saucepan with a lid.  Simmer on very low for 30 minutes.  Use on your favorite homemade pizza or as a dip for cheese bread.  ', 276, '2011-07-19 19:35:00', '2011-07-19 19:35:00'),
(1233, 1, '1.  To make dressing, whisk mayonnaise, cilantro, water, scallion, lime juice, sugar and chili powder together in a small bowl until smooth. Transfer to a jar or a plastic container with a tight-fitting lid and refrigerate until ready to use.\r\n', 277, '2011-07-28 01:36:58', '2011-07-28 01:36:58'),
(1234, 2, 'In a large bowl or food storage container, layer remaining ingredients in order listed. Cover and refrigerate. (Note: Storing this salad in layers instead of tossing it immediately and keeping the dressing separate helps to keep the salad fresh. It can be stored up to 4 days in the refrigerator.)\r\n', 277, '2011-07-28 01:36:58', '2011-07-28 01:36:58'),
(1235, 3, 'To serve, spoon salad ingredients into a bowl, shake dressing and then drizzle over salad; toss. Yields about 2 cups of salad and 1 1/2 tablespoons of dressing per serving.', 277, '2011-07-28 01:36:58', '2011-07-28 01:36:58'),
(1236, 4, 'Note:  This salad goes great served with whole wheat cheese quesadillas.', 277, '2011-07-28 01:36:58', '2011-07-28 01:36:58');
INSERT INTO `steps` (`id`, `order_num`, `instruction`, `recipe_id`, `created_at`, `updated_at`) VALUES
(1237, 1, 'Juice limes (1/4 cup), and reserve juiced halves. Mash limes, juice, rum, mint, sugar and ginger in bowl with spoon. Strain into bowl after 20 minutes; discard solids.', 278, '2011-07-28 04:46:11', '2011-07-28 04:46:11'),
(1238, 2, 'Fill 4 glasses with ice, 1/2 cup rum mixture and 1/2 cup club soda. Garnish with mint sprigs.\r\n', 278, '2011-07-28 04:46:11', '2011-07-28 04:46:11'),
(1239, 6, 'Cool in tins for a few rnminutes then carefully lift them out to continue cooling on a rack.', 279, '2011-07-28 23:24:43', '2011-07-28 23:24:43'),
(1240, 0, 'Preheat oven to 400 degrees.', 279, '2011-07-28 23:24:44', '2011-07-28 23:24:44'),
(1241, 1, 'In a large bowl, dump the cereal, raisins and oil and pour the boiling water right over the top. Give it a stir or two and set aside.', 279, '2011-07-28 23:24:44', '2011-07-28 23:24:44'),
(1242, 2, 'In another bowl, combine the buttermilk, molasses, honey, eggs and rind. Pour that mess over the top of your warm cereal mixture, stirring to combine.', 279, '2011-07-28 23:24:44', '2011-07-28 23:24:44'),
(1243, 3, 'In yet another bowl, combine dry ingredients -- flour, baking soda, salt and add to the cereal mixture. ', 279, '2011-07-28 23:24:44', '2011-07-28 23:24:44'),
(1244, 4, 'Line your muffin tins with cupcake liners and fill 2/3 full with batter. ', 279, '2011-07-28 23:24:44', '2011-07-28 23:24:44'),
(1245, 5, 'Bake for 20 to 25 minutes.  ', 279, '2011-07-28 23:24:44', '2011-07-28 23:24:44'),
(1246, 1, 'Preheat oven to 350 degrees.  Place paper liners in a 12-cup muffin pan.', 280, '2011-08-05 04:06:58', '2011-08-05 04:06:58'),
(1247, 2, 'In a large bowl, mix dry ingredients.  In a medium bowl, whisk eggs, buttermilk, and oil. Mix in bananas until creamy.  Make a well in dry ingredients; add egg mixture. Fold in blueberries and walnuts.', 280, '2011-08-05 04:06:58', '2011-08-05 04:06:58'),
(1248, 3, 'Spoon batter into liners.  Bake 20-25 minutes.  Cool 5 minutes in pan. Enjoy.', 280, '2011-08-05 04:06:58', '2011-08-05 04:06:58'),
(1249, 4, 'Note:  These will keep 3 days in air tight container and are great warmed with butter.', 280, '2011-08-05 04:06:58', '2011-08-05 04:06:58'),
(1250, 1, 'Wash and dry salad greens (or buy pre-washed greens).  Place them in a large bowl.', 281, '2011-08-05 04:11:30', '2011-08-05 04:11:30'),
(1251, 2, 'Place remaining ingredients in separate bowls.', 281, '2011-08-05 04:11:30', '2011-08-05 04:11:30'),
(1252, 3, 'Mix each serving individually in a large bowl with enough dressing to taste and place each serving on a large dinner plate.', 281, '2011-08-05 04:11:30', '2011-08-05 04:11:30'),
(1253, 1, 'Heat oil in large skillet over medium heat.  Add onion and chayote, and cook 12 minutes, or until chayote is tender and onion begins to brown.  Stir in garlic, the corn, beans, and green or jalapenos in adobe in adobe; cook 5 minutes, or until heated through.  Stir in cilanto, then stir in 1/3 cup Jack cheese.  Season with salt and peper, if desired. ', 282, '2011-08-10 04:53:51', '2011-08-10 04:53:51'),
(1254, 2, 'Divide chayote mixture among warmed tortillas.  Sprinkle remaining 1/3 cup Jack cheese, over filling.  Roll up tortillas, leaving one end open.  Serve with salsa of choice.', 282, '2011-08-10 04:53:51', '2011-08-10 04:53:51'),
(1255, 0, 'Heat oil in large skillet over medium heat.  Add onion and chayote, and cook 12 minutes, or until chayote is tender and onion begins to brown.  Stir in garlic, the corn, beans, and green or jalapenos in adobe in adobe; cook 5 minutes, or until heated through.  Stir in cilanto, then stir in 1/3 cup Jack cheese.  Season with salt and peper, if desired. ', 283, '2011-08-10 04:55:14', '2011-08-10 04:55:14'),
(1256, 1, 'Divide chayote mixture among warmed tortillas.  Sprinkle remaining 1/3 cup Jack cheese, over filling.  Roll up tortillas, leaving one end open.  Serve with salsa of choice.', 283, '2011-08-10 04:55:14', '2011-08-10 04:55:14'),
(1257, 0, 'Have 8 standard pop molds ready to go in freezer.  Rinse and zest the lemon and place in a small saucepan with water and sugar.', 285, '2011-08-11 21:00:12', '2011-08-11 21:00:12'),
(1258, 1, 'Bring mixture to a boil over medium-high heat and stir until sugar dissolves.  Place in refrigerator to cool', 285, '2011-08-11 21:00:12', '2011-08-11 21:00:12'),
(1259, 2, 'Once syrup has chilled, add yogurt and honey.  Divide blackberries among molds; pour yogurt mixture evenly into molds.', 285, '2011-08-11 21:00:12', '2011-08-11 21:00:12'),
(1260, 3, 'Place molds in freezer until solid (3 to 4 hours).', 285, '2011-08-11 21:00:12', '2011-08-11 21:00:12'),
(1261, 0, 'Have 8 standard pop molds ready to go in freezer.  Rinse and zest the lemon placing the zest in a small saucepan with water and sugar. Reserve the rest of lemon for another use.', 286, '2011-08-11 21:01:04', '2011-08-11 21:01:04'),
(1262, 1, 'Bring mixture to a boil over medium-high heat and stir until sugar dissolves.  Place in refrigerator to cool', 286, '2011-08-11 21:01:04', '2011-08-11 21:01:04'),
(1263, 2, 'Once syrup has chilled, add yogurt and honey.  Divide blackberries among molds; pour yogurt mixture evenly into molds.', 286, '2011-08-11 21:01:04', '2011-08-11 21:01:04'),
(1264, 3, 'Place molds in freezer until solid (3 to 4 hours).', 286, '2011-08-11 21:01:04', '2011-08-11 21:01:04'),
(1265, 1, 'Mix cabbage through serrano pepper in a large bowl.  ', 287, '2011-08-11 23:17:57', '2011-08-11 23:17:57'),
(1266, 2, 'Heat oil in a very small skillet.  When oil is very hot add cumin and mustard seed and asafoetida.  Cook 20 seconds until seeds are popping and poor over the salad.  Add salt to taste.  Keep in fridge until ready to serve.', 287, '2011-08-11 23:17:57', '2011-08-11 23:17:57'),
(1267, 1, 'Preheat oven to 400 degrees F (200 degrees C). Line a baking sheet with aluminum foil. ', 288, '2011-08-30 02:39:16', '2011-08-30 02:39:16'),
(1268, 2, 'In a large bowl, mix the flour, oats, 1/2 cup sugar, baking powder, and salt. Cut in butter until the mixture resembles coarse crumbs. Stir in 1/4 cup boiling water just until mixture is evenly moist. ', 288, '2011-08-30 02:39:16', '2011-08-30 02:39:16'),
(1269, 3, 'In a separate bowl, dissolve the cornstarch in cold water. Mix in remaining 1 cup sugar, lemon juice, and blackberries. Transfer to a cast iron skillet, and bring to a boil, stirring frequently. Drop dough into the skillet by spoonfuls. Place skillet on the foil lined baking sheet. ', 288, '2011-08-30 02:39:16', '2011-08-30 02:39:16'),
(1270, 4, 'Bake 25 minutes in the preheated oven, until dough is golden brown. ', 288, '2011-08-30 02:39:16', '2011-08-30 02:39:16'),
