(1273, 2, 'In a separate bowl, dissolve the cornstarch in cold water. Mix in remaining 1 cup sugar, lemon juice, and blackberries. Transfer to a cast iron skillet, and bring to a boil, stirring frequently. Drop dough into the skillet by spoonfuls. Place skillet on the foil lined baking sheet. ', 289, '2011-08-30 02:39:48', '2011-08-30 02:39:48'),
(1274, 3, 'Bake 25 minutes in the preheated oven, until dough is golden brown. ', 289, '2011-08-30 02:39:48', '2011-08-30 02:39:48'),
(1275, 1, 'In a small bowl, mix together chili powder, garlic powder, onion powder, red pepper flakes, oregano, paprika, cumin, salt and pepper. Store in an airtight container. ', 290, '2011-08-30 02:42:49', '2011-08-30 02:42:49'),
(1276, 1, 'Mix all ingredients in a large bowl and store in a squirt bottle for easy use.', 291, '2011-08-30 02:44:51', '2011-08-30 02:44:51'),
(1277, 0, 'To prepare sauce, bring 1 cup of orange juice to a boil in a small saucepan over medium-high heat, cook until reduced to 1/4 cup (about 10 minutes).  Remove from heat, cool completely.  Stir in 1 tablespoon cilantro and next 7 ingredients (through red pepper), set aside.', 294, '2011-08-31 15:09:59', '2011-08-31 15:09:59'),
(1278, 1, 'To prepare couscous, place couscous in a large nonstick skillet over medium-high heat, cook 3 minutes or until toasted, stirring constantly.  Add 1 1/2 cups broth, 1/2 cup orange juice, and 1/2 teaspoon salt, bring to a boil.  Remove from heat, cover and let stand 5 minutes.  Fluff with fork, add onions, almonds, and butter, stirring until butter melts, keep warm.', 294, '2011-08-31 15:09:59', '2011-08-31 15:09:59'),
(1279, 2, 'To prepare shrimp, combine shrimp and egg white in a large bowl, tossing to coat.  Combine the panko, 1 teaspoon cilantro, 1/2 teaspoon ginger, and black pepper in a large zip-top plastic bag.  Add shrimp to the bag, and seal and shake to coat.', 294, '2011-08-31 15:09:59', '2011-08-31 15:09:59'),
(1280, 3, 'Heat oil in a large nonsitck skillet over medium-high heat; arrange shrimp in a a single layer in pan.  Cook 2 minutes on each side or until done.  ', 294, '2011-08-31 15:09:59', '2011-08-31 15:09:59'),
(1281, 4, 'Place 3/4 cup couscous on each of 4 plates, top each with 1/2 cup watercress and 5 shrimp. Drizzle each with 1 1/2 tablespoons of sauce.', 294, '2011-08-31 15:09:59', '2011-08-31 15:09:59'),
(1282, 0, 'n a 5 quart Dutch oven, brown sausage. Remove sausage and drain, reserving 1 tablespoon of the drippings. ', 295, '2011-09-02 02:55:45', '2011-09-02 02:55:45'),
(1283, 1, 'Saute onions and garlic in drippings. Stir in beef broth, water, wine, tomatoes, carrots, basil, oregano, tomato sauce, and sausage. Bring to a boil. Reduce heat; simmer uncovered for 30 minutes', 295, '2011-09-02 02:55:45', '2011-09-02 02:55:45'),
(1284, 2, 'Skim fat from the soup. Stir in zucchini and parsley. Simmer covered for 30 minutes. Add tortellini during the last 10 minutes. Sprinkle with Parmesan cheese on top of each serving. ', 295, '2011-09-02 02:55:45', '2011-09-02 02:55:45'),
