(1302, 0, 'Preheat oven to 350 degrees. Whisk together the first nine ingredients (through the chocolate chips) in a large bowl. In a small bowl, whisk the egg, vanilla, applesauce and peanut butter together. Pour the wet ingredients into the dry and mix well.  Mixture will appear very dry, but continue to mix until all ingredients are incorporated.', 302, '2011-09-22 15:23:27', '2011-09-22 15:23:27'),
(1303, 1, 'Line large cookie sheets with parchment paper.  Roll dough into 16 to 20 balls, pressing down to flatten in the shape of a cookie.  Place dough on prepared cookie sheets one inch apart. Bake 10 minutes. Remove from oven and let cool 10 minutes on wire rack.', 302, '2011-09-22 15:23:27', '2011-09-22 15:23:27'),
(1304, 0, 'In a large pot, combine chickepeas with 8 cups of water.  Cover, and brind to a boil over high heat.  Reduce heat to medium, and cook, uncovered, 25 minutes.  Remove from heat.  Let stand, covered, in water.', 303, '2011-10-12 01:01:12', '2011-10-12 01:01:12'),
(1305, 1, 'Place sun-dried tomatoes in shallow bowl; pour enough boiling water to cover.  Let stand 20 minutes.  Drain, chop coarsely, set aside.', 303, '2011-10-12 01:01:12', '2011-10-12 01:01:12'),
(1306, 2, 'Drain soaked chickpeas and tansfer to food processor.  Add 2 tablespoons oil, 1 tsp. salt and 1/2 tsp. black pepper and process until finely chopped. Add reserved tomatoes, parsley, mint and soy sauce, and process briefly to combine.  Scrape mixture into bowl.', 303, '2011-10-12 01:01:12', '2011-10-12 01:01:12'),
(1307, 3, 'In a large skillet, heat remaining 1 tablespoon oil over medium heat.  Add onion, and cook, stirring often, until softened, about 6 minutes.  Stir in cumin, 1/2 teaspoon salt, garlic and jalapeno, and cook, stirring often, 5 minutes.  Add onion mixture to chickpeas.  Stir in flour until well blended.  Form mixture into 8 round patties.', 303, '2011-10-12 01:01:12', '2011-10-12 01:01:12'),
(1308, 4, 'Preheat electric grill to 350 degrees, or heat a grill pan over medium heat.  Cook burgers, turning once, until golden brown, 4 to 5 minutes.', 303, '2011-10-12 01:01:12', '2011-10-12 01:01:12'),
(1309, 0, 'Heat oven to 350°F. Grease and flour two 9-inch round baking pans.\r\n', 304, '2011-10-15 20:26:50', '2011-10-15 20:26:50'),
(1310, 1, 'Stir together sugar, flour, cocoa, baking powder, baking soda and salt in large bowl. Add eggs, milk, oil and vanilla; beat on medium speed of mixer 2 minutes. Stir in boiling water (batter will be thin). Pour batter into prepared pans. ', 304, '2011-10-15 20:26:50', '2011-10-15 20:26:50'),
(1311, 2, 'Bake 30 to 35 minutes or until wooden pick inserted in center comes out clean. Cool 10 minutes; remove from pans to wire racks. Cool completely. Frost with "PERFECTLY CHOCOLATE" CHOCOLATE FROSTING in this database. 10 to 12 servings. ', 304, '2011-10-15 20:26:50', '2011-10-15 20:26:50'),
