(1314, 2, 'Bake 30 to 35 minutes or until wooden pick inserted in center comes out clean. Cool 10 minutes; remove from pans to wire racks. Cool completely. Frost with "PERFECTLY CHOCOLATE" CHOCOLATE FROSTING in this database. 10 to 12 servings. ', 305, '2011-10-21 17:50:09', '2011-10-21 17:50:09'),
(1315, 0, 'Cream butter and cream cheese.  Add liquids and salt.  Add in powdered sugar slowly.', 306, '2011-10-21 23:27:13', '2011-10-21 23:27:13'),
(1316, 1, 'Mix until fluffy, about 3 minutes.', 306, '2011-10-21 23:27:13', '2011-10-21 23:27:13'),
