(1320, 2, 'Remember that Dead Guy is a German style Mailbock so it needs to ferment around 50 degrees and lagered for 4 weeks. If you can get the PACMAN yeast, use that, otherwise use either WLP833 or Wyeast 2206. ', 307, '2011-11-05 21:23:03', '2011-11-05 21:23:03'),
(1321, 3, 'Source: http://www.thebrewingnetwork.com/forum/viewtopic.php?p=75131', 307, '2011-11-05 21:23:03', '2011-11-05 21:23:03'),
(1322, 0, 'Mash @ 122F then raise to 149F until conversion is complete.', 308, '2011-11-05 21:31:17', '2011-11-05 21:31:17'),
