(1347, 1, 'To prepare stuffing, remove casings from chorizo.  Cook chorizo, onion, and garlic in a large nonstick skillet over medium heat for 6 minutes, or until browned, stirring to crumble.  Combine chorizo mixture and corn in a bowl.  Combine cream cheese and sour cream in a small bowl, stir with a whisk until smooth.  Add cheese mixture an salt to chorizo mixture.', 312, '2011-11-08 18:02:05', '2011-11-08 18:02:05'),
(1348, 2, 'Place bread in a food processor; pulse until fine breadcrumbs form.  ', 312, '2011-11-08 18:02:05', '2011-11-08 18:02:05'),
(1349, 3, 'Fill each mushroom cap with about 3/4 teaspoon breadcrumbs.  Stuff each with 2 teaspoons corn mixture; top with remaining breadcrumbs.  Place on baking sheet coated with cooking spray.  Coat each mushroom with cooking spray.  (I use canola oil in a oil sprayer.)', 312, '2011-11-08 18:02:05', '2011-11-08 18:02:05'),
(1350, 4, 'Bake at 400 degrees for about 22 minutes, or until tops are browned.', 312, '2011-11-08 18:02:05', '2011-11-08 18:02:05'),
(1351, 0, 'Preheat oven to 400 degrees.', 313, '2011-11-08 18:02:28', '2011-11-08 18:02:28'),
(1352, 1, 'To prepare stuffing, remove casings from chorizo.  Cook chorizo, onion, and garlic in a large nonstick skillet over medium heat for 6 minutes, or until browned, stirring to crumble.  Combine chorizo mixture and corn in a bowl.  Combine cream cheese and sour cream in a small bowl, stir with a whisk until smooth.  Add cheese mixture an salt to chorizo mixture.', 313, '2011-11-08 18:02:28', '2011-11-08 18:02:28'),
