(1355, 4, 'Bake at 400 degrees for about 22 minutes, or until tops are browned.', 313, '2011-11-08 18:02:28', '2011-11-08 18:02:28'),
(1356, 0, 'Begin by making the meatballs.  Start by putting the bread in a medium sized mixing bowl.  Add the milk to the bread and let it soak a bit .  Add the ground beef, egg, salt, nutmeg and white pepper.  Mix well.  Grab a small bit of the beef and roll it into a ball about the size of a marble.  Repeat until done.  Set aside.  (I know that this is time consuming but you will be happy with the end product if you keep the meatballs all similar size).', 314, '2011-11-08 18:14:49', '2011-11-08 18:14:49'),
(1357, 1, 'Grab a large Dutch oven or pot and place on a medium hot stove.  Chop your celery, and onion finely.  Thinly slice your carrots.  Add butter to pot with the vegetables.  Add a healthy pinch of salt and cook (stirring) until the onion is opaque and before the carrots begin to caramelize.  Add the chicken stock, bouillon cube, white pepper and Maggi Seasoning.  Bring to a slow boil.  Drop meatballs into boiling soup.  Add the vermicelli and cook for about 5 minutes.   Turn down heat and cook for an additional 10 minutes.  Taste the soup, correct your seasonings and add more chicken stock if needed.  Ladle up.  Garnish with parsley and fresh grated nutmeg.  Makes about 8 servings.', 314, '2011-11-08 18:14:49', '2011-11-08 18:14:49'),
(1358, 0, 'Remove sausage from casings and combine with breadcrumbs in a medium bowl.  Form into 3/4 inch round meatballs.  In a large saucepot, heat oil over medium heat.  Add meatballs and cook until browned all over, about 8 minutes.', 315, '2011-11-08 18:20:41', '2011-11-08 18:20:41'),
(1359, 1, 'Add broth and bring to a boil over medium heat.  Break pasta in half an stir into broth.  Cook until al dente.  Meanwhile, in a medium bowl, whisk together vinegar, sesame oil and salt.   Add cabbage, carrots, green onions and toss to combine.  Ladle soup into serving bowls and top generously with cabbage mixture.  ', 315, '2011-11-08 18:20:41', '2011-11-08 18:20:41'),
(1360, 0, 'Melt butter in a 2-quart skillet over low heat.  Stir in flour salt and pepper until smooth.  Remove from heat.  Gradually stir in milk.  Add onion, mustard and Worchestershire sauce.  Cook over medium heat until thickened.  Stir in cheese until melted. ', 316, '2011-11-08 18:25:24', '2011-11-08 18:25:24'),
(1361, 1, 'Combine cooked macaroni and cheese sauce, and place in 1 1 /2 quart greased baking dish.  Sprinkle with buttered bread crumbs.  Bake in oven at 350 degrees for 30 to 35 minutes.  Refrigerate leftovers.', 316, '2011-11-08 18:25:24', '2011-11-08 18:25:24'),
(1362, 0, 'Preheat oven to 350 degrees.  Coat a 9 X 5 inch loaf pan with baking spray.', 318, '2011-11-17 20:57:29', '2011-11-17 20:57:29'),
(1363, 1, 'Combine all dry ingredients (through allspice) in a large bowl.', 318, '2011-11-17 20:57:29', '2011-11-17 20:57:29'),
(1364, 2, 'Whisk eggs, milk, oil, and pumpkin in a medium bowl until thoroughly blended.  Add wet ingredients tot he dry ingredients, stirring until just blended.  Spread batter into the prepared pan.  ', 318, '2011-11-17 20:57:29', '2011-11-17 20:57:29'),
(1365, 3, 'Bake the bred until lightly browned and a toothpick inserted into the center comes out clean (60 to 65 minutes).  Col in the pan for 10 minutes, then turnout onto a wire rack and let cool for 30 minutes or more.', 318, '2011-11-17 20:57:29', '2011-11-17 20:57:29'),
(1366, 0, 'Preheat oven to 350 degrees.  Coat a 9 X 5 inch loaf pan with baking spray.', 319, '2011-11-17 20:58:33', '2011-11-17 20:58:33'),
(1367, 1, 'Combine all dry ingredients (through allspice) in a large bowl.', 319, '2011-11-17 20:58:33', '2011-11-17 20:58:33'),
(1368, 2, 'Whisk eggs, milk, oil, and pumpkin in a medium bowl until thoroughly blended.  Add wet ingredients tot he dry ingredients, stirring until just blended.  Spread batter into the prepared pan.  ', 319, '2011-11-17 20:58:33', '2011-11-17 20:58:33'),
(1369, 3, 'Bake the bread until lightly browned and a toothpick inserted into the center comes out clean (60 to 65 minutes).  Cool in the pan for 10 minutes, then turn out onto a wire rack and let cool for 30 minutes or more.', 319, '2011-11-17 20:58:33', '2011-11-17 20:58:33'),
(1370, 0, 'Remove skin from chicken; season with salt and pepper.  Heat an 8-quart pot on medium.  Sear chicken in oil until golden, 10 minutes.  Meanwhile, mix onions, celery, carrots, sage, garlic powder, a little more salt, thyme, and nutmeg. ', 320, '2011-12-01 04:35:28', '2011-12-01 04:35:28'),
(1371, 1, 'Add vegetable-and-spice mixture to chicken. Saute until onions are translucent, about 5 minutes.  Add broth and the water.  Cover pot and bring to a boil.  Reduce heat; simmer 30 minutes, until chicken pulls away from the bone.  Remove chicken; discard bones and add meat back to the pot.  Mix in rice; heat 2 to 3 minutes.  Serves 8.', 320, '2011-12-01 04:35:28', '2011-12-01 04:35:28'),
(1372, 0, 'Preheat oven to 200 degrees.', 322, '2011-12-01 04:43:36', '2011-12-01 04:43:36'),
(1373, 1, 'In a large bowl, whisk together flour, sugar, baking powder, cinnamon, ginger, nutmeg, and salt.', 322, '2011-12-01 04:43:36', '2011-12-01 04:43:36'),
(1374, 2, 'In a small bowl, whisk together milk and egg.  Whisk in pumpkin and 1 tablespoon of oil.  Combine pumpkin mixture and flour mixture.  Let stand 5 minutes.', 322, '2011-12-01 04:43:36', '2011-12-01 04:43:36'),
(1375, 3, 'Meanwhile, heat remaining 1 tablespoon oil in a large nonstick skillet over medium heat.  When hot, add 1/4 cup of batter to form round pancakes; make sure pancakes are not touching one another.  As the batter cooks, sprinkle a few walnuts and cranberries over it if using.', 322, '2011-12-01 04:43:36', '2011-12-01 04:43:36'),
(1376, 4, 'Cook pancakes for about 2 minutes, until bubbles appear and edges begin to brown.  Flip and heat for another 1 to 2 minutes, until edges brown.  Stack cooked pancakes on a plate and put them in the oven while other batches cook. ', 322, '2011-12-01 04:43:36', '2011-12-01 04:43:36'),
(1377, 5, 'Serve with pure maple syrup and fresh blueberries if desired.', 322, '2011-12-01 04:43:36', '2011-12-01 04:43:36'),
(1378, 0, 'Begin by making the meatballs.  Start by putting the bread in a medium sized mixing bowl.  Add the milk to the bread and let it soak a bit .  Add the ground beef, egg, salt, nutmeg and white pepper.  Mix well.  Grab a small bit of the beef and roll it into a ball about the size of a marble.  Repeat until done.  Set aside.  (I know that this is time consuming but you will be happy with the end product if you keep the meatballs all similar size).', 323, '2011-12-02 02:00:26', '2011-12-02 02:00:26'),
(1379, 1, 'Grab a large Dutch oven or pot and place on a medium hot stove.  Chop your celery, and onion finely.  Thinly slice your carrots.  Add butter to pot with the vegetables.  Add a healthy pinch of salt and cook (stirring) until the onion is opaque and before the carrots begin to caramelize.  Add the chicken stock, bouillon cube, white pepper and Worchestershire.  Bring to a slow boil.  Drop meatballs into boiling soup.  Add the vermicelli and cook for about 5 minutes.   Turn down heat and cook for an additional 10 minutes.  Taste the soup, correct your seasonings and add more chicken stock if needed.  Ladle up.  Garnish with parsley and fresh grated nutmeg.  Makes about 8 servings.', 323, '2011-12-02 02:00:26', '2011-12-02 02:00:26'),
(1380, 0, 'Heat a Dutch oven over medium-high heat.  Add 1 tablespoon canola oil.  Add bell pepper and 3/4 cup grated onions, and saute 4 minutes or until lightly browned.', 324, '2011-12-11 04:14:45', '2011-12-11 04:14:45'),
(1381, 1, 'Increase heat to high; add corn, water, seafood seasoning, thyme, cayenne, and potatoes; bring to a boil.  Cover and reduce heat, and simmer 10 minutes, or until potatoes are tender.  Remove from heat, and stir in half and half, chopped parsley, and salt.', 324, '2011-12-11 04:14:45', '2011-12-11 04:14:45'),
(1382, 2, 'Place about 1 1/2 cup of soup in each bowl.  Sprinkle with cheese and remaining green onions.  ', 324, '2011-12-11 04:14:45', '2011-12-11 04:14:45'),
(1383, 0, 'Melt butter in a 2-quart skillet over low heat.  Stir in flour salt and pepper until smooth.  Remove from heat.  Gradually stir in milk.  Add onion, mustard and Worchestershire sauce.  Cook over medium heat until thickened.  Stir in cheese until melted. ', 325, '2011-12-21 00:24:55', '2011-12-21 00:24:55'),
(1384, 1, 'Combine cooked macaroni and cheese sauce, and place in 1 1 /2 quart greased baking dish.  Sprinkle with buttered bread crumbs.  Bake in oven at 350 degrees for 30 to 35 minutes.  Refrigerate leftovers.', 325, '2011-12-21 00:24:55', '2011-12-21 00:24:55'),
(1385, 0, 'Preheat oven to 350 degrees.  Coat a 9-inch springform pan with canola oil spray.  Pulse graham crackers in a food processor until finely ground.  Add oil and water; pulse until clumps form.  Press crumbs into bottom and 1 inch up side of pan.  Bake until fragrant (about 10 minutes).  Cool on rack.  Reduce oven temperature to 325 degrees.', 326, '2011-12-30 20:43:10', '2011-12-30 20:43:10'),
(1386, 1, 'Process rasberries or strawberries with 2 tablespoons of sugar until smooth.  Strain puree into a small saucepan.  Boil mixture for 3 minutes, until slightly thickened.   Cool to room temperature.', 326, '2011-12-30 20:43:10', '2011-12-30 20:43:10'),
(1387, 2, 'In the bowl of an electric mixer, beat cream cheese and remaining 1 1/4 cups sugar until smooth (about 5 minutes).  Add sour cream and beat until just combined.  Add eggs, one at a time, beating after each addition to incorporate.  Add flour, vanilla, lemon zest, and salt, and mix until combined.', 326, '2011-12-30 20:43:10', '2011-12-30 20:43:10'),
(1388, 3, 'Pour batter into prepared pan, then placed cheesecake into a roasting pan.  Drop teaspoons of raspberry or strawberry puree all over top of cheesecake.  Using a wooden skewer or knife swirl the puree.  Place roasting pan in oven and add hot water to roasting pan to a depth of 2 inches.  ', 326, '2011-12-30 20:43:10', '2011-12-30 20:43:10'),
(1389, 4, 'Bake until cake is set but the center still jiggles (about 1 hour and 10 - 1 hour and 30 minutes).  Jiggle should resemble a custard jiggle and not be liquid.  Turn oven off.  Cool cheesecake in closed oven for 30 minutes.  Remove springform pan from water bath.  Run a knife around inside of edges of pan; cool ro room temperature.  Chill until firm (at least 6 hours) before unmolding.', 326, '2011-12-30 20:43:10', '2011-12-30 20:43:10'),
(1390, 0, 'Combine flours, brown sugar, and salt in a mixing bowl.  Add eggs and peanut butter and mix until incorporated.', 327, '2011-12-30 23:33:34', '2011-12-30 23:33:34'),
(1391, 1, 'Mix in oil.  Next add enough water until dough is smooth and workable.', 327, '2011-12-30 23:33:35', '2011-12-30 23:33:35'),
(1392, 2, 'Cover the dough and set aside for 15-20 min. to relax.  Preheat oven to 375º F & grease a couple sheet pans with canola oil.', 327, '2011-12-30 23:33:35', '2011-12-30 23:33:35'),
(1393, 3, 'Roll out dough to about 3/8″-1/2″ thick. Cut to desired shaped then put on sheet pans.', 327, '2011-12-30 23:33:35', '2011-12-30 23:33:35'),
(1394, 4, 'Bake for approx. 40 min. or until biscuits are slightly browned and fairly hard (they will harden a touch more when cool.) ', 327, '2011-12-30 23:33:35', '2011-12-30 23:33:35'),
(1395, 0, 'Preheat oven to 400 degrees.', 328, '2012-01-02 23:39:23', '2012-01-02 23:39:23'),
(1396, 1, 'Place walnuts in a food processor; process until finely ground.', 328, '2012-01-02 23:39:24', '2012-01-02 23:39:24'),
(1397, 2, 'Lightly spoon flour into dry measuring cups; level with a knife.  Combine flour and next 3 ingredients (through salt) in a medium bowl; stir well with a whisk.  Stir in ground walnuts.  Make a well in center of mixture.', 328, '2012-01-02 23:39:24', '2012-01-02 23:39:24'),
(1398, 3, 'Combine brown sugar and the next 4 ingredients (through egg) in a small bowl; add to the flour mixture, stirring just until moist.  Fold in diced pear.', 328, '2012-01-02 23:39:24', '2012-01-02 23:39:24'),
(1399, 4, 'Spoon batter into 12 muffin cups coated with canola oil; sprinkle with turbinado sugar.  Bake at 400 degrees for 20 minutes or until muffins spring back when touched lightly in center.  Remove from pans immediately.  Place on a wire rack.  Serve either warm or at room temperature.', 328, '2012-01-02 23:39:24', '2012-01-02 23:39:24'),
(1400, 0, 'Toast the walnuts in a dry saute pan for 1 to 2 minutes, and set aside.', 329, '2012-01-06 05:28:27', '2012-01-06 05:28:27'),
(1401, 1, 'Prepare pasta according to package instructions.', 329, '2012-01-06 05:28:27', '2012-01-06 05:28:27'),
(1402, 2, 'Meanwhile make the sauce.  In a blender or food processor, combine 1/2 cup walnuts, lemon juice, olive oil Parmesan cheese, sea salt, and pepper to taste, then add the pasta cooking water.  Blend to combine (sauce may still have small bits of nut visible).', 329, '2012-01-06 05:28:27', '2012-01-06 05:28:27'),
(1403, 3, 'Add the asparagus to the boiling pasta during the last minute of cooking.  Drain the pasta and asparagus and toss with the sauce to coat.  Garnish each serving with the reserved 1/4 cup of toasted walnuts.', 329, '2012-01-06 05:28:27', '2012-01-06 05:28:27'),
(1404, 0, 'Heat oil in a large saucepan over medium-high heat.  Add chicken and cook, stirring occasionally, until browned, 3 to 4 minutes.  Transfer to a plate.', 330, '2012-01-07 02:32:22', '2012-01-07 02:32:22'),
(1405, 1, 'Add zucchini, shallot, Italian seasoning and salt and cook, stirring often, until the vegetables are slightly softened, 2 to 3 minutes.  Add tomatoes, broth, wine and orzo (or other tiny pasta); increase heat to high and bring to boil, stirring occasionally.  Reduce heat to a simmer and cook until the pasta is tender, about 8 minutes, or according to package directions.  Stir in spinach, the cooked chicken and any accumulated juices from the chicken; cook, stirring, until the chicken is heated through about 2 minutes.', 330, '2012-01-07 02:32:22', '2012-01-07 02:32:22'),
(1406, 2, 'NOTE:  This is great topped with freshly grated Romano or Parmesan cheese.  Serve with garlic or Parmesan cheese topped crusty bread.', 330, '2012-01-07 02:32:22', '2012-01-07 02:32:22'),
(1407, 0, 'Salt and pepper the sirloin and brown in a large skillet in 3 tablespoons of oil.  Brown in batches if necessary to avoid over crowding the pan.  ', 331, '2012-01-14 05:39:36', '2012-01-14 05:39:36'),
(1408, 1, 'Saute onions and garlic in drippings from meat until translucent.   Add beef back to the skillet along with the beef broth.  Simmer on low for 1 hour, stirring often adding water if necessary, until the beef is tender.', 331, '2012-01-14 05:39:36', '2012-01-14 05:39:36'),
(1409, 2, 'Add tomato sauce, mushrooms, and white wine and cook for 30 minutes more.  ', 331, '2012-01-14 05:39:36', '2012-01-14 05:39:36'),
(1410, 3, 'Stir in sour cream ans serve over egg noodles.', 331, '2012-01-14 05:39:36', '2012-01-14 05:39:36'),
(1411, 6, 'In a large nonstick skillet, heat remaining 1 tsp oil over medium-high heat. Add chorizo & cook, stirring to break apart, until golden brown (about 8 minutes). Remove to a plate with paper towels (reserve rendered fat in skillet). ', 332, '2012-01-14 05:43:58', '2012-01-14 05:43:58'),
(1412, 7, 'Lower heat to medium and crack eggs into skillet. Cook until whites are completely firm but yolks are still soft (about 2 min).', 332, '2012-01-14 05:43:58', '2012-01-14 05:43:58'),
(1413, 8, 'In a small bowl, stir together sour cream and lime zest.', 332, '2012-01-14 05:43:58', '2012-01-14 05:43:58'),
(1414, 9, 'To serve, spoon about 1/4 cup red chile sauce on each of 4 plates. Place a crisp tortilla on top of the sauce. Divide eggs, remaining sauce, lime sour cream, and chorizo among plates. ', 332, '2012-01-14 05:43:58', '2012-01-14 05:43:58'),
(1415, 0, 'Preheat oven to 400 deg F.', 332, '2012-01-14 05:43:58', '2012-01-14 05:43:58'),
(1416, 1, 'In medium saucepan, heat 1 Tb oil over medium-high heat. Add onion & cook, stirring occasionally, until soft (5-7 min). ', 332, '2012-01-14 05:43:58', '2012-01-14 05:43:58'),
(1417, 2, 'Add garlic and cook, stirring (1 min).', 332, '2012-01-14 05:43:58', '2012-01-14 05:43:58'),
(1418, 3, 'Add wine & cook until reduced by 1/2', 332, '2012-01-14 05:43:58', '2012-01-14 05:43:58'),
(1419, 4, 'Add tomato, water, chili powder, chipotle, honey, & salt. Cook, stirring occasionally, until sauce has thickened (20-30 min). Stir in lime juice.', 332, '2012-01-14 05:43:58', '2012-01-14 05:43:58'),
(1420, 10, 'Before serving, sprinkle with cilantro, cheese, and pepper (if desired). Serve immediately', 332, '2012-01-14 05:43:58', '2012-01-14 05:43:58'),
(1421, 5, 'While sauce simmers, arrange tortillas on a baking sheet. Lightly brush both sides of tortillas with 2 teaspoons oil. Bake, turning once, until crisp and slightly golden (5-7 min)', 332, '2012-01-14 05:43:58', '2012-01-14 05:43:58'),
(1422, 0, 'Preheat oven to 350 degrees.  Coat a 12-cup mini muffin pan with canola oil spray; set aside.  Melt chocolate and butter in a small saucepan over low heat, stirring until smooth.  Remove from heat, transfer to a medium bowl, add espresso.', 333, '2012-01-18 22:13:08', '2012-01-18 22:13:08'),
(1423, 1, 'Add flour to chocolate mixture and stir well.  Add egg and vanilla and stir to incorporate.  Add sugars and stir until smooth.  Spoon batter evenly into prepared pan.  Bake until just cooked through and tops are smooth and slightly puffy (10 to 12 minutes).', 333, '2012-01-18 22:13:08', '2012-01-18 22:13:08'),
(1424, 2, 'Cool completely (as bites cool, they will collapse and tops will invert) and enjoy.  Makes 24.', 333, '2012-01-18 22:13:08', '2012-01-18 22:13:08'),
(1425, 0, 'Preheat oven to 375 degrees.  Place 8 paper liners in a muffin pan.', 334, '2012-01-22 05:03:35', '2012-01-22 05:03:35'),
(1426, 1, 'In a medium bowl, mix the bananas, white and brown sugars, and olive oil.  In a large bowl, sift together the baking powder, cinnamon, salt, and whole wheat flour.  Stir the wet ingredients into the dry.  Do not over mix the batter or muffins will be tough.  Scoop the batter into the 8 paper liners.  Sprinkle each muffin with hemp or chia seeds.', 334, '2012-01-22 05:03:35', '2012-01-22 05:03:35'),
(1427, 2, 'Bake for 18 to 20 minutes or until a toothpick inserted into the muffin comes out clean.', 334, '2012-01-22 05:03:35', '2012-01-22 05:03:35'),
(1428, 3, 'Muffins are best eaten the same day.', 334, '2012-01-22 05:03:35', '2012-01-22 05:03:35'),
(1429, 0, 'Melt butter in a 2-quart skillet over low heat.  Stir in flour salt and pepper until smooth.  Remove from heat.  Gradually stir in milk.  Add onion, mustard and Worchestershire sauce.  Cook over medium heat until thickened.  Stir in cheese until melted. ', 335, '2012-01-25 05:47:16', '2012-01-25 05:47:16'),
(1430, 1, 'Combine cooked macaroni and cheese sauce, and place in 1 1 /2 quart greased baking dish.  Sprinkle with buttered bread crumbs.  Bake in oven at 350 degrees for 30 to 35 minutes.  Refrigerate leftovers.', 335, '2012-01-25 05:47:16', '2012-01-25 05:47:16'),
(1431, 0, 'To make sauce: In saucepan, heat canola oil over low heat.  Whisk in flour and continue to cook until it starts to bubble.  Once it begins bubbling, quickly stir in 1/4 cup plus 2 tablespoons chili powder.  Cook for another minutes.  Stir in tomato sauce.  The paste will start to thicken.  Turn heat down and add water a little at a time, combining well.  Allow to thicken. Season with remaining 1/4 cup chili powder, 1 teaspoon cumin, 1 teaspoon garlic powder and salt to taste; set aside.', 336, '2012-02-04 06:01:52', '2012-02-04 06:01:52'),
(1432, 1, 'To make enchiladas:  Combine 6 cups of cheese with onion.  Set aside.  Pour about 1/4 inch of oil into a saute pan and heat it for 5 to 7 minutes over medium-high heat.  Using tongs, quickly dip tortillas, 1 at a time, into hot oil.  Make sure each side is coated.  Drain on a plate lined with paper towels.  Continue until all tortillas are done.', 336, '2012-02-04 06:01:52', '2012-02-04 06:01:52'),
(1433, 2, 'Preheat oven to 350 degrees.  Dip a tortilla into sauce, coating well.  Place a row of cheese mixture down the center of the tortilla and tightly roll it.  Place in two 7 by 11 inch baking dishes (or one 9 by 13 inch dish plus one 8 inch square dish) and repeat with remaining tortillas.  Pour remaining sauce over enchiladas and sprinkle wit reserved cheese.  Bake for 25 to 35 minutes or until cheese is melted and enchiladas are thoroughly heated.', 336, '2012-02-04 06:01:52', '2012-02-04 06:01:52'),
(1434, 0, 'Preheat waffle iron to medium temperature.', 337, '2012-02-12 15:18:07', '2012-02-12 15:18:07'),
(1435, 1, 'Mix together dry ingredients in one bowl and wet ingredients in another bowl.  Stir wet ingredients into dry ingredients and mix well. Pour batter onto waffle maker and cook until done.', 337, '2012-02-12 15:18:07', '2012-02-12 15:18:07'),
(1436, 0, 'Heat non-stick skillet over medium heat.  Toast coriander, fennel, and mustard seeds until fragrant, about 1 minute.  Transfer to a spice grinder and process until finely ground.  ( You can also crush them with the back of a chef''s knife.)  ', 338, '2012-02-23 16:56:10', '2012-02-23 16:56:10'),
(1437, 1, 'Heat oil in the pot.  Add ground seeds, cinnamon, chili, garlic, onion, ginger, and curry leaves (if using).  Cook, stirring occasionally, until onions are soft, 6 to 8 minutes.  ', 338, '2012-02-23 16:56:10', '2012-02-23 16:56:10'),
(1438, 2, 'Add tomatoes and bring to a boil, then simmer, stirring occasionally, until slightly thickened, about 15 minutes.  ', 338, '2012-02-23 16:56:10', '2012-02-23 16:56:10'),
(1439, 3, 'Add potatoes and 2 cups of water.  Simmer, partially covered, until potatoes are tender, about 35 minutes.  ', 338, '2012-02-23 16:56:10', '2012-02-23 16:56:10'),
(1440, 4, 'Add peas and cook until tender, about 12 minutes (if using frozen, cook 5 minutes).', 338, '2012-02-23 16:56:10', '2012-02-23 16:56:10'),
(1441, 5, 'Season with salt.  Stir in yogurt or sour cream.  Remove cinnamon stick before serving.', 338, '2012-02-23 16:56:10', '2012-02-23 16:56:10'),
(1442, 0, 'Mix pretzels and cereal in a large bowl.', 339, '2012-02-25 01:21:05', '2012-02-25 01:21:05'),
(1443, 1, 'Melt chips in the microwave 40 seconds at a time stirring in between each heating until smooth.  Stir in peanut butter.', 339, '2012-02-25 01:21:05', '2012-02-25 01:21:05'),
(1444, 2, 'Pour chocolate mixture over pretzel mixture and mix until combined.', 339, '2012-02-25 01:21:05', '2012-02-25 01:21:05'),
(1445, 3, 'Drop onto a baking sheet lined with wax paper and place in refrigerator to set, about 15 minutes. ', 339, '2012-02-25 01:21:05', '2012-02-25 01:21:05'),
(1446, 4, 'Store in an airtight container in fridge.', 339, '2012-02-25 01:21:05', '2012-02-25 01:21:05'),
(1447, 6, 'Note:  To toast nuts, spread on baking sheet and bake in 375 degree oven for 5 to 8 minutes OR toast in a hot heavy skillet on top of the stove.', 341, '2012-03-01 18:54:01', '2012-03-01 18:54:01'),
(1448, 0, 'To make brownies:  Preheat the oven to 350 degrees.  Grease a 9 X 13 inch baking pan. ', 341, '2012-03-01 18:54:01', '2012-03-01 18:54:01'),
(1449, 1, 'In a large saucepan, whisk the eggs, oil and buttermilk.  Whisk in the sugar, then heat the mixture over medium-low heat, stirring with a wooden spoon, until the sugar dissolves (do not let the mixture come to boil).  Remove the pan from the heat.', 341, '2012-03-01 18:54:01', '2012-03-01 18:54:01'),
(1450, 2, 'In a small bowl, whisk the cocoa with the 1/2 cup water until smooth.  Stir the cocoa mixture into the saucepan.  Beat in the flour, baking soda, salt and vanilla until smooth.', 341, '2012-03-01 18:54:01', '2012-03-01 18:54:01'),
(1451, 3, 'Pour the batter into the prepared pan and bake until the center is just firm when lightly pressed, 25 to 30 minutes.  Ice the brownies while they are still hot.', 341, '2012-03-01 18:54:01', '2012-03-01 18:54:01'),
(1452, 4, 'To make icing:  Melt the butter in a saucepan over medium heat.  Whisk in the cocoa, buttermilk and salt until smooth.  Beat in the sugar and stir until thoroughly incorporated.  Remove the pan from the heat and stir in the vanilla.  If the brownies are still baking, set the icing aside.', 341, '2012-03-01 18:54:01', '2012-03-01 18:54:01'),
(1453, 5, 'Give the icing a stir before spreading it over the hot brownies.  Smooth the icing with a spatula and top it with the nuts.  Let the brownies cool for at least 30 minutes before cutting them into 2-inch squares.  These brownies keep, well-wrapped, for up to 1 week. ', 341, '2012-03-01 18:54:01', '2012-03-01 18:54:01'),
(1454, 0, 'Preheat oven to 350 degrees.  Combine fennel with salt and pepper on one side of a large cookie sheet.  Coat each piece of bread on both sides with olive oil and place on the other side of the cookie sheet.  Bake 10-12 minutes or until fennel and bread are lightly crisp and browned.', 342, '2012-03-09 18:37:01', '2012-03-09 18:37:01'),
(1455, 1, 'Spread softened goat cheese evenly over each bread slice, top with 1/3 cup fennel slices, 2 tablespoons sun-dried tomatoes, and a few chopped fennel fronds.', 342, '2012-03-09 18:37:01', '2012-03-09 18:37:01'),
(1456, 0, 'Preheat oven to 350 degrees.  Combine fennel with salt and pepper on one side of a large cookie sheet.  Coat each piece of bread on both sides with olive oil and place on the other side of the cookie sheet.  Bake 10-12 minutes or until fennel and bread are lightly crisp and browned.', 343, '2012-03-09 18:37:23', '2012-03-09 18:37:23'),
(1457, 1, 'Spread softened goat cheese evenly over each bread slice, top with 1/3 cup fennel slices, 2 tablespoons sun-dried tomatoes, and a few chopped fennel fronds.', 343, '2012-03-09 18:37:23', '2012-03-09 18:37:23'),
(1458, 6, 'Bake in a preheated 350 degree Fahrenheit oven for approximately 20 minutes or until heated all the way through and golden brown on top.', 344, '2012-03-21 00:30:14', '2012-03-21 00:30:14'),
(1459, 0, 'Bring 4 qt. salted water to a rapid boil and cook the macaroni until not quite tender. Drain macaroni and set aside.', 344, '2012-03-21 00:30:14', '2012-03-21 00:30:14'),
(1460, 1, 'In saute pan, melt 4 Tablespoons of Smart Balance. When melted, stir in the breadcrumbs and toast just until lightly browned. Remove breadcrumbs from pan and set aside', 344, '2012-03-21 00:30:14', '2012-03-21 00:30:14'),
(1461, 2, 'Wipe pan clean with paper towel and re-use for next step. Melt remaining Smart Balance, add onions, and stir over low heat until onions are just translucent, but not browned. Stir in the flour and seasonings and salt and pepper to taste. ', 344, '2012-03-21 00:30:14', '2012-03-21 00:30:14'),
(1462, 3, 'Continue to cook for an additional 2-3 minutes. Add the wine, then gradually stir in the milk or cream.', 344, '2012-03-21 00:30:14', '2012-03-21 00:30:14'),
(1463, 4, 'Simmer over low heat, stirring constantly until the sauce is thickened and smooth. Add cheese and continue stirring until the cheese melts.', 344, '2012-03-21 00:30:14', '2012-03-21 00:30:14'),
(1464, 5, 'Combine the macaroni with the cheese sauce. Turn out into a generously buttered casserole dish (approximately 1 1/2 quarts). If you have any extra grated cheese, you can sprinkle this on top along with the 1/2 cup of buttered, toasted bread crumbs.', 344, '2012-03-21 00:30:14', '2012-03-21 00:30:14'),
(1465, 6, 'Lightly oil or grease a 14x17" baking sheet and sprinkle with cornmeal; set aside.  Punch down the dough.  Divide in half and, on a lightly floured surface, shape into long loaves, rolling each piece first into a 5x12" rectangle, then rolling each up along the long side to make a long, narrow loaf.\r\n', 345, '2012-04-02 04:28:10', '2012-04-02 04:28:10'),
(1466, 7, 'Pinch edges to seal, and taper ends.  Place loaves, seam side down, on prepared baking sheet.  Let rise until doubled, about 45 minutes.  Make 4-5 slashes across each loaf with sharp knife or razor blade.\r\n\r\n\r\n', 345, '2012-04-02 04:28:10', '2012-04-02 04:28:10'),
(1467, 8, 'Bake in a preheated 400 degree F oven for 15-20 minutes, until loaves are browned and crisp.  Remove to a wire rack to cool completely.\r\n\r\n', 345, '2012-04-02 04:28:10', '2012-04-02 04:28:10');
INSERT INTO `steps` (`id`, `order_num`, `instruction`, `recipe_id`, `created_at`, `updated_at`) VALUES
(1468, 9, 'NOTE: I also use a spray bottle filled with water and spray the loaves and oven walls once or twice at 5-minute intervals at the beginning of baking.\r\n\r\n', 345, '2012-04-02 04:28:10', '2012-04-02 04:28:10'),
(1469, 0, 'In large bowl, dissolve yeast, brown sugar, and ginger in warm water.  Let stand 5 minutes until yeast foams.\r\n\r\n', 345, '2012-04-02 04:28:10', '2012-04-02 04:28:10'),
(1470, 1, 'Add salt and bread flour; beat well.', 345, '2012-04-02 04:28:10', '2012-04-02 04:28:10'),
(1471, 2, 'Stir in whole wheat flour to make a stiff dough.\r\n', 345, '2012-04-02 04:28:10', '2012-04-02 04:28:10'),
(1472, 3, 'Turn out onto lightly floured board and knead 10 minutes or until dough is springy, smooth and satiny.  You can also knead in a mixer with a dough hook for 5 minutes.', 345, '2012-04-02 04:28:10', '2012-04-02 04:28:10'),
(1473, 4, 'Wash bowl, grease it, and add dough to bowl; turn over to grease top\r\n', 345, '2012-04-02 04:28:10', '2012-04-02 04:28:10'),
(1474, 5, 'Let rise in a warm place until doubled in bulk, about 1 hour.\r\n', 345, '2012-04-02 04:28:10', '2012-04-02 04:28:10'),
(1475, 0, 'Preheat oven to 350 degrees.  Line 2 cookie sheets with parchment paper; set aside.', 346, '2012-04-11 22:12:07', '2012-04-11 22:12:07'),
(1476, 1, 'In a small bowl, stir together flour, baking powder, baking soda, pumpkin-pie spice, and salt; set aside.', 346, '2012-04-11 22:12:07', '2012-04-11 22:12:07'),
(1477, 2, 'In a large bowl, combine the oil, sugars, egg, flour mixture, oats, carrots, and raisin, if using.', 346, '2012-04-11 22:12:07', '2012-04-11 22:12:07'),
(1478, 3, 'Drop dough by slightly rounded tablespoons 2 inches apart onto prepared cookie sheets.  Bake each sheet for 10 to 12 minutes or until cookies begin to brown.  Let stand 1 minute on cookie sheet, then remove and let cool on a wire rack.', 346, '2012-04-11 22:12:07', '2012-04-11 22:12:07'),
(1479, 4, 'For filling, in a small bowl mix cream cheese and maple syrup.  Spread 1 tablespoon filling on the flat side of half of the cookies.  Top with remaining cookies to make sandwiches.  Wrap and chill up to 3 days.', 346, '2012-04-11 22:12:07', '2012-04-11 22:12:07'),
(1480, 0, 'Preheat the oven to 350°F. Coat an 8" x 8" baking dish with cooking spray.', 347, '2012-04-30 21:48:50', '2012-04-30 21:48:50'),
(1481, 1, 'On a large sheet of waxed paper, combine the flour, baking soda, and salt. Stir with a fork.', 347, '2012-04-30 21:48:50', '2012-04-30 21:48:50'),
(1482, 2, 'In a mixing bowl, combine the peanut butter, sugar, and egg. Stir vigorously until creamy. Add the milk and vanilla. Stir until smooth. Add the flour mixture, stirring until well combined. Stir in the chips.', 347, '2012-04-30 21:48:50', '2012-04-30 21:48:50'),
(1483, 3, 'Dollop the dough into the baking dish and pat the top to smooth. Bake for about 25 - 30 minutes, or until slightly puffy and very lightly browned at the edges. Remove and allow to cool for at least 10 minutes before cutting. Store at room temperature, tightly covered with foil.\r\n', 347, '2012-04-30 21:48:50', '2012-04-30 21:48:50'),
(1484, 0, 'Mix all ingredients and pour into a spray bottle.  Spray the floor with this solution and use a dry mop to clean the floor.', 348, '2012-05-02 02:59:42', '2012-05-02 02:59:42'),
(1485, 6, 'Add the garam masala and cilantro. Let it cook for another minute.', 349, '2012-05-05 00:46:58', '2012-05-05 00:46:58'),
(1486, 0, 'Blend the tomatoes, serrano, and ginger to make a puree.', 349, '2012-05-05 00:46:58', '2012-05-05 00:46:58'),
(1487, 1, 'Heat the oil in a saucepan. Test the heat by adding one cumin seed to the oil; if seed crack right away oil is ready.', 349, '2012-05-05 00:46:58', '2012-05-05 00:46:58'),
(1488, 2, 'Add the asafetida and cumin seeds.  After the cumin seeds crack, add the gram flour and stir-fry for a minute.', 349, '2012-05-05 00:46:58', '2012-05-05 00:46:58'),
(1489, 3, 'Add the tomato puree, coriander powder, turmeric, red cayenne powder and cook for about 4 minutes on medium heat.', 349, '2012-05-05 00:46:58', '2012-05-05 00:46:58'),
(1490, 4, 'The mixture will start leaving the oil and will reduce to about half in quantity.  Add the chickpeas and a half cup of water and let it cook for 7 to 8 minutes on medium heat, covered.', 349, '2012-05-05 00:46:58', '2012-05-05 00:46:58'),
(1491, 5, 'Press the chickpeas with a spatula so they soften. Note: add more water as needed to keep the gravy consistency to your liking, and let it cook for few more minutes on low heat.', 349, '2012-05-05 00:46:58', '2012-05-05 00:46:58'),
(1492, 0, 'Mash In at 152° for 60 min - sparge as usual', 350, '2012-05-18 04:01:27', '2012-05-18 04:01:27'),
(1493, 1, 'Boil time : 60 min.', 350, '2012-05-18 04:01:27', '2012-05-18 04:01:27'),
(1494, 2, 'Add Irish moss @ last 15 min', 350, '2012-05-18 04:01:27', '2012-05-18 04:01:27'),
(1495, 3, 'Cool and ferment at 71° to 74° ', 350, '2012-05-18 04:01:27', '2012-05-18 04:01:27'),
(1496, 4, 'Use Pacman Yeast if you can. Otherwise, use the Wyeast', 350, '2012-05-18 04:01:27', '2012-05-18 04:01:27'),
(1497, 0, 'Preheat oven to 425 degrees F (220 degrees C). ', 351, '2012-05-21 22:09:34', '2012-05-21 22:09:34'),
(1498, 1, 'In a large bowl, whisk together the flour, baking powder, salt, and sugar. Cut in the shortening until the mixture resembles coarse meal. Gradually stir in milk until dough pulls away from the side of the bowl. NOTE:  You may not use all of the milk.', 351, '2012-05-21 22:09:34', '2012-05-21 22:09:34'),
(1499, 2, 'Turn out onto a floured surface, and knead 15 to 20 times. Pat or roll dough out to 1 inch thick. Cut biscuits with a large cutter or juice glass dipped in flour. Repeat until all dough is used. Brush off the excess flour, and place biscuits onto an ungreased baking sheet. ', 351, '2012-05-21 22:09:34', '2012-05-21 22:09:34'),
(1500, 3, 'Bake for 13 to 15 minutes in the preheated oven, or until edges begin to brown. ', 351, '2012-05-21 22:09:34', '2012-05-21 22:09:34'),
(1501, 0, 'Preheat oven to 325 degrees. Lightly grease a 9X15 inch pan. Combine the first four ingredients in a large mixing bowl. Add vanilla, honey, and brown sugar. Beat with an electric mixer. Batter will be very thick and will not appear to hold together well. Using a wooden spoon stir in remaining ingredients until well combined.\r\n', 352, '2012-05-22 23:32:52', '2012-05-22 23:32:52'),
(1502, 1, 'Press dough into prepared pan. Bake 20-25 minutes until golden brown. Cool in pan 10 minutes. Cut into bars and cool completely before removing from pan. ', 352, '2012-05-22 23:32:52', '2012-05-22 23:32:52'),
(1503, 2, 'Note:  Bake 30 minutes in a 9 X 13 pan.', 352, '2012-05-22 23:32:52', '2012-05-22 23:32:52'),
(1504, 0, 'Lightly grease a muffin tin, or line with papers and coat the papers with nonstick spray. ', 353, '2012-06-08 21:15:38', '2012-06-08 21:15:38'),
(1505, 1, 'Lightly grease a muffin tin, or line with papers and coat the papers with nonstick spray. ', 353, '2012-06-08 21:15:38', '2012-06-08 21:15:38'),
(1506, 2, 'Cream together the butter and sugar in a large mixing bowl until light and fluffy and almost white in color. Scrape down the bowl to make sure all the butter is incorporated, then turn the mixer back on and add the eggs, one at a time, beating well after each addition. Add the vanilla and sour cream, and mix until incorporated. ', 353, '2012-06-08 21:15:38', '2012-06-08 21:15:38'),
(1507, 3, 'Add the dry ingredients, mixing on low speed just until the batter is smooth. Scrape the sides and bottom of the bowl once more, to be sure everything is evenly combined. Gently fold in the fruit and refrigerate at least an hour.', 353, '2012-06-08 21:15:38', '2012-06-08 21:15:38'),
(1508, 4, 'Preheat the oven to 400°F (200°C or gas mark 6). Scoop the batter by the 1/4-cupful into the prepared pan and sprinkle with sugar and cinnamon or other topping of choice. Bake the muffins until a cake tester inserted in the center comes out clean, 22 to 26 minutes. Remove from the oven and allow the muffins to cool in the pan for 5 minutes, then turn them out onto a rack to finish cooling.\r\n', 353, '2012-06-08 21:15:38', '2012-06-08 21:15:38'),
(1509, 0, 'Lightly grease a muffin tin, or line with papers and coat the papers with nonstick spray. ', 354, '2012-06-08 21:17:14', '2012-06-08 21:17:14'),
(1510, 1, 'Lightly grease a muffin tin, or line with papers and coat the papers with nonstick spray. ', 354, '2012-06-08 21:17:14', '2012-06-08 21:17:14'),
(1511, 2, 'Cream together the butter and sugar in a large mixing bowl until light and fluffy and almost white in color. Scrape down the bowl to make sure all the butter is incorporated, then turn the mixer back on and add the eggs, one at a time, beating well after each addition. Add the vanilla and sour cream, and mix until incorporated. ', 354, '2012-06-08 21:17:14', '2012-06-08 21:17:14'),
(1512, 3, 'Add the dry ingredients, mixing on low speed just until the batter is smooth. Scrape the sides and bottom of the bowl once more, to be sure everything is evenly combined. Gently fold in the fruit and refrigerate at least an hour.', 354, '2012-06-08 21:17:14', '2012-06-08 21:17:14'),
(1513, 4, 'Preheat the oven to 400°F (200°C or gas mark 6). Scoop the batter by the 1/4-cupful into the prepared pan and sprinkle with sugar and cinnamon or other topping of choice. Bake the muffins until a cake tester inserted in the center comes out clean, 22 to 26 minutes. Remove from the oven and allow the muffins to cool in the pan for 5 minutes, then turn them out onto a rack to finish cooling.\r\n', 354, '2012-06-08 21:17:14', '2012-06-08 21:17:14'),
(1514, 0, 'Cook corn in a pot of lightly salted water for about 2-3 minutes, until tender crisp.  (You can also microwave frozen corn for 4-5 minutes, then drain).', 355, '2012-06-11 03:28:38', '2012-06-11 03:28:38'),
(1515, 1, 'Combine corn, beans, tomatoes, onions, avocados, and cilantro in a large bowl.  Whisk oil, lime juice, chipotle, salt, and pepper in a separate bowl.  Pour about three-fourths  (or to taste) over vegetables and toss to gently coat.  ', 355, '2012-06-11 03:28:38', '2012-06-11 03:28:38'),
(1516, 0, 'Combine all the ingredients in a blender. Add 2 tablespoons of water. Process until smooth.\r\n', 356, '2012-07-27 01:20:54', '2012-07-27 01:20:54'),
(1517, 0, 'Cut jalapeno and mango into thin strips.  Cut avocado into small chunks.  Finely chop the cilantro.', 357, '2012-07-27 01:27:12', '2012-07-27 01:27:12'),
(1518, 1, 'On each whole wheat wrap place a bed of spring mix.  Top with jalapeno, mango, avocado, cilantro, and candied pecans.  Drizzle with the sesame ginger dressing. Enjoy!', 357, '2012-07-27 01:27:12', '2012-07-27 01:27:12'),
(1519, 0, 'Cut jalapeno, pear, and mango into thin strips.  Cut avocado into small chunks.  Finely chop the cilantro.', 358, '2012-07-27 01:42:05', '2012-07-27 01:42:05'),
(1520, 1, 'On each whole wheat wrap place a bed of spring mix.  Top with jalapeno, mango, avocado, cilantro, pear, and candied pecans.  Drizzle with the sesame ginger dressing. Enjoy!', 358, '2012-07-27 01:42:05', '2012-07-27 01:42:05'),
(1521, 0, '1. Put all of the ingredients in a blender and puree until smooth. Pour into glasses and serve. ', 359, '2012-07-27 14:59:33', '2012-07-27 14:59:33'),
(1522, 0, 'In a 2-quart saucepan, bring 2 cups water and sugar to a boil, stirring to dissolve. Reduce heat to low and simmer, without stirring, to make a syrup, for 5 minutes.', 360, '2012-07-29 03:54:38', '2012-07-29 03:54:38'),
(1523, 1, 'Pour the syrup into a medium bowl, stir in vanilla extract, and transfer to the freezer to let chill for 15 minutes.', 360, '2012-07-29 03:54:38', '2012-07-29 03:54:38'),
(1524, 2, 'Purée 1 lb. of the raspberries (about 4 cups) with the syrup in a blender or food processor until smooth. Scrape the purée through a fine sieve into a bowl; discard the seeds. Stir lemon juice into the raspberry purée and pour it into a 2-quart ice cream maker. Freeze according to the manufacturer''s instructions until almost set but still a little slushy, about 25 minutes.', 360, '2012-07-29 03:54:38', '2012-07-29 03:54:38'),
(1525, 3, 'Add remaining raspberries (about 1 cup) and continue freezing in the ice cream maker for about 5 minutes. Transfer the sorbet to a plastic container and freeze until completely set, about 1 hour.\r\n\r\n\r\n', 360, '2012-07-29 03:54:38', '2012-07-29 03:54:38'),
(1526, 0, 'Preheat oven to 375 degrees.  Mix dry ingredients in a bowl and add the beer.  Stir until combined.', 361, '2012-08-10 21:18:46', '2012-08-10 21:18:46'),
(1527, 1, 'Pour dough into a bread pan that has been greased.  Pour melted butter on the top.', 361, '2012-08-10 21:18:46', '2012-08-10 21:18:46'),
(1528, 2, 'Bake for one hour.  Remove bread from pan and place on a cooling rack. Serve warm with butter.', 361, '2012-08-10 21:18:46', '2012-08-10 21:18:46'),
(1529, 0, 'Preheat oven to 350 degrees.  Coat deep baking dish with cooking spray.', 362, '2012-08-19 03:45:45', '2012-08-19 03:45:45'),
(1530, 1, 'Whisk together 2 tablespoons maple syrup and vinegar in a bowl.  Place blackberries in a large bowl, and drizzle maple mixture over them.  Add sugar, 3 tablespoons flour, and 1/8 teaspoon salt to berries; toss to combine.  Transfer to prepared baking dish.', 362, '2012-08-19 03:45:45', '2012-08-19 03:45:45'),
(1531, 2, 'Combine remaining 13 tablespoons flour, oats, pecans, brown sugar, and remaining 1/4 teaspoon salt in a separate bowl.  Drizzle oil and remaining 3 tablespoons maple syrup over dry ingredients  Use fingers to combine thoroughly until small clumps form.  Arrange topping clumps over berries.', 362, '2012-08-19 03:45:45', '2012-08-19 03:45:45'),
(1532, 3, 'Bake 30 to 40 minutes, or until topping is slightly browed ad berry juices are bubbling just around edges of crisp.', 362, '2012-08-19 03:45:45', '2012-08-19 03:45:45'),
(1533, 6, 'Transfer to a paper towel to blot off any excess oil before serving.\r\n\r\n', 363, '2012-08-19 20:01:28', '2012-08-19 20:01:28'),
(1534, 0, 'Stir together flax and water in a small bowl or cup, set aside.\r\n', 363, '2012-08-19 20:01:28', '2012-08-19 20:01:28'),
(1535, 1, 'In a food processor, add dry oats and pulse on high six or seven times, add the rice and pulse a few more times.\r\n\r\n ', 363, '2012-08-19 20:01:28', '2012-08-19 20:01:28'),
(1536, 2, 'Add remaining ingredients including 1 T canola oil and flax/water mixture and blend till just mixed. (do not over process, you can finish mixing together with your hands).\r\n\r\n', 363, '2012-08-19 20:01:28', '2012-08-19 20:01:28'),
(1537, 3, 'With dampened hands, form balls the size of a ping pong ball and then flatten into little patties about 1/4" thick (thicker if you like).\r\n', 363, '2012-08-19 20:01:28', '2012-08-19 20:01:28'),
(1538, 4, 'Coat the bottom of a non-stick frying pan with the remaining 1 T canola oil and heat over medium high.\r\n\r\n', 363, '2012-08-19 20:01:28', '2012-08-19 20:01:28'),
(1539, 5, 'When the oil is hot, cook the patties on each side until they are browned.\r\n\r\n', 363, '2012-08-19 20:01:28', '2012-08-19 20:01:28'),
(1540, 0, 'Stir together flax and water in a small bowl or cup, set aside.\r\n', 364, '2012-08-19 20:43:00', '2012-08-19 20:43:00'),
(1541, 3, 'With dampened hands, form balls the size of a ping pong ball and then flatten into little patties about 1/4" thick (thicker if you like).\r\n', 364, '2012-08-19 20:43:00', '2012-08-19 20:43:00'),
(1542, 0, 'Stir together flax and water in a small bowl or cup, set aside.\r\n', 365, '2012-08-19 21:14:59', '2012-08-19 21:14:59'),
(1543, 1, 'With dampened hands, form balls the size of a ping pong ball and then flatten into little patties about 1/4" thick (thicker if you like).\r\n', 365, '2012-08-19 21:14:59', '2012-08-19 21:14:59'),
(1544, 6, 'While the oil heats, form the first batch of patties. Using a very light touch, form patties that are about 2 1/4 inches in diameter, about 3/4 inch thick in the center and less so at the edges. Do not pat down or try to be too neat. The patties should just about hold together.', 366, '2012-08-20 21:48:30', '2012-08-20 21:48:30'),
(1545, 11, '2.) Use fresh herbs & spices where possible. The fresher they are, the better they taste. Also, use a little all-purpose flour if your patties are not sticking together.', 366, '2012-08-20 21:48:30', '2012-08-20 21:48:30'),
(1546, 7, 'Put as many patties into the hot oil as the utensil will hold in a single layer. Fry about 4 minutes or until the patties a reddish brown on both sides. Turn at least once during the frying process.', 366, '2012-08-20 21:48:30', '2012-08-20 21:48:30'),
(1547, 12, '3.) If you substitute dried chickpeas with canned, don''t add salt, since canned chickpeas contain salt anyway. ', 366, '2012-08-20 21:48:30', '2012-08-20 21:48:30'),
(1548, 8, 'When the patties are done, remove them with a slotted spoon and drain on a paper towel. do all of the patties this way. ', 366, '2012-08-20 21:48:30', '2012-08-20 21:48:30'),
(1549, 13, '4.) Falafel is best served in a pita with salad. ', 366, '2012-08-20 21:48:30', '2012-08-20 21:48:30'),
(1550, 9, 'Here''s some tips: ', 366, '2012-08-20 21:48:30', '2012-08-20 21:48:30'),
(1551, 0, 'Soak the chickpeas in water for 25 hrs.', 366, '2012-08-20 21:48:30', '2012-08-20 21:48:30'),
(1552, 1, 'Drain the chickpeas and put them into the container of a good processor or blender. Add the baking soda and salt. ', 366, '2012-08-20 21:48:30', '2012-08-20 21:48:30'),
(1553, 2, 'Turn the machine on and blend until you have the texture of coarse bread crumbs or fine bulgur wheat. You should NOT have a paste. ', 366, '2012-08-20 21:48:30', '2012-08-20 21:48:30'),
(1554, 3, 'Empty the chickpeas into a bowl. Add the onion, parsley, cumin, coriander, garlic, black pepper, lemon juice, and cayenne. ', 366, '2012-08-20 21:48:30', '2012-08-20 21:48:30'),
(1555, 4, 'Mix gently with a fork. Do not pat down. This mixture should be loose and crumbly. ', 366, '2012-08-20 21:48:30', '2012-08-20 21:48:30'),
(1556, 10, '1.) Use the right oil: Olive oil is not good for frying, due to its low smoke point. Choose an oil with a higher smoke point, such as Canola, sunflower or avocado oil. ', 366, '2012-08-20 21:48:30', '2012-08-20 21:48:30'),
(1557, 5, 'Put 2 inches of oil in a wok or other utensil for deep frying and set to a heat on a medium-low flame. You need a temperature of 350 to 375 degrees F.', 366, '2012-08-20 21:48:30', '2012-08-20 21:48:30'),
(1558, 0, 'Stir together flax and water in a small bowl or cup, set aside.\r\n', 367, '2012-09-23 17:57:36', '2012-09-23 17:57:36'),
(1559, 5, 'When the oil is hot, cook the patties on each side until they are browned.\r\n', 367, '2012-09-23 17:57:36', '2012-09-23 17:57:36');
INSERT INTO `steps_bak` (`id`, `order_num`, `instruction`, `recipe_id`, `created_at`, `updated_at`, `order_num_test`) VALUES
(1, 1, 'Adjust oven rack to middle position & preheat oven to 350 degrees.', 1, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(2, 2, 'Place potatoes in large pot & add enough cold water to cover by 2 inches. Bring potatoes to boil over high heat, then lower heat to maintain gentle simmer. Cook potatoes until they are barely tender.', 1, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(3, 3, 'Drain potatoes. When cool enough to handle (5 - 8 min), peel with paring knife.', 1, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(4, 4, 'Shred potatoes using shredding attachment of food processor or large holes on box grater. Place shredded potatoes in large bowl and set aside.', 1, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(5, 5, 'Bring cream and broth to simmer in small saucepan.', 1, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(6, 6, 'Remove pan from heat and stir in garlic, butter, & parmesan.', 1, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(7, 7, 'Pour cream mixture into bowl with potatoes and stir to combine.', 1, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(8, 8, 'Stir in salt and pepper.', 1, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(9, 9, 'Scrape potato mixture into 2-quart oval baking dish and sprinkle with cheddar.', 1, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 9),
(10, 10, 'Cover dish with foil and bake 30 minutes.', 1, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 10),
(11, 11, 'Uncover and continue cooking until top is nicely browned, 20-25 minutes.  Cool 10 minutes before serving.', 1, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 11),
(12, 1, 'In the morning, place the beans in water to soak 10-12 hrs. That evening, drain the beans & place them in the crock pot.', 2, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(13, 2, 'Chop the bell pepper & the onion. Place in crock pot.', 2, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(14, 3, 'Mince the garlic & the jalepenos. Place in crock pot.', 2, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(15, 4, 'Place the dry TVP in the crock pot.', 2, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(16, 5, 'Place 2 cans tomato in the crock pot.', 2, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(17, 6, 'Add seasonings to crock pot.', 2, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(18, 7, 'Cover mixture with water & stir well.', 2, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(19, 8, 'Turn crockpot on low. (note: Leaving your crockpot on as you sleep is dangerous.)', 2, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(20, 9, 'Stir when you have time during cooking.', 2, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 9),
(21, 10, 'Cook until beans are tender, about 16 hours.', 2, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 10),
(22, 1, 'Combine sugar, coffee, vanilla, & water.  Stir until sugar is dissolved completely.  Set aside and allow to cool completely. Note:  (If you do not allow mixture to cool completely the alcohol will evaporate!)', 3, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(23, 2, 'Add vodka to coffee mixture and stir to combine.', 3, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(24, 3, 'Pour over ice and add your favorite ingredients.  Sit back, relax, and enjoy!  Note: (This keeps well & gets better with age.)', 3, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(25, 1, 'In a Dutch oven or soup kettle over medium heat, saute the zucchini, onion, 2 Tb parsley, & basil in butter until vegetables are tender.', 4, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(26, 2, 'Stir in flour, salt and pepper.', 4, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(27, 3, 'Gradually stir in water.', 4, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(28, 4, 'Add bouillon & lemon juice. Mix well.', 4, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(29, 5, 'Bring to a boil. Cook & stir for 2 minutes.', 4, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(30, 6, 'Add tomatoes, milk, and corn; bring to a boil.', 4, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(31, 7, 'Reduce heat; cover and simmer for 5 minutes or until corn is tender.', 4, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(32, 8, 'Just before serving, stir in cheeses until melted.', 4, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(33, 9, 'Add sugar & garnish with additional parsley, if desired.', 4, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 9),
(34, 1, 'Preheat oven to 350 degrees.', 5, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(35, 2, 'Trim the beef of excess fat. Season very well with salt and pepper. (If using canned broth, season the beef very lightly with salt.)', 5, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(36, 3, 'Heat a Dutch oven or other heavy pot on high heat until very hot. Add oil and sear beef until browned on all sides. Remove beef and set aside.', 5, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(37, 4, 'Add onion, carrot, celery & garlic. Saute until the vegetables begin to brown. Reduce the heat to medium and continue cooking until the vegetables are very soft.', 5, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(38, 5, 'Add tomato puree and cook until mixture is dark brown, about 8-9 minutes.', 5, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(39, 6, 'Add flour, stir and cook for 3 to 4 minutes.', 5, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(40, 7, 'Add the wine and bouquet garni, and stir well, scraping to remove any bits stuck to the bottom of the pan.', 5, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(41, 8, 'Return the beef to the pan.', 5, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(42, 9, 'Add the stock a little at a time, stirring with a wooden spoon, until the stock comes about 2/3 up the side of the beef roast. The amount of stock will vary depending on the size of the pan.', 5, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 9),
(43, 10, 'Bring to a boil, cover and place in the oven until the beef is fork-tender, about 2 hours.', 5, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 10),
(44, 11, 'Remove the beef and keep warm. Skim excess grease off the sauce, strain out the vegetables and remove the bouquet garni.  Note: (If the sauce is too thin, simmer, uncovered, until reduced and slightly thickened. Taste and adjust seasoning with salt and pepper.)', 5, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 11),
(45, 12, 'Slice beef and serve with sauce and vegetables.', 5, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 12),
(46, 1, 'Heat water to boiling. Add cardamom & cinnamon to hot water and mix well.', 6, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(47, 2, 'Add tea bags and steap for 5 minutes.', 6, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(48, 3, 'Place tea in refridgerator to cool.', 6, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(49, 4, 'Mix together the remaining ingredients.', 6, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(50, 5, 'Fill glasses with crushed ice.', 6, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(51, 6, 'Fill each glass about 1/2 with milk/sugar mixture.', 6, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(52, 7, 'Carefully pour cooled tea over top to preserve seperation.', 6, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(53, 1, 'Preheat oven to 375 degrees.', 7, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(54, 2, 'Place oil, brown sugar, molasses, egg and sour cream in a mixer bowl and mix at medium speed to blend well.', 7, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(55, 3, 'Stir flour, ginger, cinnamon, cloves, salt, and baking soda together to blend well.', 7, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(56, 4, 'Add flour mixture to sour cream mixture. Mix at medium speed until creamy.', 7, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(57, 5, 'Spray cookie sheet with oil or line with foil.', 7, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(58, 6, 'Drop dough by 1 1/2 tablespoonfuls onto cookie sheets.', 7, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(59, 7, 'Bake at 375 degrees for about 10 minutes, or until cookies are firm and lightly browned.', 7, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(60, 8, 'Remove cookies and place them on a wire rack.  Allow the cookies to reach room temperature before serving.', 7, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(61, 1, 'Seperate egg yolks & whites.', 8, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(62, 2, 'Beat 1 cup sugar and egg yolks.', 8, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(63, 3, 'Add half & half and whisky.', 8, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(64, 4, 'In another bowl, beat whipping cream until thick. Add 2 cups sugar while beating.', 8, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(65, 5, 'In another bowl, beat egg whites until stiff peaks form.', 8, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(66, 6, 'Fold cream into egg yolk mixture, then fold in whites.', 8, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(67, 7, 'Serve in cups with nutmeg on top.', 8, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(68, 1, 'Dissolve yeast in 1/2 cup warm water.', 9, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(69, 2, 'Stir in remaining 2 cups water, flour and sugar. Blend until smooth.', 9, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(70, 3, 'Cover with cheesecloth and let stand at room temperature 5-10 days or until bubbly, stirring mixture 2-3 times each day. Note: (A warmer room speeds up the fermentation process.)', 9, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(71, 4, 'To store, transfer the starter to a jar, cover with cheesecloth and refrigerate. Do not cover tightly with a metal lid.', 9, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(72, 5, 'To use starter, bring the desired amount to room temperature.', 9, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(73, 6, 'To replenish the starter after using, stir in 50% all-purpose flour & 50% warm water & 1 tsp granulated sugar or honey.', 9, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(74, 7, 'Cover & let stand at room temperature at least 1 day or until bubbly.', 9, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(75, 8, 'Refrigerate for later use.', 9, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(76, 9, 'If starter has not been used for 10 days, stir in 1 tsp sugar or honey. Repeat any 10 day period when starter is not used.', 9, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 9),
(77, 1, 'Bring the starter to room temperature.', 10, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(78, 2, 'Dissolve yeast in warm water with sugar and allow to stand 10 minutes. Note: (If mixture doesn''t become bubbly, throw it out and start over as the water was too hot or the yeast was dead.)', 10, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(79, 3, 'Stir in wheat flour, salt, and starter.', 10, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(80, 4, 'Mix 2 1/2 cups unbleached flour and baking soda. Slowly add this mixture to the starter mixture.', 10, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(81, 5, 'Gradually add 1/2 - 1 cup unbleached flour at a time, mixing with a spoon.', 10, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(82, 6, 'On a lightly floured surface, knead in enough of the remaining unbleached flour to make a moderately stiff dough that is smooth and elastic, 6 - 8 minutes total.', 10, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(83, 7, 'Shape into a ball and place in a greased bowl. Turn once to grease the top and cover with a clean cloth or plastic wrap. Let rise about 1 hour or until doubled.', 10, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(84, 8, 'Punch down and divide into. Shape into 2 loaves and place in 2 greased bread pans.', 10, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(85, 9, 'Using a sharp knife, cut 3 slits diagonally in the top of each loaf.  Allow to rise for 45 minutes or until doubled. Meanwhile, preheat oven to 400 degrees.', 10, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 9),
(86, 10, 'Bake loaves 35 - 40 minutes. Cool on wire racks.', 10, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 10),
(87, 1, 'Bring sourdough starter to room temperature.', 11, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(88, 2, 'Soak cracked wheat & bulgar in hot water for 10 minutes.', 11, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(89, 3, 'Dissolve yeast in warm water with sugar and allow to stand 10 minutes. Note: (If mixture doesn''t become bubbly, throw it out and start over as the water was too hot or the yeast was dead.)', 11, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(90, 4, 'Stir in wheat flour, salt, and starter.', 11, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(91, 5, 'Add cracked wheat, bulgar, flax seed, baking soda, and honey.', 11, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(92, 6, 'Gradually add unbleached flour, mixing until no longer liquid.', 11, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(93, 7, 'On a lightly floured surface, knead in enough of the unbleached flour to make a moderately stiff dough that is smooth and elastic, 6 - 8 minutes total.', 11, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(94, 8, 'Shape into a ball and place in a greased bowl. Turn once to grease the top and cover with a clean cloth or plastic wrap. Let rise about 1 hour or until doubled.', 11, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(95, 9, 'Punch down and divide into. Shape into 2 loaves and place in 2 greased bread pans.', 11, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 9),
(96, 10, 'Using a sharp knife, cut 3 slits diagonally in the top of each loaf.  Allow to rise for 45 minutes or until doubled. Meanwhile, preheat oven to 400 degrees.', 11, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 10),
(97, 11, 'Bake loaves 35 - 40 minutes until it makes a hollow sound when you thump the top.', 11, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 11),
(98, 12, 'Brush tops with butter & cool on a wire rack.', 11, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 12),
(99, 1, 'Pour 2 cups boiling water over the cracked wheat.', 12, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(100, 2, 'Add the honey, reserving 1 teaspoon for later, salt and oil. Let cool.', 12, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(101, 3, 'Dissolve the yeast in 2/3 cup warm water and add the reserved teaspoon honey. Add the cooled cracked wheat mixture. Stir in flour and mix thoroughly.', 12, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(102, 4, 'Place dough a buttered bowl and cover, let rise for 1 hour.', 12, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(103, 5, 'Punch down and let rise for another 30 minutes.', 12, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(104, 6, 'Punch down and turn out on a floured board. Knead well.  Shape into 2 loaves and place in butter loaf pans.', 12, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(105, 7, 'Bake at 350 until golden brown.', 12, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(106, 1, 'Mix 1/4 cup water & yeast. Allow to stand for 10 minutes.', 13, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(107, 2, 'Mix 2 1/4 c water, olive oil, flour, and salt with yeast mixture.', 13, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(108, 3, 'Knead until elastic (7-9 minutes), then allow to rise 30-40 minutes or until double.', 13, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(109, 4, 'Punch down and divide into 3 parts and place into 3 pie pans greased with olive oil.', 13, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(110, 5, 'Shape into 3 crusts, then dimple dough with fingers.', 13, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(111, 6, 'Combine olive oil and water, then brush tops with this mixture.', 13, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(112, 7, 'Sprinkle kosher salt, pepper, rosemary, and thyme on top.  Let rise 50 - 60 minutes.', 13, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(113, 8, 'Bake at 350 degrees F for 25 minutes.  Take out of the oven, then brush with olive oil.', 13, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(114, 1, 'Peel and slice the avacodo into small chunks and place in a small bowl.', 14, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(115, 2, 'Pour lemon juice over the avacado and mash with a fork leaving the mixture slightly chuncky.', 14, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(116, 3, 'Add remaining ingredients and stir until well blended.', 14, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(117, 4, 'Cover and chill in refrigerator at least 30 minutes before serving.', 14, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(118, 1, 'Saute garlic and onion in butter until tender.', 15, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(119, 2, 'Stir in flour and white pepper and cook about 1 minute.', 15, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(120, 3, 'Add milk and boullion and stir until blended.  Cook until mixture thickens.', 15, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(121, 4, 'Remove from heat and stir in parmesan cheese.', 15, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(122, 1, 'Skin and remove the seed from the avacados. Mash in a large bowl with a potato masher.', 16, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(123, 2, 'Add the garlic & lime juice. Mix to prevent browning.', 16, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(124, 3, 'Dice the tomatillos, onion, bell pepper, cilantro & place in bowl with avacado.', 16, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(125, 4, 'Mince the jalepenos & anaheims & place in bowl with avacado.', 16, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(126, 5, 'Add 1 tablespoon kosher salt and stir to evenly distribute.', 16, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(127, 6, 'Taste mixture. You will probably need to add more salt & lime juice to taste.', 16, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(128, 7, 'Refrigerate for at least 1 hour. The garlic will be stronger if allowed to sit in the refrigerator overnight.', 16, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(129, 1, 'Mix yeast & warm water in bowl and let stand 3 minutes', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(130, 2, 'Combine flours & salt in large bowl. Pour the cool water & yeast mixture over the flour & mix to form a shaggy mass.', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(131, 3, 'Place dough on floured work surface & knead for 4 minutes. Let the dough rest on the surface for 20 minutes covered with a light towel. (This rest period is the autolyse)', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(132, 4, 'Knead dough for 6-8 minutes. Don''t overknead. The dough should be smooth, stretchy, and resilient. ', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(133, 5, 'Place in a lightly oiled bowl, turn it to coat with oil, and cover with plastic wrap. Let rise at room temperature (75-77&deg; F) for 1 1/2 - 2 hours, or until nearly doubled in volume', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(134, 6, 'Gently deflate the dough & fold it over itself in the bowl. Reshape it into a ball & cover with plastic wrap. Let rise for 1 1/4 hours or until nearly doubled again.', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(135, 7, 'Gently deflate the dough again, reshape into a round, cover & let rise about 1 hour.', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(136, 8, 'Place the dough on a very lightly floured surface & divide into 3 equal pieces (about 10 oz. each).', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(137, 9, 'Gently stretch one piece into a rectangle, leaving some large bubbles in the dough. Fold the top third down and the bottom third up as if you were folding a business letter. ', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 9),
(138, 10, 'Now form the loaf into a log by rolling the dough over from left to right and sealing the seam with the heel of your palm.', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 10),
(139, 11, 'Fold the dough over about 1/3 of the way each time, seal the length of the loaf then repeat. You want to gently draw the skin tight over the surface of the baguette while leaving some air bubbles in the dough. ', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 11),
(140, 12, 'Seal the seam, being careful not to tear the skin of the dough or deflate its airy structure. Set aside on the work surface to relax before elongating it, and repeat the shaping process with the remaining pieces of dough.', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 12),
(141, 13, 'Elongate each baguette, by rolling it back & forth on the work surface. Begin with both hands over the center of the loaf & work them out to the ends until the loaf reaches the desired length. ', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 13),
(142, 14, 'Place the finished loaves on a pan generously sprinkled with cornmeal or on a baguette pan. Cover the loaves with well oiled plastic or a floured cloth & let rise 30-40 minutes until the loaves are slightly plump but still not doubled in volume. The final rise is short, because you want the baguettes to be slightly under proofed; this will give them a better oven spring, resulting in loaves with a light, airy crumb and more flared cuts.', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 14),
(143, 15, 'Thirty minutes before baking, preheat the oven to 500&deg; F & place a pan of water on the bottom rack.', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 15),
(144, 16, 'Use a very sharp razor blade or lame to make 3-5 slashes, depending on the length of your loaves, on the top of each baguette. The cuts should run from one end of the loaf to the other, rather than accross it, and the blade should be held at a 30&deg; angle to the loaf so the cuts pop open in the oven. Be careful not to press down too hard, or you may deflate the loaves. ', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 16),
(145, 17, 'Using a plant sprayer, mist the loaves & sprinkle poppy seeds, sesame seeds, and sunflower seeds on top. rn', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 17),
(146, 18, 'Spray the inside of the oven, then insert the loaves. After 1 minute, mist the loaves and oven walls and close the door. After 2 more minutes, spray the loaves & oven walls again.', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 18),
(147, 19, 'Bake 12 minutes then lower the oven temperature to 400&deg; and bake 25-30 minutes longer until the loaves are golden brown and crisp. ', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 19),
(148, 20, 'Move them to a rick to cool.', 17, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 20),
(149, 1, 'Sprinkle yeast on lukewarm water in mixing bowl, stir to dissolve.', 18, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(150, 2, 'Add sugar, salt, and stir to dissolve.', 18, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(151, 3, 'Add flour and knead dough until smooth and elastic.  Let rise at least 1/2 hour.', 18, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(152, 4, 'While dough is rising, prepare a baking soda water bath with 2 cups warm water and 2 tbsp. baking soda. Be certain to stir often.', 18, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(153, 5, 'After dough has risen, pinch off bits of dough and roll into a long rope, about 1/2 inch or less thick, and shape.', 18, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(154, 6, 'Dip pretzel in soda solution & place on greased baking sheet. Allow pretzels to rise again. Meanwhile, preheat oven to 450 degrees.', 18, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(155, 7, 'Bake pretzels for about 10 minutes or until golden brown.  Take out of the oven and brush with melted butter & sprinkle with coarse salt.', 18, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(156, 8, 'Note:  Instead of the coarse salt, you can sprinkle pretzels with cinammon and sugar OR you can sprinkle pretzels with parmesan cheese and coarse salt.', 18, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(157, 1, 'Preheat oven to 300&deg;', 19, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(158, 2, 'Half & seed the jalepenos.', 19, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(159, 3, 'Combine cheeses, bacon bits, and seasonings.', 19, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(160, 4, 'Spoon into pepper halves.', 19, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(161, 5, 'Roll in breadcrumbs.', 19, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(162, 6, 'Place on greased cookie sheet & bake uncovered for 20-25 minutes.', 19, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(163, 1, 'In a large saucepan, cook fettuccine in salted water until tender.  Drain.', 20, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(164, 2, 'In a small saucepan, blanch broccoli in salted boiling water.  Drain.', 20, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(165, 3, 'While fettuccine is cooking, cook onions, garlic, and mushrooms in the butter in a heavy saucepan until onions are translucent.  Stir in flour and cook over low heat for 5 mintues, stirring constantly.  ', 20, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(166, 4, 'Add milk, chicken bouillon, and nutmeg, stirring continually until mixture thickens.', 20, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(167, 5, 'Add cream cheese and cooked broccoli, stirring over low heat just until cream cheese is incorporated and mixture is hot.', 20, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(168, 6, 'Add fettuccine noodles, cheese, parsley, and pepper to taste.  Serve hot with crusty garlic bread.', 20, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(169, 7, 'Note:  This recipe is also good made with shrimp or chicken.', 20, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(170, 1, 'Combine teriyaki marinade and chicken. Toss chicken to coat and let marinade at least 2 hours.  When the chicken has finished marinading, cook in a large wok until done, then slice into 1 inch chunks.', 21, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(171, 2, 'To prepare noodle marinade, combine onion powder, garlic powder, olive oil, sesame oil, brown sugar, pineapple juice, soy sauce, red wine, mirin, and hoisin sauce in a large bowl. Whisk ingredients with a wire wisk, then gently pull the yakisoba noodles apart and place them in the bowl.  Toss to coat and let marinade for at leas 5 minutes.', 21, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(172, 3, 'Meanwhile, heat a large wok or skillet over medium-high heat.  When the pan is hot, add the vegetable oil around the sides and let it run into the center of the pan.  Add the carrots, onion, cabbage, broccoli, and mushrooms and stir-fry until the vegetables are almost tender-crisp, about 2-3 mintues.', 21, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(173, 4, 'Add the marinated yakisoba noodles and stir-fry for an additional 3 to 5 minutes, or until the noodles are tender and hot and the vegetabes are tender-crisp.', 21, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(174, 5, 'Place the yakisoba noodles in a bowl or plate and arrange chicken over nookdles.  Sprinkle with toasted sesame seeds and serve.', 21, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(175, 1, 'Preheat oven to 350 degrees.  Lightly coat an 8 X 4" loaf pan with canola oil and set aside.', 22, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(176, 2, 'In a large bowl, combine the pastry flour, all-purpose flour, flaxseed, brown sugar, baking soda and salt, and set aside. ', 22, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(177, 3, 'In a medium bowl, lightly beat the eggs.  Whisk in the pumpkin, canola oil, applesauce, apple juice, cinnamon, ginger and nutmeg.  Stir in the dried cranberries.', 22, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(178, 4, 'Add the wet ingredients to the dry ingredients, mixing until all the dry ingredients are fully incorporated into the batter.  Do not beat or overmix.  Pour the batter into the prepared pan.', 22, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(179, 5, 'Bake for 50 to 60 minutes, until a wooden toothpick inserted into the center comes out clean. Cool in the pan on a wire rack for 10 minutes.  Remove the bread from the pan and continue cooling on the rack.', 22, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(180, 1, 'Heat oil in skillet over medium-high heat.  Add onions; saute 4 minutes.  Add curry, saute 1 minute.', 23, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(181, 2, 'Place onion in a crockpot and add water, chicken broth and lentils.  Cook on high 3 to 4 hours or low 7 to 8 hours.  Make sure you check the lentils for tenderness as cooking times will vary depending on your make and model of crockpot.', 23, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(182, 3, 'Place 4 cups of lentils in a blender or food processor and process until smooth. Return mixture to crockpot and add the basil, vinegar, salt, and tomatoes.  Cook until thoroughtly heated.', 23, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(183, 1, 'Wash potatoes and scrub well.  Wrap in foil and bake at 350 degrees for 1 hour, or until tender.  ', 24, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(184, 2, 'Meanwhile, fry bacon until crisp.  Reserve 1 Tbsp. of grease in the frying pan.  Saute onions and garlic in bacon grease until tender.', 24, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(185, 3, 'When potatoes are done, cut each potato lenghwise and scoop out insides leaving 1/4 inch of the insides for support of the potato pealing.  Place insides in a large bowl and arrange outer hulls on a baking sheet.', 24, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(186, 4, 'Add sauted onions and garlic, salt, pepper, butter, milk, and cottage cheese to the bowl with potato centers and beat with an electric mixer until smooth.  Crumble bacon and stir in with a spoon.', 24, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(187, 5, 'Stuff each potato shell using all of the mixture in the bowl. Sprinkle each potato half with paprika and bake in a 375 degree oven until potatoes are hot and the tops begin to brown, about 30 minutes.', 24, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(188, 1, 'Preheat oven to 400 degrees.  Lightly butter 10-inch cast-iron skillet.rn', 25, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(189, 2, 'In a bowl, use fingers to rub 3 tablespoons butter into the flour, oatmeal, brown sugar and nutmeg.  Mixture should be crumbly.  Set aside.', 25, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(190, 3, 'Combine peaches, rasberries, granulated sugar, and cornstarch.  Pour into prepared skillet.  Sprinkle oatmeal topping evenly over peach mixture.', 25, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(191, 4, 'Bake until bubbly, about 30 minutes.  Serve warm with ice cream or whipped cream, if desired. ', 25, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(192, 1, 'Combine all ingredients in a heavy saucepan and wisk with a wire wisk until smooth.', 26, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(193, 2, 'Bring to a simmer on medium heat and simmer until thick, about 3 minutes.', 26, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(194, 1, 'Preheat oven to 325 degrees.  Lightly oil a banking sheet with canola oil using a pump spray canister.  ', 27, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(195, 2, 'Mix oatmeal, coconut, nuts, wheat germ, seeds, and cinnamon in a a large bowl.', 27, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(196, 3, 'In a separate bowl, mix the honey with the oil and vanilla.  Pour oil mixture over the oatmeal mixture and stir with a large spatula.', 27, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(197, 4, 'Spread on the baking sheet.  Bake for 25 to 30 minutes , stiring every 10 minutes, until the mixture is roasted evenly.  ', 27, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(198, 5, 'Add the dried fruits in the last 5 minutes of roasting. Cool completely and store in an airtight container.  ', 27, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(199, 6, 'Note:  This granola is excellent stirred into yogurt, but can also be eaten right out of the container as a snack.  Enjoy!', 27, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(200, 1, 'Preheat oven to 350 degrees.  Grease muffin tin with oil.', 28, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(201, 2, 'Mix dry ingredients in a large bowl.', 28, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(202, 3, 'In another bowl, whisk eggs, pumpkin, and butter until well blended.    Stir in chocolate chips and pour over dry ingredients.  Stir until just moistened.', 28, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(203, 4, 'Bake for 20 to 25 minutes or until muffins are springy to touch.', 28, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(204, 1, 'Soak rice noodles in warm water until soft, drain.', 29, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(205, 2, 'Heat a frying pan until hot and add oil.  Add garlic and brown slightly.  Add egg and scramble until done.  Reduce temperature if necessary.', 29, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(206, 3, 'Add rice noodles to egg mixture.  Turn temperature up and stir-fry noodles until translucent, adding some water if the noodles are dry.', 29, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(207, 4, 'When noodles start to stick, add fish sauce, sugar, pepper flakes, rice vinegar, soy sauce, and green onions.  Continue to cook mixture until dry.', 29, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(208, 5, 'Serve with peanuts on top and lime wedges and bean sprouts on the side.', 29, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(209, 6, 'Note:  Be sure to squeeze lime juice on this dish. It really adds a nice touch.', 29, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(210, 1, 'In a large pot, combine chickepeas with 8 cups of water.  Cover, and brind to a boil over high heat.  Reduce heat to medium, and cook, uncovered, 25 minutes.  Remove from heat.  Let stand, covered, in water overheat.', 30, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(211, 2, 'Place sun-dried tomoatoes in shallow bowl; pour enough boiling water to cover.  Let stand 20 minutes.  Drain, chop coarsley, set aside.', 30, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(212, 3, 'Drain soaked chickpeas and ransfer to food processor.  Add 2 tablespoons oil, 1 tsp. salt and 1/2 tsp. black pepper and process until finely chopped. Add reserved tomatoes, parsley, mint and soy sauce, and process briefly to combine.  Scrape mixture into bowl.', 30, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(213, 4, 'In a large skillet, heat remaining 1 tablespoon oil over medium heat.  Add onion, and cook, stirring often, until softened, about 6 minutes.  Stir in cumin, 1/2 teaspoon salt, garlic and jalapeno, and cook, stirring often, 5 mintues.  Add onion mixture to chickpeas.  Stir in flour until well blended.  Form mixture into 8 round patties.', 30, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(214, 5, 'Preheat electric grill to 350 degrees, or heat a grill pan over medium heat.  Cook burgers, turning once, until golden brown, 4 to 5 minutes.', 30, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(215, 1, 'Preheat oven to 400 degrees.', 31, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(216, 2, 'In a large bowl, dump the cereal, raisins and oil and pour the rnboiling water right over the top. Give it a stir or two and set rnaside.', 31, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(217, 3, 'In another bowl, combine the buttermilk, molasses, honey, eggs rnand rind. Pour that mess over the top of your warm cereal rnmixture, stirring to combine.', 31, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(218, 4, 'In yet another bowl, combine dry ingredients -- flour, baking rnsoda, salt and add to the cereal mixture. ', 31, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(219, 5, 'Line your muffin tins with cupcake liners and fill 2/3 full with rnbatter. ', 31, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(220, 6, 'Bake for 20 to 25 minutes.  ', 31, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(221, 7, 'Cool in tins for a few rnminutes then carefully lift them out to continue cooling on a rack.', 31, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(222, 1, 'Place all ingredients in a drink mixer and shake.  Pour over ice and serve with celery wedge.', 32, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(223, 1, 'In a large bowl, combine 1 cup flour, sugar, salt, and dry yeast. ', 33, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(224, 2, 'Add milk and softened butter or margarine. ', 33, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(225, 3, 'Stir in starter. ', 33, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(226, 4, 'Mix in up to 3 3/4 cups flour gradually, you may need more depending on your climate.', 33, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(227, 5, 'Knead 8 to 10 minutes.', 33, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(228, 6, 'Turn dough out onto a floured surface, and knead for 8 to 10 minutes.', 33, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(229, 7, 'Place in a greased bowl, turn once to oil surface, and cover. Allow to rise for 1 hour, or until doubled in volume.', 33, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(230, 8, 'Punch down, and let rest 15 minutes.rn', 33, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(231, 9, 'Shape into loaves. Place on a greased baking pan. Allow to rise for 1 hour, or until doubled.', 33, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 9),
(232, 10, 'Brush egg wash over tops of loaves, and sprinkle with chopped onion.', 33, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 10),
(233, 11, 'Bake at 375 degrees F (190 degrees C) for 30 minutes, or till done.', 33, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 11),
(234, 1, 'Lightly spoon all-purpose flour into dry measuring cups, level with a knife.  Combine flour and next 5 ingredients (through cinnamon) in a large bowl, stirring with a wisk.', 34, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(235, 2, 'Combine milk, sweet potatoes, sugar, oil, vanilla, and egg yolks, stirring until smooth; add to flour mixture, stirring just until combined,  Beat egg whites with mixerat high speed until soft peaks form; fold egg whites into batter.  Let batter stand 10 minutes.', 34, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(236, 3, 'Heat a nonstick griddle or a nonstick skillet over medium-high heat.  Coat the griddle or pan with with cooking spray.  Spoon about 1/4 cup batter per pancake onto griddle or pan.  Cook 2 minutes or until tops are covered with bubbles and edges are cooked.  Carefully turn pancakes over, and cook 2 minutes or until bottoms are lightly browned.  ', 34, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(237, 1, 'Combine yogurt, juice, garlic, 1/4  teaspoon salt, 1/4 teaspoon pepper, cardamom, cumin, cinnamon, and nutmeg in a large zip-top plastic bag.  Add chicken, seal and marinate in refrigerator overnight, turning bag occasionally.rn', 35, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(238, 2, 'Remove chicken from bag, reserving marinade; pat chicken dry with paper towels.  Combine reserved marinade and chicken broth.', 35, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(239, 3, 'Heat olive oil in a large nonstick skillet over medium-high heat.  Sprinkle chicken with remaining 1/4 teaspoon salt and remaining 1/4 teaspoon pepper.  Add half of chicken to pan; cook 1 1/2 minutes on each side or until browned.  Repeat procedure with remaining chicken.  Return chicken to pan; ppour broth mixture over chicken.  Bring to a boil.  Cover, reduce heat, and simmer 12 minutes or until chicken is done.  Place chicken on serving platter; discard liquid in pan.  Sprinkle chicken evenly with parsley.', 35, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(240, 4, 'Note:  This dish is excellent served with a basmati rice pilaf of toasted almonds, golden reasins, and freshly toasted cumin seeds.  I also like to spoon a little of the sauce in the pan onto the rice for added moisture.', 35, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(241, 1, 'Combine first 4 ingredients in a medium saucepan; bring to a boil.rnCover and simmer for about 10 mintues or until chicken is done.  Remove chicken from pan and discard pepercorns, cooking liquid, and bay leaf.', 36, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(242, 2, 'Shred chicken and place in a large bowl.  Combine vinegar through chili sauce and whish together to throughly blend.  Pour over shredded chicken and let stand while chopping and shredding vegetables. ', 36, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(243, 3, 'Add soba noodles and chopped/shredded vegetables to chicken mixture and toss well.  Place each serving on a plate and top with roasted peanuts and place lime wedges on the side for squeezing over salad.', 36, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(244, 4, 'Note: Be sure to use the lime wedges. It really makes the salad!', 36, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(245, 1, 'Preheat oven to 400 degrees.  Grease a 12 cup muffin tin with canola oil.', 37, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(246, 2, 'In a small bowl toss blueberries with a tablespoon of flour and set aside. ', 37, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(247, 3, 'In a large bowl combine the flour, sugar, baking powder, baking soda, nutmeg, and salt.  Set aside.', 37, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(248, 4, 'In a medium bowl beat the egg, stir in the sour cream and milk, then stir the wet mixture into the flour mixture until combined.  (Batter will be lumpy.)', 37, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(249, 5, 'Stir in the blueberries very gently.  Fill muffin cups 2/3 full with batter.  Bake 18-20 minutes until golden.', 37, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(250, 6, 'Note:  These muffins are not very sweet.  If you like sweeter muffins, add 1/4 cup more sugar to the batter.', 37, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(251, 1, 'Preheat oven to 400F.  ', 38, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(252, 2, 'In a large bowl, mix together first 8 ingredients.', 38, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(253, 3, 'Stir in the water, eggs, oil, and applesauce until just moistened.', 38, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(254, 4, 'Fill greased muffins cups 2/3 full and bake for 20 to 30 minutes.', 38, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(255, 5, 'Let cool on wire racks.  Serve hot.', 38, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(256, 1, 'Place all ingredients in a blender and process until smooth.', 39, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(257, 1, 'Mix all ingredients and let stand a few mintues.', 40, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(258, 2, 'Shape mixture into patties.', 40, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(259, 3, 'Cook in a hot greased non-stick skillet or indoor grill for 4 minutes on each side.', 40, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(260, 4, 'Note:  These burgers are good served as regular burgers or topped with grilled red onions and swiss cheese.', 40, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(261, 1, 'Preheat oven to 250 degrees.  Place popcorn in a very large bowl.', 41, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(262, 2, 'In a medium saucepan over medium heat, melt butter.  Stir in brown sugar, corn syrup, and salt.  Bring to a bowl, stirring constantly.  Boil without stirring 4 minutes.  Remove from heat and stir in soda and vanilla.  ', 41, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(263, 3, 'Pour sugar mixture in a thin stream over popcorn, pretzels, and almonds, stirring to evenly coat.', 41, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(264, 4, 'Place in 2 large shallow baking dishes and bake in oven 1 hour, stirring every 15 minutes.', 41, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(265, 5, 'Remove from oven and let cool completely before braking into pieces.', 41, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(266, 1, 'Combine all ingredient except tuna and place in a ziplock bag.  Add the tuna and seal the bag.  Toss to completely coat. Let marinade 1 hour.  Do not let this marinade longer than 2 hours as the ginger enzymes can over-tenderize the fish.', 42, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(267, 2, 'Brush the grill with canola oil and grill 3 minutes on each side until medium-rare.  Serve immdeietly.', 42, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(268, 3, 'Note:  This is good with swordfish or shark as well. I have also used tilapia, but be sure to cook the tilapia until done.', 42, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(269, 1, 'Heat cranberry juice and sugar on stove stiring regularly until sugar melts.', 43, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(270, 2, 'Let solution cool to room temperature', 43, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(271, 3, 'Poor solution in a flat dish', 43, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(272, 4, 'Add lime juice and vodka and stir.', 43, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(273, 5, 'Place in freezer.', 43, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(274, 6, 'Periodically stir with a fork as it freezes to create slush.', 43, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(275, 7, 'Server on a hot day.', 43, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(276, 1, 'Brown pine nuts in pan on low heat.', 44, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(277, 2, 'Mince pine nuts & garlic with mini food processor.', 44, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(278, 3, 'Add basil, cheese and lemon juice.', 44, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(279, 4, 'Process until finely minced.', 44, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(280, 5, 'With the food processer is going, add olive oil and salt then process until smooth.', 44, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(281, 6, 'NOTE: The basil takes up a lot of room when not minced. All other ingredients require very little space and will not mince well in a large food processor as they will stick to the sides.', 44, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(282, 1, 'Pour boiling water over cereal and let stand.', 45, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(283, 2, 'Mix together remaining ingredients then add softened cereal.', 45, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(284, 3, 'Bake as many as you like in muffin tins sprayed with cooking spray or Canola oil in a pump sprayer.', 45, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(285, 4, 'Bake for 15-20 minutes at 400 degrees.', 45, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(286, 5, 'Note: Batter will keep in refrigerator for up to 3 weeks.', 45, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(287, 1, 'Preheat oven to 350 degrees.', 46, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(288, 2, 'With a stand mixer on medium speed, stir sugar and butter until creamy and light; add molasses and egg, and beat until combined.', 46, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(289, 3, 'Decrease speed and add flour, fresh ginger, ginger, baking soda, and salt; beat until just combined, don''t over mix.', 46, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(290, 4, 'Stir in candied ginger with a spoon.  Roll into 1 inch balls and place 2 inches apart on ungreased cookie sheet. ', 46, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(291, 5, 'Bake for 12 to 13 minutes. Cookie will flatten and be evenly browned. Cool completely before removing from cookie sheet.', 46, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(292, 1, 'In a large pan, combine sugar, butter, honey, water, and salt.  Bring to a simmer over medium high heat and cook for 5 minutes at a gentle simmer. To keep mixture at a gentle simmer you may need to reduce the heat.', 47, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(293, 2, 'Stir in oats, nuts, wheat germ, and sesame seeds or flax. Cook, stirring frequently, for 15 minutes. Remove from heat and add fruit. rn', 47, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(294, 3, 'Pour onto a cookie sheet or jelly roll pan lined with wax paper or parchment. Cut into bars of desired size, so you can break along the cut lines when cool.rn', 47, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(295, 4, 'Allow to cool for 30 minutes. Break along score lines. Store in an airtight container', 47, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(296, 5, 'Note:  For the nuts, I use a combination of pecans, almonds, and penuts.  I use 1/8 cup flax seeds and 1/8 cup sesame seeds for the seeds.  Finally, for the dried fruit, my favorite combination is 1/2 dried apricots, 1/2 raisins, 1/2 cup dried cranberries.', 47, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(297, 1, 'In a medium saucepan, add water and salt. ', 48, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(298, 2, 'Bring to a boil then stir in oats and millet. Reduce heat to low. ', 48, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(299, 3, 'Cover and allow to cook, simmering gently, for 15-20 minutes until grain is tender and water is absorbed. It is not necessary to stir the oatmeal as it is cooking. ', 48, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(300, 4, 'Dish into serving bowl and stir in the brown sugar.  ', 48, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(301, 5, 'Top with raisins, dried cranberries, and almonds and serve with half & half or steamed milk in a small pitcher.', 48, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5);
INSERT INTO `steps_bak` (`id`, `order_num`, `instruction`, `recipe_id`, `created_at`, `updated_at`, `order_num_test`) VALUES
(302, 1, 'Preheat oven to 500 degrees.', 49, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(303, 2, 'Separate the cauliflower into florets.', 49, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(304, 3, 'Put the oil, honey, rosemary, plus salt & pepper if desired, into arnbaking dish and stir together. ', 49, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(305, 4, 'Add the cauliflower, toss till coated, and bake about 20 minutes.  ', 49, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(306, 5, 'Note:  Kid friendly way to serve cauliflower!', 49, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(307, 1, 'Combine chopped vegetables in a medium bowl.', 50, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(308, 2, 'Place oil, vinegar, sugar, and Italian seasoning in a small plastic container with a lid. Secure lid and shake dressing vigorously for 1 minute. ', 50, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(309, 3, 'Pour dressing over salad and toss. Season salad with salt and pepper, to taste.', 50, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(310, 1, 'Bring a large pot of salted water to boil. Add the penne and cook until it is tender but still firm to the bite, stirring occasionally, about 12 minutes.', 51, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(311, 2, 'Mince the garlic in a food processor. Add the goat cheese, cream cheese, 3/4 teaspoon of salt, 1/2 teaspoon of pepper, and half of the spinach leaves. Blend until the mixture is smooth and creamy. Set the cheese and spinach mixture aside.', 51, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(312, 3, 'Meanwhile, coarsly chop the remaining spinach leaves and place them in a large bowl.', 51, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(313, 4, 'Drain the pasta, reserving 1 cup of the cooking liquid. Spoon the pasta atop the spinach leaves in the bowl. Scrape the cheese and spinach mixture over the pasta mixture and toss to coat, adding enough reserved cooking liquid to moisten. Season the pasta, to taste, with salt and pepper. Sprinkle with the Parmesan or Romano cheese and serve.', 51, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(314, 5, 'Note: Experiment with different types of goat cheese with this recipe. It is wonderful!', 51, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(315, 1, 'Heat the oil and salt in a medium frying pan over medium heat.  rnAdd the tofu in small batches and saute until lightly browned onrnboth sides, about 5 minutes. Remove with a slotted spoon and drain on a paper towel.  rnrn', 52, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(316, 2, 'Arrange the bean curd, potatoes, spinach, and cabbage on individual plates. rn', 52, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(317, 3, 'Prepare the dressing by placing the last 7 ingredients in a blender and blending until smooth. If the dressing seems too thick, add another teaspoon of water.rn', 52, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(318, 4, 'Top the vegetables and bean curd with the bean sprouts and dressing, and serve immediately.rn', 52, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(319, 1, 'Heat olive oil in skillet.  When oil is hot, add the garlic and saute for about 45 seconds.  Remove from heat and add the rosemary.', 53, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(320, 2, 'Pour olive oil mixture in a large bowl with potatoes and toss to coat. Spread potatoes evenly onto baking sheet.', 53, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(321, 3, 'Bake at 375 degrees for about 20 minutes, or until potatoes are done.  Give the potatoes a good stir, then turn the oven up to 450 degrees and cook an additional 10 minutes, or until potatoes are crisp.', 53, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(322, 1, 'Heat oven to 350 degrees.  Combine rolled oats, rice cereal, wheat germ, and seeds in a bowl and toss to combine.  Spread onto baking sheet and cook, stirring, until oats are toasted, about 20 minutes. ', 54, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(323, 2, 'Pour oat mixture into a large bowl with cranberries and apricots.  Stir to combine.', 54, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(324, 3, 'In a saucepan, combine corn syrup and sugar and heat until boiling.  Remove from heat and stir in vanilla and cinnamon.', 54, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(325, 4, 'Pour syrup mixture over oat mixture and stir well.  Coat your hands with oil, then use them to spread mixture evenly into a rectangle glass pan.  I find it helpful to do the initial pressing with a rubber spatula and then following with my hands.', 54, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(326, 5, 'Chill until firm, then cut into 24 bars.', 54, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(327, 1, 'Preheat oven to 350 degrees.  Combine flour, sugar, baking powder, and salt in a large bowl; stir well with a whisk.  Make a well in center.', 55, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(328, 2, 'Combine sour cream and next 5 ingredients, through eggs, in a small bowl; stir with a whisk until well combined.  ', 55, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(329, 3, 'Add wet ingredients to dry ingredients and stir until just moistened.  ', 55, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(330, 4, 'Spoon batter evenly into 10 greased muffins cups.  Bake at 350 degrees for 25 minutes or until muffins spring back with touched in the center.  Remove from pan and cool on a wire rack.  ', 55, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(331, 5, 'To prepare glaze, combine powdered sugar, 2/3 teaspoon lemon rind, and 3 tablespoons lemon juice in a small bowl; stir with a whisk until smooth.  ', 55, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(332, 6, 'Spread 1 teaspoon of glaze onto each muffin; let stand about 5 minutes, or until set.  ', 55, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(333, 1, 'Put oven rack in upper third of the oven and preheat oven to 400 degrees.', 56, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(334, 2, 'Line a large shallow pan with foil.  Arrange tomatoes cut side up in pan, and sprinkle with salt and freshly ground pepper.  Roast 20 to 25 minutes, until plump.', 56, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(335, 3, 'Cook pasta in a 6 to 8 quart pot of boiling salted water just until tender, 8 to 10 minutes.  Reserve 1 1/2 cups pasta water.  Drain pasta and return to pan.', 56, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(336, 4, 'Heat oil in a large nonstick skillet over medium-high heat.  Add sausage; saute until browned, breaking up with back of fork, about 5 minutes; drain off fat.  Add peppers and onion; saute until soft and onion is golden brown, about 5 to 10 minutes.', 56, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(337, 5, 'Add to drained pasta.  Stir in roasted tomatoes, cream cheese and reserved cooking water.  Mix in 1/2 cup parmesan cheese and fresh basil.', 56, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(338, 6, 'Put in a buttered 3 1/2 to 4 quart baking dish.  Sprinkle with remaining 1/4 cup romano cheese and bread curmbs, if using.  Bake 10 to 15 minutes or until bubbly.', 56, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(339, 1, 'Combine the broth, orange juice, maple syrup, vinegar, garlic, pepper flakes and salt in a small saucepan.  Bring to a boil over medium heat and boil until thickened a little, about 3 to 5 minutes.  Set aside.', 57, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(340, 2, 'Meanwhile, heat the oil in a large nonstick skillet over medium heat until oil is shimmering.  Add tofu slabs and cook until golden brown, about 7 minutes; turn and cook u ntil golden brown on the other side, about 5 minutes.  Serve the sauce over the tofu.', 57, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(341, 3, 'Note:  If you wish to pan-glaze the tofu, add the boiled, thickened sauce to the tofu after it has browned on both sides, and cook over medium heat for a few more minutes.  Scrape the sauce over the tofu when serving.', 57, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(342, 1, 'Heat oven to 350 degrees.  Spray 12 cup muffin tin with oil.', 58, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(343, 2, 'In a medium bowl, combine flour, baking soda, cinnamon, baking powder, and salt; set aside.  ', 58, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(344, 3, 'In a large bowl, with mixer on medium-high, beat together granulated sugar and eggs until thick and light in color, about 2 minutes.  Add oil, orange juice, and vanilla; beat until smooth.  Reduce mixer speed to low, add flour mixture, and beat just to combine.', 58, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(345, 4, 'Fold in carrots and raisins.  Divide batter among muffin pans and bake 20 to 25 minutes, until toothpick inserted in center of a muffin comes out clean.  Let cool for 15 mintues, then transfer to wire rack to cool completly.', 58, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(346, 5, 'To make frosting, combine cream cheese and confectioners'' sugar in a medium bowl.  Frost the muffins.', 58, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(347, 1, 'Heat oven to 400 F.  Spray a 12 cup muffin tin with canolla oil or nonstick cooking spray, or line with paper baking cups.', 59, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(348, 2, 'Mix oats and buttermilk in large bowl. Beat in brown sugar, oil, molasses, vanilla and egg.', 59, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(349, 3, 'Stir in remaining ingredients except peaches just until flour is moistened (batter will be lumpy).  Fold in peaches.', 59, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(350, 4, 'Divide batter evenly among muffin cups (cups will be full).  Sprinkle with sugar if desired.', 59, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(351, 5, 'Bake about 20 minutes or until golden brown.  Let muffins cool slightly, then remove from pan and continue to cool on wire rack. ', 59, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(352, 1, 'Spray muffin pan with vegetable cooking spray or line with paper rnbaking cups. ', 60, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(353, 2, 'Stir together all dry ingredients. ', 60, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(354, 3, 'Combine eggs, buttermilk, honey and oil. Add egg mixture to flour mixture; stir until moistened. Fold in raisins. ', 60, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(355, 4, 'Fill muffin pan 2/3 full. Bake in a 400 degrees oven for 15-20 minutes.rn', 60, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(356, 1, 'Bring broth or water to boil. Add couscous, olive oil and salt. Simmer for about 10 to 12 minutes or until tender to the bite. Drain and cool couscous.', 61, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(357, 2, 'Combine couscous with kidney beans, peppers, onion, green onion, cilantro and hot pepper flakes.', 61, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(358, 3, 'Whisk together remaining ingredients and combine with couscous mixture. Season with salt and pepper to taste.  Serve room temperature or chilled.', 61, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(359, 1, 'Preheat oven to 400 degrees.  Place pecans in a food processor; process until finely ground.', 62, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(360, 2, 'Combine flours and next 3 ingredients (through salt) in a medium bowl; stir well with a whisk.  Stir in ground pecans.  Make a well in center of mixture.  ', 62, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(361, 3, 'Combine brown sugar and the next 4 ingredients (through egg) in a small bowl; add to the flour mixture, stirring just until moist.  Fold in diced pear.  ', 62, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(362, 4, 'Spoon batter into 15 muffins cups coated with cooking spray or canola oil; sprinkle batter with sugar.  Bake at 400 degrees for 20 minutes or until muffins spring back when touched lightly in center.  Remove from pans immediatly. Place on wire rack to cool.  Serve warm or at room temperature.', 62, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(363, 1, 'Place the sarsaparilla, sassafras, hops, and coriander into an enameled or stainless steel pan. Cover them with water and bring to a boil. Reduce the heat and allow them to just barely simmer for 12 hours, making sure the water does not all evaporate.', 63, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(364, 2, 'Strain out the solids and add the liquid to 2 gallons of water that has been boiled and cooled to lukewarm.', 63, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(365, 3, 'Stir in the honey, wintergreen extract, and the yeast dissolved in 2/3 cup warm water. Stir the mixture thoroughly and allow it to mellow for several hours. ', 63, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(366, 4, 'You can then siphon off the root beer into a clean container before bottling, or fill the bottles immediately.', 63, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(367, 5, 'Makes about two dozen 12-ounce bottles. tanas to each, put the corks and tie them down---then refrigerate immediately. ) for 8 hours. ', 63, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(368, 6, 'Sieve the solution (tea-cloth). Bottle it.Put some raisins, a bit of lemon-peel, and a fresh leaf of peppermint in every bottle, close the bottles, and keep them in a cool place.', 63, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(369, 7, 'Ready when the raisins start floating.', 63, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(370, 8, 'Sieve the stuff one more time in a tea-cloth.', 63, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(371, 1, 'Combine above ingredientsrn', 64, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(372, 2, 'Store in air-tight container.', 64, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(373, 3, 'Sprinkle liberally on chicken and cook in cast iron skillet on high. ', 64, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(374, 4, 'Makes enough for 1 small spice container.', 64, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(375, 1, 'Blend all ingredients well in food processer.rnrn', 65, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(376, 2, 'Note: This dressing goes great on basic salad with blackened shrimp.', 65, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(377, 1, 'In the bowl of a food processor fitted with the steel blade, puree the tomato, cucumber, carrot, fennel, red bell pepper, garlic, Tabasco sauce and bread crumbs until smooth.  ', 66, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(378, 2, 'Pour into a medium bowl and refrigerate.', 66, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(379, 3, 'The next day, return the vegetable puree to the food processor.', 66, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(380, 4, 'With the processor running, add the vinegar, salt, and pepper.  ', 66, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(381, 5, 'Slowly drizzle in the olive oil.  ', 66, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(382, 6, 'Taste and adjust salt and pepper if necessary.  ', 66, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(383, 7, 'Strain through a fine-mesh strainer, pressing with the back of a wooden spoon to extract all of the liquid.  ', 66, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(384, 8, 'Refrigerate until ready to serve.  ', 66, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(385, 9, 'Serve cold in bowls or cups.', 66, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 9),
(386, 10, 'Note:  To peel tomatoes, plunge into boiling water for 30 seconds to 1 minute.  Remove immediately and plunge into cold water.  Skin should slip off easily.', 66, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 10),
(387, 1, 'Mince the garlic, rosemary, sage, & fennel.', 67, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(388, 2, 'Mix in the salt & pepper.', 67, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(389, 3, 'Rub the mixture all over the chops.', 67, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(390, 4, 'Wrap the chops in plastic wrap & allow to set for 2 to 4 hours.', 67, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(391, 5, 'Get your charcoal burning hot in one location and medium in another.', 67, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(392, 6, 'Lay the pork chops out over hot heat & sear 2 minutes per side.', 67, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(393, 7, 'Move the chops to the medium heat of the grill and cover.', 67, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(394, 8, 'Cook until firm and internal temperature reaches 150 deg F (about 3 to 4 min per side).', 67, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(395, 9, 'Transfer chops to a plate and allow to set for 5 minutes. This allows the juices to redistribute & the chops to finish cooking.', 67, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 9),
(396, 10, 'Goes great with grilled asparagus.', 67, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 10),
(397, 1, 'Crumble the turkey sausage meat into a large nonstick skillet and cook over medium-high heat until golden brown.  Remove the sausage and place in a bowl.  Add olive oil and mushrooms to the skillet and cook until they are golden brown and all the juices have evaporated, about 10 minutes.  ', 68, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(398, 2, 'Add the garlic and cook stirring until fragrant, about 30 seconds.  Add the broccoli and the drained sausage; cook until warmed through.  Stir in the penne, broth, lemon juice and the crushed red pepper, if using; cook just until heated through. Serve with sprinkled cheese.  ', 68, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(399, 1, 'In a 10-inch skillet, heat 1 inch water and salt to boiling point over high heat.  Add asparagus; heat to boiling. Reduce heat to low; simmer, uncovered, 3 to 5 minutes, until asparagus is just tender-crisp.  Drain asparagus; set aside.  ', 69, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(400, 2, 'In medium bowl, mix sugar, fish sauce, lime juice and soy sauce.  Stir in chicken until evenly coated. (Coat chicken just before cooking, because the lime juice will change its texture.)', 69, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(401, 3, 'In nonstick 12-inch skillet, heat 2 teaspoons oil over midium-high heat until hot.  Add chicken and cook 5 minutes or just until it loses its pink color throughout, stirring occasionallhy.  With tongs or slotted spoon, transfer chicken to a clean bowl, leaving any cooking liquid in skillet. ', 69, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(402, 4, 'Add onion, ginger and jalapenos to skillet and cook until onion is tender, about 8 minutes.  Transfer onion mixture to bowl with the cooked chicken.  ', 69, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(403, 5, 'In same skillet, heat remaining 1 teaspoon oil over medium heat until hot. Add the asparagus to the skillet and cook until it begins to brown, about 5 minutes, stirring occasionally.  Return oniton mixture and chicken to skillet; heat through.  ', 69, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(404, 6, 'Toss basil and cilantro leaves with chicken mixture just before serving. ', 69, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(405, 1, 'Halve the baguette lengthwise, then cut it crosswise into four portions.  ', 70, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(406, 2, 'In a medium bowl, combine the tuna, salt, pepper, lemon juice and 1 tablespoon of olive oil.  Place a few lettuce leaves on both halves of each baguette portion.  Top the bottom halves with the tuna mixture, tomatoes, onion, olives, basil and capers (if using).', 70, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(407, 3, 'Drizzle with the remaining oil.  Sandwich with the top half of each baguette portion and press gently but firmly.  ', 70, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(408, 1, 'In a food processor blend whole wheat flour, salt, baking soda, cinnamon, nutmeg, and bran for 5 seconds.  Pour into a large mixing bowl.', 71, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(409, 2, 'Process carrots until pureed and stir into dry ingredients.', 71, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(410, 3, 'Process eggs and oil for 2 to 3 seconds and add to flour mixture with milk, vinegar, honey, molasses, and raisins. Stir until just blended. ', 71, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(411, 4, 'Spoon into greased muffin tins and bake in 375 degree oven for 20 to 25 minutes, or until center is set. Remove from oven. Let completely cool on wire rack. rn', 71, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(412, 1, 'Mix all ingredients in a large bowl.', 72, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(413, 2, 'Spread mixture in a shallow pyrex or other glass baking dish.', 72, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(414, 3, 'Bake at 350 degrees until heated through and brown on the top.', 72, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(415, 4, 'Serve with Fritos or tortilla chips.', 72, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(416, 1, 'Preheat oven to 400 degrees.', 73, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(417, 2, 'Place oats in food processor and pulse 5 or 6 times until oats resemble coarse meal.  Place oats in a large bowl.', 73, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(418, 3, 'Add flours and next 5 ingredients through salt to oats in bowl.  Stir mixture well with a whisk.  Make a well in center of mixture.', 73, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(419, 4, 'Combine buttermilk, oil, lemon zest, and eggs in a small bowl.  Stir well with a whisk.  Add to flour mixture, stirring just until moist.', 73, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(420, 5, 'If using fresh blueberries, fold them directly into the batter.  If using frozen berries, toss them with the 2 Tablespoons of flour and gently fold the berries into the batter. ', 73, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(421, 6, 'Spoon batter into sprayed muffin cups, then sprinkle batter with the 2 Tablespoons of granulated sugar. Bake at 400 degrees for 20 minutes or until muffins spring back when touched lightly in center. ', 73, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(422, 7, 'Remove from pans immediately.  Place on a wire rack to cool.', 73, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(423, 8, 'Note: As a variation, I substitute 1/2 cup of chocolate chips for 1/2 cup of the blueberries making a delicious Blueberry Chocolate Chip muffin.', 73, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(424, 1, 'Preheat oven to 350 degrees.', 74, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(425, 2, 'Cook pasta according to the package directions, omitting salt and fat; drain.  Lightly coat pasta with cooking spray.  ', 74, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(426, 3, 'Heat a heavy pan over medium-high heat.  Coat pan with cooking spray.  Add onion and carrot and saute 4 minutes.  Add garlic and saute 1 minute.  Add ground beef, cook 5 minutes or until browned, stirring to crumble.  Add tomato sauce, 1/2 teaspoon salt and pepper.  Cook for 2 minutes or until most of the liquid evaporates.', 74, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(427, 4, 'Add pasta to beef mixture in pan, stirring to combine.  Spoon pasta mixture into an 11 X 7 - inch baking dish coated with cooking spray.', 74, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(428, 5, 'Place milk, flour, nutmeg, and remaining 1/2 teaspoon salt in a medium saucepan, stir with a whisk until blended.  Cook over medium heat 2 minutes or until thickened, stirring constantly with a whisk. Add 1 cup cheese, stirring until smooth.  Pour cheese mixture over pasta mixture, stir.  Top evenly with remaining 1/2 cup cheese. Bake at 350 degrees for 20 minutes or until lightly browned.  Let stand 5 minutes before serving.', 74, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(429, 1, 'Stir together yeast, honey, and 1/2 cup warm water in a large bowl, then let stand until foamy, about 5 minutes. (If mixture doesn''t foam, discard and start over with new yeast.)', 75, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(430, 2, 'While yeast mixture stands, stir together flours in another bowl.', 75, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(431, 3, 'Whisk 1/2 cup flour mixture into yeast mixture until smooth, then cover with plastic wrap and let stand in a draft-free place at warm room temperature until doubled in bulk and bubbly, about 45 minutes.', 75, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(432, 4, 'Sprinkle corn meal on 2 cookie sheets. If you have a baking stone, skip this step as you will place the stone in the oven when it preheats.', 75, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(433, 5, 'Stir in oil, salt, remaining 3/4 cup warm water, and remaining 2 1/4 cups flour mixture until a dough forms.', 75, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(434, 6, 'Turn out dough onto a floured surface and knead, working in just enough additional flour to keep dough from sticking, until dough is smooth and elastic, 8 to 10 minutes.', 75, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(435, 7, 'Form dough into a ball and put in an oiled large bowl, turning to coat. Cover bowl with plastic wrap and let dough rise in draft-free place at warm room temperature until doubled in bulk, about 1 hour.', 75, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(436, 8, 'Punch down dough and cut into 8 pieces. Form each piece into a ball.', 75, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(437, 9, 'Flatten 1 ball, then roll out into a 6 1/2- to 7-inch round on floured surface with a floured rolling pin. Transfer round to 1 of 2 baking sheets lightly sprinkled with cornmeal.', 75, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 9),
(438, 10, 'Make 7 more rounds in same manner, arranging them on baking sheets. ', 75, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 10),
(439, 11, 'Loosely cover pitas with 2 clean kitchen towels (not terry cloth) and let stand at room temperature 30 minutes.', 75, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 11),
(440, 12, 'Set oven rack in lower third of oven and remove other racks. If you have a baking stone, insert it in the oven. Preheat oven to 500°F. ', 75, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 12),
(441, 13, 'Sprinkle corn meal onto baking stone. Transfer 4 pitas, 1 at a time, directly onto oven rack (or baking stone). Bake until just puffed and pale golden, about 2 minutes. Turn over with tongs and bake 1 minute more.', 75, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 13),
(442, 14, 'Cool pitas on a cooling rack 2 minutes, then stack and wrap loosely in a kitchen towel to keep pitas warm. ', 75, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 14),
(443, 15, 'Bake remaining 4 pitas in same manner. Serve warm.', 75, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 15),
(444, 16, ' ', 75, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 16),
(445, 1, 'Preheat oven to 400°F. ', 76, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(446, 2, 'Wash potatoes and slice them crosswise into 1/3" thick disks.', 76, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(447, 3, 'Transfer to baking dish and coat with olive oil.  Add seasonings & salt and pepper to taste.  Toss to coat. rn', 76, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(448, 4, 'Place baking pan in center of oven and bake until potatoes are tender with a deep golden brown crust, about 20 to 25 minutes.', 76, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(449, 5, 'Serve hot.', 76, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(450, 1, 'Preheat oven to 350 degrees.  In a small bowl, combine the whole wheat pastry flour, whole-wheat flour, baking soda, cinnamon, sesame seeds, flax seeds, and salt; set aside.', 77, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(451, 2, 'In a mixing bowl, cream together the butter and sugar.  Add the egg and beat until fluffy.  Beat in the orange zest and juice.  Beat in the flour mixture, then stir in the cereal, oats and dried fruit.', 77, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(452, 3, 'Drop the dough by spoonfuls onto cookie sheets (nonstick or lined with parchment paper).  Bake 10 to 12 minutes or until just lightly browned.  Remove from the oven and transfer to wire racks to cool completely. ', 77, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(453, 1, 'In large wok or skillet, heat oil over medium-high heat.  Add onion, and cook until golden, 5 to 7 minutes.  Add curry paste, and stir-fry 1 minute. Add potatoes, and toss well to coat.  Stir in coconut milk and broth.', 78, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(454, 2, 'Using you hands, lightly crush tomatoes.  Add tomatoes and juice to wok.  Cover, and simmer until potatoes are tender, 15 to 20 minutes. Stir in lime juice and basil. Serve over rice.', 78, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(455, 1, 'Trim asparagus then lay it out on a cookie sheet.', 79, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(456, 2, 'Pour olive oil then sea salt over the asparagus.', 79, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(457, 3, 'Preheat the grill. Lay foil out over the hot area of the flame.', 79, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(458, 4, 'Spread asparagus on the foil & close the grill.', 79, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(459, 5, 'Allow asparagus to cook 3 minutes.', 79, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(460, 6, 'Open the grill & flip the asparagus on the foil.', 79, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(461, 7, 'Allow to cook another 2 minutes or until done.', 79, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(462, 8, 'Serve hot off the grill.', 79, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(463, 9, 'If grilling more, preheat the oven to warm while grilling. Once done, lay the asparagus out on the cookie sheet and lay the foil on top of it. Then place the pan in the oven until the rest of the food is ready.', 79, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 9),
(464, 1, 'Place all ingredients in a bleder, blend and serve.', 80, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(465, 1, 'Blend garlic & jalapeno in food processor', 81, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(466, 2, 'Blend in garbanzo beans & tahini', 81, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(467, 3, 'Add lemon juice and yogurt until you like the consistency', 81, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(468, 4, 'Add sea salt to taste.', 81, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(469, 5, 'Use yogurt to soften the hummus after it has been in the refrigerator.', 81, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(470, 6, 'NOTE:  For variety, add roasted garlic or roasted red bell pepper.  Also, if hummus thickens in refrigerator, stir in plain yogurt to moisten.', 81, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(471, 1, 'Heat oil in a Dutch oven over medium-high heat.  Add onion, bell pepper, garlic, chili powder, cumin, oregano, salt and pepper, and cook stirring occasionally, until tender, about 5 minutes.', 82, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(472, 2, 'Add beans, tomatoes, chipotle to taste, broth and brown sugar.  Bring to a boil over high heat, reduce heat, cover, and simmer for 25 minutes.', 82, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(473, 3, 'Stir in cooked wheat berries and heat through, about 5 minutes more.  Remove from heat.  Stir in lime juice.  Garnish each bowl with avocado and cilantro.rn ', 82, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(474, 1, 'Do Ahead:  Soak brown bhasmati rice 4-6 hours.rnDrain rice, rinse 3 times, set aside.', 83, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(475, 2, 'Drain and cut tofu into small cubes. Place between a folded clean dry towel while prepping vegetables.  Marinate tofu in soy sauce for 15 minutes to 1 hour before cooking.', 83, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(476, 3, 'Heat 1 tablespoon of oil in a non stick frying pan over medium-high heat.  Lightly brown tofu pieces on 2 sides and set aside.', 83, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(477, 4, 'Saute veggies, including jalapeno and fresh ginger, in 2 tablespoons oil for 5 to 10 minutes.', 83, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(478, 5, 'Add remaining spices and herbs, except cilantro, and saute another 2 minutes.', 83, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(479, 6, 'Add rinsed, drained rice, saute another 2 minutes. ', 83, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(480, 7, 'Add salt and water and bring to a boil.  Cover and simmer 40 minutes, or until rice is tender.', 83, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(481, 8, 'Remove bay leaf and cardamom pods, which will have floated to the top.', 83, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(482, 9, 'Gently stir in the tofu, cashews, and cilantro and cook for 5 - 10 minutes.', 83, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 9),
(483, 1, 'Pick over the lentils and discard any stones.  Rinse the lentils and place in a large saucepan with the bay leaves, the four bruised garlic cloves and oregano.  Cover with water by 2 inches.  Bring to a boil, reduce the heat to low, and simmer until the lentils are tender, 20-25 minutes.  Drain and cool.', 84, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(484, 2, 'To make the vinaigrette, whisk together the olive oil, vinegar, two cloves minced garlic and the cumin in a small bowl.  Season with salt and pepper.', 84, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(485, 3, 'Toss the vinaigrette with the lentils, onion, red bell pepper, 1/2 teaspoon salt and pepper. Let sit 20 minutes.  Season as needed with additional salt, pepper and vinegar.', 84, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(486, 4, 'This salad can be prepared to this point up to six hours in advance. ', 84, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(487, 5, 'To serve, toss the lentil salad with the mint and place a platter. Garnish with the crumbled feta, olives and mint springs.', 84, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(488, 1, 'Heat the broiler or a heavy skillet over medium heat; roast the chiles, turning, until blackened on all sides, about 8 minutes.  Tranfer to a plastic or paper bag; set aside to cool.  Pell away blackened skins. (It''s ok if some charred bits remain.)  Seed chiles; chop.  Set aside.', 85, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(489, 2, 'Heat the oil in a Dutch oven over medium heat.  Stir in onions, garlic and cumin; cook, stirring occasionally, until onions are translucent and tender, about 10 minutes.  Meanwhile, cut the chikcen into 1/2-inch square pieces; transfer to the Dutch oven.  Cook, stirring once or twice, until chicken is opaque, about 8 minutes.', 85, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(490, 3, 'Add chicken broth, tomatoes, oregano and reserved chiles. Increased heat to high until boiling. Reduce heat and simmer for 50 minutes, covered.  Stir in half and half and corn meal; cook 10 minutes.  ', 85, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(491, 4, 'Garnish at the table with chopped chiles, crumbled Mexican cheese, chopped sweet onion, minced cilantro, & salsa.', 85, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(492, 1, 'Combine flour and next 7 ingredients (through salt) in a large bowl.  Stir with a whisk.  Stir in oats, dates, raisins, cranberries. Make a well in center of mix.', 86, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(493, 2, 'Combine buttermilk, oil, vanilla, and egg.  Add to flour mixture, stirring just until moist.  Strin in boiling water.  Let batter stand for 15 minutes.', 86, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(494, 3, 'Preheat oven to 375 degrees.', 86, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(495, 4, 'Spoon batter into 12 muffin cups coated with cooking spray.  Bake at 375 degrees for 20 minutes or until muffins spring back when touched lightly in center.  Remove muffins from pan immediately; place on a wire rack to cool.', 86, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(496, 1, 'Preheat oven to 350 degrees.', 87, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(497, 2, 'Combine flour, cocoa, baking powder, baking soda, and salt, stirring with a whisk.  Place sugar and butter in a large bowl; beat with a mixer at high speed until well blended.  Add vanilla and egg; beat well.  With mixer on low speed, gradually add flour mixture.  Beat just until combined.  Fold in cherries and chocolate chips.', 87, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(498, 3, 'Drop by tablespoonfuls 2 inches apart onto baking sheets coated with cooking spray. Bake at 350 degrees for 12 mintues or just until set. Remove from oven; cool on pan 5 minutes. Remove from pans; cool completely on wire racks.', 87, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(499, 1, 'Mix above ingredients together and refrigerate at least 2 hours before serving.', 88, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(500, 1, 'Mix together all ingredients except bread.', 89, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(501, 2, 'Crumble bread and add.', 89, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(502, 3, 'Pour in casserole dish.', 89, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(503, 4, 'Bake @ 400 deg. until brown on top.', 89, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(504, 1, 'Preheat oven to 350 degrees.  Line cookie sheet with parchment paper.', 90, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(505, 2, 'Whisk together wheat flour and next 6 ingredient through cardamom in a medium bowl. *Dry ingredients. ', 90, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(506, 3, 'Blend brown sugar and next 3 ingredients through eggs until smooth as possible. *Wet ingredients.', 90, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(507, 4, 'Stir dry ingredients into wet ingredients until fully incorporated.  The batter will be thick and sticky.', 90, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(508, 5, 'Stir in the oats and apricots.', 90, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(509, 6, 'Form dough into 2 inch balls and flatten on parchment paper. This is easiest to do with wet hands.', 90, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(510, 7, 'Bake for about 12 to 15 minutes or until the tops are golden. Do not wait for the cookies to get a dark brown or they will be more crunchy than chewy.', 90, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(511, 1, 'Preheat waffle iron to medium temperature.', 91, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(512, 2, 'Mix together dry ingredients in one bowl and wet ingredients in another bowl.  Stir wet ingredients into dry ingredients and mix well. Pour batter onto waffle maker and cook until done.', 91, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(513, 1, 'Heat oven to 350ºF.', 92, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(514, 2, 'Grease a standard 12–hole muffin pan with no–stick spray, butter. or canola oil spray.', 92, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(515, 3, 'Combine flour, wheat germ, flax seed, brewer''s yeast, baking powder, and salt in a large mixing bowl and set aside.', 92, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(516, 4, 'In a second bowl, mix yogurt and baking soda. Set aside.', 92, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(517, 5, 'In a third bowl, beat butter with sugar until creamy with stand mixer. Add eggs one at a time, then extract.  Stir in yogurt mixture.', 92, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(518, 6, 'Stir wet mixture into dry just enough to moisten the dry ingredients. Fold in cranberries and zest. Don''t over mix.', 92, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(519, 7, 'Pour into greased muffin tin and bake 30 to 35 minutes.', 92, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(520, 8, 'Note:  There are many possible variations to this recipe.  Here are some of the combination I have made:  Banana Pecan, Chocolate Chip Orange, Chocolate Chip Cherry, Blueberry, & Lemon Poppyseed.', 92, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(521, 1, 'Combine all ingredients and chill.  Stir before serving.', 93, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(522, 1, 'In food processor, combine garbanzo beans, spinach, scallions, garlic and flour.  Pulse on/off several times to blend well.  Add slat and pepper to taste and process briefly.  Shape mixture into 4 patties about 1/2 inch thick.', 94, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(523, 2, 'In small bowl, mix tahini, lemon juice, 2 tablespoons water, cumin and salt to taste.  Set aside.', 94, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(524, 3, 'In large nonstick skillet, heat 2 teaspoons oil over medium-high heat.  Add burgers and cook until browned, about 4 minutes per side.', 94, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(525, 4, 'Cut pita breads in half.  Cut burgers in half and place in pita breads.  Spoon pepperoncini tomatoes and cucumbers over burgers and drizzle with reserved tahini sauce.  ', 94, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(526, 1, 'Heat the oil in an 8-inch nonstick skillet over medium heat.  Add the potatoes and cook, stirring occasionally, until they begin to soften, about 3 minutes.  Cover and cook, stirring often, until the potatoes are tender and most of them are browned, about 20 minutes.  Meanwhile, position an oven rack 6 inches from the source of heat and preheat the broiler.', 95, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(527, 2, 'Mix the green onions, garlic, rosemary, 1/4 teaspoon of the salt and 1/4 teaspoon of the pepper into the potatoes, then spread the potatoes evenly in the skillet.  Reduce the heat under the skillet to medium-low.', 95, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(528, 3, 'Whisk the eggs with the remaining 1/2 teaspoon salt and 1/4 teaspoon pepper in a medium bowl until combined.  Pour the eggs into the skillet and cook until the edges begin to set. Using a rubber spatula, lift up an edge of the frittata and tilt the skillet so the uncooked eggs run under the frittata.', 95, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(529, 4, 'Continue cooking, occasionally lifting the frittata and tilting the skillet as described, until the top is almost set, 4 to 5 minutes.  Transfer the skillet to the oven and broil the frittata until the tops is puffed and lightly browned, about 1 minutes.  Place a serving plate over the skillet and invert the frittata onto the plate. Cut into wedges and serve hot, or let cool to room temperature before serving.  ', 95, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(530, 5, 'Note:  Serve as a stand alone breakfast with fresh fruit or with pork or vegetarian breakfast sausage.', 95, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(531, 1, 'Whisk chopped tarragon, lemon juice, oil, shallot, 1/4 teaspoon salt, sugar and 1/8 teaspoon black pepper in a medium bowl until combined.  Reserve 2 tablespoons of the dressing; add beans and pepper to the rest and toss to combine.', 96, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(532, 2, 'Preheat grill to medium-high.  Coat a large fish-grilling basket with cooking spray. Remove the heads from the trout, then stuff each trout with 5 lemon slices and a large tarragon sprig. Sprinkle inside and out with the remaining 3/4 teaspoon salt and 1/8 teaspoon pepper. Place in the basket.', 96, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(533, 3, 'Grill the fish until the skin is golden and crispy, 4 to 5 minutes per side.  Carefully remove the lemon and tarragon, drizzle the fish with the reserved dressing and serve with the bean salad.', 96, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(534, 1, 'Grind rolled oats in food processor until it resembles cornmeal.  Place in a large bowl.  Process apples & carrots in food processor until finely chopped, set aside.', 97, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(535, 2, 'Preheat oven to 400 degrees and grease muffin tins with Canola oil or cooking spray.', 97, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(536, 3, 'Add the rest of the dry ingredients to processed oats and make a well in center. Combine wet ingredients in another bowl.', 97, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(537, 4, 'Add wet ingredients along with the apples and carrots to dry ingredients and mix well.  Fold in raisins and chocolate.', 97, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(538, 5, 'Fill muffin cups 2/3 full and place on oven rack in middle of oven. ', 97, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(539, 6, 'Bake for 16-22 minutes or until muffins spring back when touched lightly in center.  Transfer to wire rack to cool.', 97, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(540, 1, 'In a medium bowl, blend together bran cereal, puffed brown rice, rnoatmeal and powdered milk. In a smaller bowl, blend peanut rnbutter, vanilla, egg and honey together, mixing wellrn', 98, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(541, 2, 'Make a well in the dry ingredients and add wet ingredients, mixing well. rn', 98, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(542, 3, 'Drop big spoonfuls of dough on to a cookie sheet lined with parchment paper and bake 10 to 12 minutes, or until edges begin to brown.rnrn', 98, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(543, 1, 'Heat 2 teaspoons of the olive oil in a nonstick skillet. Add the red onion, 1/4 teaspoon salt, and a few pinches freshly ground pepper.  Saute over medium heat for 4 to 5 minutes, until tender. Add half of the garlic and saute for i minute. Transfer to a bowl.', 99, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(544, 2, 'Heat the remaining teaspoon of olive oil in the pan. Wilt the spinach over high heat with 1/4 teaspoon salt, a few pinches of freshly ground pepper, and the remaining garlic. When the spinach is wilted but still bright green (about 1 minute), remove it from the pan and place it in a strainer to cool. Squeeze out the excess moisture with your hands, then coarsely chop and toss with the lemon zest.', 99, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(545, 3, 'Preheat oven to 500°', 99, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(546, 4, 'Roll out the fresh wheat dough and place it on a lightly oiled pizza pan or place Bomboli on pizza pan.  Spread the onion on the dough, followed by the spinach. Sprinkle the olives over the spinach, follow with the crumbled feta, then add the mozzarella cheese.', 99, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(547, 5, 'Bake the pizza, in the pan or on a preheated pizza stone, for 8 to 12 minutes, until the crust is golden and crisp. ', 99, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(548, 6, 'Remove it from the oven and sprinkle with the Parmesan cheese and fresh rosemary.rnrn', 99, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(549, 1, 'Puree watermelon in a food processor or blender.', 100, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(550, 2, 'In a medium saucepan over medium-high heat, combine sugar and water; bring to a boil. Boil 30 to 45 seconds until syrup is clear and sugar dissolves. Remove from heat and let stand approximately 10 minutes. If making ahead, store in refrigerator.', 100, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(551, 3, 'To the pureed watermelon pulp, add sugar syrup, lemon juice, and Anisette Liqueur; stir until thoroughly blended.', 100, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(552, 4, 'Freezer Method - Pour into container, cover, and place mixture in the freezer. When it is semi-solid, mash it up with a fork and refreeze again. When frozen, place in a food processor or blender and process until smooth. Cover and refreeze until serving time.rn', 100, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(553, 5, 'NOTES: The Anisette (or any other type of alcohol) is the secret to a soft sorbet. Alcohol itself does not freeze and adding a little bit keeps the sorbet from doing the same.  This recipe can be prepared up to 3 days in advance. Cover and keep frozen.', 100, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(554, 1, 'Combine first 6 ingredients in a large bowl; stir well.', 101, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(555, 2, 'Combine milk, oil, and egg; stir well. Add to flour mixture, stirring until smooth', 101, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(556, 3, 'Spoon about 1/3 cup batter for each pancake onto a hot nonstick griddle or nonstick skillet.rn', 101, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(557, 4, 'Turn pancakes when the tops are covered with bubbles andrnthe edges look cooked. rn', 101, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(558, 1, 'Put brown rice and water together in a pot with a lid.  Use the ratio of 1.5 cups water to 1 cup rice.', 102, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(559, 2, 'Set the heat to maximum, and bring the rice/water to a boil uncovered.  Then put the lid on the pot, and reduce the heat to low/simmer.  If your lid has a steam valve, keep it closed.  Let the rice simmer for 20 minutes.rn   ', 102, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(560, 3, 'Turn off the heat, and let the rice sit in the covered pot for another 10 minutes.  It’s OK if you let the rice sit longer than 10 minutes (20 or 30 minutes is fine too), but don’t let it go any less.  I prefer my rice to be slightly chewy, not mushy, so I usually remove the lid after 10 minutes.rn', 102, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3);
INSERT INTO `steps_bak` (`id`, `order_num`, `instruction`, `recipe_id`, `created_at`, `updated_at`, `order_num_test`) VALUES
(561, 1, 'Bring a large pot of lightly salted water to a boil. Pour in pasta and cook for 8 to 10 minutes or until al dente; drain.rn', 103, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(562, 2, 'Meanwhile, heat olive oil in a large skillet over medium-high heat. Saute onion and garlic until golden brown. Mix in tomatoes, mushrooms, spinach, salt, pepper, and red pepper flakes, and saute 2 minutes more, until tomatoes are heated through and spinach is wilted. Mix pasta and cheese into vegetables and cook 1 minute over medium heat. Serve immediately.', 103, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(563, 1, 'Before you begin make sure you have everything measured and beside the stove.  Heat sugar on high in a heavy 2 or 3 quart saucepan.  As the sugar begins to melt stir constantly with a wire whisk. Making caramel is a fast process that cannot wait for hunting around for ingredients. If you don''t work fast, the sugar will burn.', 104, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(564, 2, 'As soon as all of the sugar crystals have melted (the liquid sugar should be dark amber in color), immediately add the butter to the pan. Continue to whisk vigorously until the butter has melted.', 104, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(565, 3, 'Once the butter has melted, take the pan off the heat. Add the cream to the pan and continue to whisk to incorporate. Note than when you add the butter and the cream, the mixture will foam up considerably. This is why you must use a pan that is at least 2-quarts (preferably 3-quarts) big.', 104, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(566, 4, 'Whisk until caramel sauce is smooth. Let cool in the pan for a couple minutes, then pour into a glass mason jar and let sit to cool to room temperature. Store in the refrigerator for up to 2 weeks. Warm before serving or stir directly into latte.', 104, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(567, 1, 'Combine ingredients in blender and puree until smooth.', 105, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(568, 2, 'Pour the smoothies into glasses and garnish each with a dollop of whipped topping. For a fun touch add a pinch of cinnamon.rnrn', 105, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(569, 1, 'Preheat oven to 375 degrees. Whisk flour, baking soda, and salt in a bowl.', 106, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(570, 2, 'In a large bowl, beat the butter at medium speed 30 seconds.  Add peanut butter and both sugars; beat 2 minutes, until fluffy.  Add egg and vanilla; beat well.  Slowly add the flour mixture; beat to combine.', 106, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(571, 3, 'Roll dough into 1-inch balls; place 2 inches apart on baking sheets.  Bake 8 to 10 minutes, just until edges start to brown.', 106, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(572, 4, 'Remove cookies from oven and press a chocolate kiss into each.  Cool on wire racks 15 minutes.', 106, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(573, 1, 'Preheat oven to 400 degrees.  Lightly spoon flour into dry measuring cups; level with a knife.  Combine flour, baking powder, baking soda and salt in a medium bowl; stir well with a whisk.  Stir in chopped pecans or walnuts.  Make a well in center of mixture.', 107, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(574, 2, 'Combine brown sugar, cinnamon, ginger, oil, vanilla extract, yogurt and egg in a small bowl; add to the flour mixture, stirring just until moist.', 107, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(575, 3, 'Fold in diced pear.  Spoon batter into greased muffin pan; sprinkle batter with turbinado sugar.  Bake at 400 degrees for 20 minutes. Muffins will spring back to the touch when done.  Remove from pan and cool on wire racks immeiately.', 107, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(576, 1, 'Combine lemon grass, soy sauce, chiles, pepepr flakes, turmeric, sugar and salt in a bowl.  Add the tofu cubes ad turn to coat evenly. Marinate at least 30 minutes.', 108, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(577, 2, 'Meanwhile, heat half of the oil in a 12-inch nonstick skillet over moderately high heat.  Add onion, shallots, and garlic; stir until fragrant, 1 minute.  Reduce the heat to low and cook until the onions are soft, 3 minutes.  Transfer to a plate to keep warm.', 108, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(578, 3, 'Heat remaining oil over moderate heat.  Add the tofu mixture and, using a flat spatula turn the tofu so it cooks evenly 4 or 5 minutes. ', 108, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(579, 4, 'Add the onion mixture and cook, uncovered, for another 2 or 3 minutes.  Add half the peanuts and all the basil leaves.  Remove from the heat; transfer to a serving plate.  Garnish with the remaining peanuts; serve with steamed rice.', 108, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(580, 1, 'In large bowl, combine bulgur and 1 cup boiling water.  Cover and let stand 30 minutes.', 109, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(581, 2, 'Fluff bulgur with fork.  Add 1/2 teaspoon salt and remaining ingredients; stir well. Serve chilled or at room temperature.  ', 109, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(582, 1, 'Combine all ingredients in a blender.  Mix until smooth.', 110, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(583, 1, 'Combine all ingredients in a blender; process until smooth.', 111, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(584, 1, 'Preheat oven to 375 degrees.  Combine first four ingredients.  Using a pastry blender or two knives, cut butter into dry ingredients, until mixture resembles cornmeal.', 112, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(585, 2, 'Beat cream, egg and vanilla in separate bowl.  Make a well in the flour mixture.  Add cream mixture and combine with a few swift strokes.  Knead chocolate, walnuts and cherries gently and quickly into the dough.', 112, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(586, 3, 'Turn the dough onto a floured board.  With lightly floured hands, softly pat dough to a thickness of a little more than 1/2 inch.  Using a 2-inch cookie cutter cut the dough into desired shapes.', 112, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(587, 4, 'Gather leftover dough and repeat until all the dough has been shaped into scones.  Place the scones onto an ungreased baking sheet.', 112, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(588, 5, 'Combine egg white and water and brush onto tops and sides of scones.  Bake about 15 minutes, or until lightly browned.  Make 18 2-inch scones.', 112, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(589, 1, 'In a mixing glass, muddle mint and sugar with bourbon and Pama.  Shake ingredients vigorously over ice and strain into a julep cup over crushed ice.  Garnish with mint and serve.', 113, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(590, 1, 'Bring large pot of lightly salted water to a boil.', 114, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(591, 2, 'Meanwhile, make pesto:  In small dry skillet, toast almonds over medium-low heat, stirring constantly, until light golden and fragrant, 3 to 4 minutes.  Transfer to a small bowl and let cool.', 114, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(592, 3, 'In food processor, combine almonds, cilantro, jalapeno, garlic, salt and pepper; process until finely chopped.  With motor running add 2 Tbs. oil and lime juice through the feed tube, process until mixture forms paste and stopping to scrape down sides of work bowl as necessary.  Transfer mixture to small bowl.', 114, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(593, 4, 'Add pasta to boiling water; stir to prevent sticking.  Cook, stirring often, until just tender, 8 to 12 minutes.  While pasta is cooking, in large non-stick skillet, heat 2 tsp. oil over medium-high heat.  Add onion and bell pepper; cook, stirring often, until tender 5 to 6 minutes.  Add green chilies and cook, stirring, 1 minute.  ', 114, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(594, 5, 'Just before pasta is cooked, scoop out 1/2 cup of pasta cooking water and add to pesto, stirring well.  Drain pasta and transfer to large, warm bowl.  Add onion mixture and cheese; toss to coat well.  Serve immediately.', 114, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(595, 1, 'In a large soup pot over high heat, bring water, chicken broth, lentils, onion, celery, carrots, parsley and salt to a boil.  Reduce heat to medium-low and simmer, covered 45 minutes, stirring occasionally.', 115, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(596, 2, 'Add zucchini and sausage and simmer, covered until vegetables are tender and flavors are blended, about 15 to 20 minutes longer.  Ladle into bowls and serve with a lemon wedge.  Add a squeeze of lemon on top if desired.  ', 115, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(597, 1, 'Preheat oven to 325 degrees.  Line a 9-inch by 13-inch pan with foil.  Combine all ingredients in large bowl.  Stir well, using hands if necessary, and be sure all ingredients are evenly moist.  Press mixture firmly into the prepared pan using the back of a spatula.', 116, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(598, 2, 'Bake at 10 to 22 minutes or until nicely browned.  Place on rack to cool.  While pan i slightly warm, carefully cut into small bars.', 116, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(599, 1, 'Combine the coconut milk, fish sauce, lime juice, garlic, shallots, pepper sauce, red pepper flakes, sugar, cilantro and salt and pepper to taste in a bender and blend until smooth.  Put the chicken in a large nonreactive bowl or baking dish.  Pour the mixture over the chicken and marinate for 4 hours in the refrigerator, turning the chicken occasionally.', 117, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(600, 2, 'Prepare a medium-hot fire.  Put the chicken bone side down on the grill.  Cover and cook for about 15 minutes.  Turn and cook, skin side down, covered, until the juices run clear, 12 to 15 minutes.', 117, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(601, 3, 'Transfer the chicken to a platter, garnish with the green onions, and serve at once.  ', 117, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(602, 4, 'Note:  Chicken can also be cooked in a 350 degree oven for 30 to 40 minutes, or until juices run clear.  ', 117, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(603, 1, 'Preheat oven to 400 degrees.  In a large bowl combine flour, oatmeal, sugar, baking powder and salt.', 118, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(604, 2, 'Using a pastry cutter, cut in butter leaving large pea-sized pieces.  Add seeds and fruit and toss to mix thoroughly.  ', 118, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(605, 3, 'Add 1/3 cup milk and stir until combined.  Do not over mix; you do not want to cream the butter. ', 118, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(606, 4, 'Form large disc of dough on a floured cutting board.  Do not overwork the dough.', 118, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(607, 5, 'Cut into 8 wedges and put them on a baking sheet that''s lightly greased or lined with parchment paper.  Space the wedges out so the brown on all sides.  Beat egg yolk with 2 tablespoons milk and brush over scones.  Bake for 25 minutes.', 118, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(608, 6, 'Note: You can use any variation of dried fruit and nuts, fresh orange o lemon zest, fresh grated ginger, ect.', 118, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(609, 1, 'Season the pork with salt and pepper.', 119, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(610, 2, 'Heat a 2-quart sauce pot over high heat.  Add the oil and the pork tenderloin.  Cook on high until the pork is brown all over, but still raw in the center.', 119, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(611, 3, 'Place the pan back on the burner over medium heat.  Add onion, celery, carrots, and garlic, cook for 5 minutes.  Add the enchilada sauce and stock, bring to a simmer.  Add the beans and liquid, cook for 10 minutes.', 119, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(612, 4, 'Add the pork back to the pan and simmer until the pork is cooked medium.  ', 119, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(613, 5, 'Serve with avocado slices, Mexican cheese, ad white or blue tortilla chips and salsa.', 119, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(614, 1, 'Bring the broth to a boil in a 2-quart saucepan over high heat.  Add the rice and salt, stir, lower heat, cover and cook for 45 minutes, or until the rice is tender. Remove from the heat and toss with the sesame oil.  In a large bowl, combine the carrot, green onions, curry, cumin, garlic, pine nuts, lime juice, vinegar, soy, parsley, chutney and raisins.  Mix well. Add the warm rice to the bowl and toss to mix.', 120, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(615, 2, 'Taste and adjust seasonings.  Serve lukewarm or refrigerate until 30 minutes before serving.  ', 120, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(616, 3, 'Note:  To toast nuts, heat in a dry skillet over medium heat until they start to brown.  Stir occasionally.  Be careful not to scorch them.', 120, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(617, 1, 'Combine the lettuce, roasted peppers, tomatoes, cucumber, olives, onion and mint in a large bowl.  ', 121, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(618, 2, 'Just before serving, season with salt and pepper, then toss with the olive oil and vinegar.  Toss in the feta cheese and lightly toss again, trying not to break up the cheese too much.', 121, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(619, 1, 'Prepare couscous as package directs.', 122, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(620, 2, 'In a large bow, combine the couscous, chickpeas, chicken, spinach, dressing, and half the cucumbers, roasted peppers, feta, dill and scallions.', 122, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(621, 3, 'Spoon mixture on serving plates and serve.', 122, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(622, 1, 'In a food processor add first 7 ingredients, through tahini paste, ad process until smooth.  Divide into three portions. ', 123, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(623, 2, 'Add 1/3 cup roasted red pepper to processor and chop; return one portion of reserved hummus o processor and process with the red peppers until smooth.  Clean the processor.', 123, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(624, 3, 'Add 1/3 cup fresh cilantro leaves to processor and chop; return one portion of reserved hummus to processor and process with the cilantro until smooth.  ', 123, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(625, 4, 'Serve all three flavors of hummus with your favorite pita chips.', 123, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(626, 1, 'Heat oven to 350 degrees.  heat the chocolate chips and milk in a medium heavy saucepan over low heat.  Cook, stirring, until the chocolate is melted and mixture is smooth, about 3 minutes; set aside.  ', 124, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(627, 2, 'Mix the flour, 1/2 cup of the oats, baking powder, baking soda and salt in a large bowl; set aside.  Combine the brown sugar, oil, egg and vanilla in a medium bowl with a fork until smooth; stir into the flour mixture until blended. Reserve 1/2 cup of the dough in a small bowl for topping. ', 124, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(628, 3, 'Pat the remaining dough into a greased 8-inch square baking dish; spread the chocolate mixture over the dough.  Add the remaining 2 tablespoons of the oats and the butter to the reserved dough; mix with pastry blender or fork until crumbly.  Drop small spoonfuls of oat mixture evenly over chocolate mixture.  Bake until top is golden and firm, 20-25 minutes.   Cool completly about 1/2 hour.  Cut into 16 squares.', 124, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(629, 1, 'Preheat oven to 350 degrees and grease a 9x13 pan.', 125, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(630, 2, 'Beat together eggs and oil, stir together dry ingredients except fruit. Add flour to eggs, stir to combine, then stir in fruit, nuts, and chips. ', 125, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(631, 3, 'Spread evenly in pan, bake 30 minutes.  Bars will still be soft when done. Cool, cut into 24 pieces, wrap in GLAD press and seal and freeze. Enjoy!!', 125, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(632, 1, 'Preheat oven to 350 degrees. Whisk together the first nine ingredients (through the chocolate chips) in a large bowl. In a small bowl, whisk the egg, vanilla, applesauce and peanut butter together. Pour the wet ingredients into the dry and mix well.  Mixture will appear very dry, but continue to mix until all ingredients are incorporated.', 126, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(633, 2, 'Line large cookie sheets with parchment paper.  Roll dough into 16 to 20 balls, pressing down to flatten in the shape of a cookie.  Place dough on prepared cookie sheets one inch apart. Bake 10 minutes. Remove from oven and let cool 10 minutes on wire rack.', 126, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(634, 1, 'Combine all ingredients in a large bowl. Mix until well incorporated.', 127, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(635, 2, 'Spoon the mixture into a pan and flatten with the back of a spoon. Place in the freezer for an hour or so, then take it out to cut into bite-size squares. Transfer the pieces onto a plate. Keep these covered and stored in the freezer.rn', 127, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(636, 3, 'Note:  These must be kept in the freezer, otherwise they will become soft and mushy, to the consistency they were at before freezing. When you take them out to eat, eat them quickly. Also work quickly when cutting the fudge.', 127, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(637, 1, 'Preheat oven to 375 degrees. Beat sugar, canola oil, peanut butter, water, vanilla and egg together with an electric mixer until well-combined. Stir in flour, baking soda, salt, oats and chocolate chips. Very gently, fold in the Cheerios. Drop the dough by rounded 1/4 cupfuls onto a cookie sheet lined with parchment paper. Flatten the dough gently with your fingertips.', 128, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(638, 2, 'Bake cookies in the preheated oven 13 to 15 minutes until lightly browned around the edges. Cool completely before serving. Store in an airtight container or freeze in a sealed Ziploc bag for up to two months.', 128, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(639, 1, 'Place all ingredients in blender and process until smooth.', 129, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(640, 1, 'Place all ingredients in a blender and process until smooth.', 130, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(641, 1, 'To make the sauce, heat 1 tablespoon olive oil over medium heat. Saute onion and garlic in oil 6 minutes, or until soft.  Add quartered dried chilies and saute 3 minutes more.  Stir in tomatoes and 2 cups of water.  Season with salt and pepper, and simmer 15 minutes, or until chiles are soft.  Remove from heat and cool 5 minutes, then puree in food processor until smooth.', 131, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(642, 2, 'To make enchiladas, preheat broiler. Place poblano chiles on baking sheet and broil 15 minutes, or until blackened on all sides, turning often.  Cool in covered bowl, then peel off skins and remove seeds.  Chop chiles into 1/4 inch pieces.', 131, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(643, 3, 'Preheat oven to 375.  Heat 1 tablespoon olive oil in skillet over medium heat. Saute onion and garlic in oil 5 mintues, or until soft.  Transfer to mixing bowl, and add queso fresco, 1/4 cup Monterey Jack cheese, cilantro, and chopped chiles.  ', 131, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(644, 4, 'Soften tortillas in microwave between damp paper towel until pliable.  Spread 1 cup sauce mixture on bottom of 13 X 9 inch baking sheet.  Divide cheese mixture among tortillas, and roll loosely.   Place filled, rolled tortillas in baking dish. Top with remaining Monterey Jack cheese.  Bake 20 minutes, or until sauce is bubbly and cheese is melted.  Sprinkle with cilantro before serving.  ', 131, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(645, 1, 'Preheat oven to 350 degrees.', 132, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(646, 2, 'Cream together butter and sugars.  Beat in vanilla and eggs.  Mix well.  Stir together the flour, baking soda and salt and add to creamed mixture.  Mix thoroughly.  Stir in chocolate chips and walnuts, if using.', 132, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(647, 3, 'Line a baking sheet with parchment paper, or use it ungreased  Scoop spoonfuls of dough with a small ice cream scoop or large spoon onto baking sheet.  Bake 8 to 10 minutes.  Cookies will not look totally baked.  Let cool 5 minutes on baking sheet.  Remove cookies to rack.  These will be gooey until completely cooled.  Repeat with remaining dough.', 132, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(648, 4, 'Modifications:  This makes a great chocolate chip cookie cake.  A 16" cookie cake pan should be lined with parchment paper on bottom and the sides greased.  Spread enough cookie batter to fill 1/2 the depth of the pan.  Bake 375 degrees for about 25 minutes. Edges should begin to brown slightly and middles should be slightly soft.', 132, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(649, 1, 'Combine 2 teaspoons sherry, 4 teaspoons soy sauce, and 4 teaspoons cornstarch to form a marinade and toss with the chicken.  Allow to stand for 15 minutes.  Combine salt, sugar, remaining cornstarch, remaining soy sauce, remaining sherry, vinegar, and water to form the basis of the sauce and set aside.  ', 133, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(650, 2, 'Heat the wok over high heat.  Add canola oil, rotating the container around the wok to coat the surface evenly.  Add the chile stir-fry briefly (a few seconds).  Add the chicken to the mix before the chili turns brown.  Stir-fry until the chicken is nearly cooked.  Add ginger and garlic, stir-fry for about 15 seconds. Push chicken mixture to the center and pour the sauce ingredients around the perimeter of the chicken.  Allow the sauce to come to a boil. Stir-fry sauce and chicken together to mix.  Remove from heat.  Add sesame oil, scallions, and peanuts.  Stir to mix and serve.', 133, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(651, 1, 'Preheat oven to 425 degrees', 134, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(652, 2, 'Snap off touch ends of asparagus.  Place in a jelly-roll pan.  Drizzle with olive oil and vinegar; sprinkle with salt, garlic, and pepper, tossing coat.  Bake at 425 degrees for 10 minutes, turning once.  ', 134, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(653, 1, 'Preheat oven to 350 degrees.', 135, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(654, 2, 'For filling, heat the canola oil over medium-high heat in large saute pan.  Add the onions and cook until they are translucent, 2 to 3 minutes.  Blend in garlic, paprika, cumin, black pepper and salt.  Add the chicken and heat through.  Remove the pan from the heat and stir in cilantro.', 135, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(655, 3, 'For casserole: In a small bowl, combine the cheeses.  On the bottom of an 8 or 9 inch square pan at least 2 inches deep, spread 1 cup of the green enchilada sauce.  Top with 4 tortillas, overlapping as needed.  Spread half the sour cream over the tortillas.  Add 1/2 cup of the remaining enchilada sauce, 1 1/2 cup of the chicken filling, 1 cup of the cheese mixture and half of the green chilies.  Top with 4 more tortillas, remainder of the sour cream, enchilada sauce ad chicken filling, 1 cup of the cheese mixture and the remaining chiles.  End with 1 cup of the cheese mixture on top. Bake about 25 minutes or until hot and bubbly on top.rn', 135, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(656, 1, 'Cook linguine according to package directions. Meanwhile, in a skillet over low heat, melt butter. Stir in flour, salt and pepper until smooth.  Gradually stir in milk.  Bring to a boil; boil and stir for 2 minutes or until thickened.  Remove from the heat.  ', 136, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(657, 2, 'Combine the cheeses; toss with lemon juice.  Add to the sauce; stir until cheese begins to melt.  Drain linguine; add the cheese sauce and toss to coat.', 136, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(658, 1, 'Lightly oil a skillet or griddle and preheat it to medium heat.', 137, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(659, 2, 'Grind the oats in a food processor until fine, like flour.', 137, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(660, 3, 'Combine oat flour, whole wheat flour, baking soda, baking powder and salt in a medium bowl.', 137, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(661, 4, 'In another bowl combine buttermilk, oil, egg and granulated sugar with and electric mixer until smooth.  Combine dry ingredients with wet ingredients, add nuts and mix well with mixer.  Allow the batter to rest for 4 or 5 minutes.', 137, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(662, 5, 'Ladle 1/3 cup of the batter onto the hot skillet and cook the pancakes for 2 to 4 minutes per side or until brown.', 137, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(663, 1, 'In a shallow pan, mix together flour, 1/4 teaspoon of the salt and 1/8 teaspoon of the pepper.  Pat beef dry with paper towels.  Toss in flour mixture to coat thoroughly, shake in strainer to remove excess flour.', 138, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(664, 2, 'Heat nonreactive Dutch oven over medium-high heat until hot.  Add 1 tablespoon of the oil.  Cook beef in batches 4 to 6 minutes or until browned, adding additional oil as needed.  Place beef in bowl.', 138, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(665, 3, 'Increase heat to high.  Add wine; bring to a boil.  Boil until reduced by half, stirring to scrape up browned bits from bottom of Dutch oven.', 138, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(666, 4, 'Stir in tomatoes, celery, garlic, parsley, basil, oregano, thyme, remaining 1/2 teaspoon salt and 1/4 teaspoon pepper, and 1 tablespoon of the rosemary.  Stir in mushrooms, fennel and beef.  Add enough broth to cover mixture. ', 138, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(667, 5, 'Cover; simmer 45 minutes.  Add onions, continue simmering 30 to 45 minutes or until beef is teder. ', 138, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(668, 6, 'Stir in remaining 1/2 tablespoon chopped rosemary; simmer an additional 10 minutes.', 138, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(669, 1, 'Toast 1/4 pine nuts in a skillet over medium heat for 2 to 4 minutes or until slightly browned. Set aside.', 139, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(670, 2, 'In a large pot, boil salted water and add pasta; cook according to package directions.', 139, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(671, 3, 'Meanwhile, place the basil olive oil, 2 tablespoons pine nuts, garlic and salt in a food processor fitted with a steel blade and mix with short pulsed until basil is finely chopped.  Place basil mixture bowl and mix in by hand the butter and 1/2 cup freshly grated cheese.', 139, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(672, 4, 'When pasta is al dente, drain and place back in the pot.  Add the pesto, sliced chicken breasts and toasted pine nuts.  Toss well, transfer to a serving dish and garnish with freshly grated parmesan.', 139, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(673, 1, 'Boil 1 quart of water and pour over tea bags.  Let steep for about 5 minutes.  Pour into a picture, add the sugar, and stir until dissolved.  Add 1 quart of water and ice cubes.', 140, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(674, 2, 'NOTE: I like to use high quality fruit flavored teas.  These are very refreshing on a hot summer day.', 140, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(675, 1, 'Heat oven to 350 degrees.  Beat together butter and sugars.  Add pumpkin, eggs, and vanilla; beat.', 141, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(676, 2, 'Mix in combined flours, baking soda, and spices, then stir in oats.  Drop by rounded tablespoonfuls onto greased cookie sheets.  Bake 10 to 12 minutes.  Let cool.', 141, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(677, 1, 'Preheat oven to 450 degrees.  Place eggplant on a medium baking sheet.  Bake 20 to 30 minutes in the preheated oven, until tender.  Remove from heat, cool, peel, and chop.', 142, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(678, 2, 'Heat oil in a medium skillet over medium heat. Mix in cumin seeds and onion.  Cook and stir until onion is tender.', 142, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(679, 3, 'Mix ginger, garlic, curry powder, and tomato into the saucepan, and cook about 1 minute.  Stir in yogurt.  Mix in eggplant and jalapeno pepper, and season with salt.  Cover, and cook 10 minutes over high heat.  Remove cover, reduce heat to low, and continue cooking about 5 minutes.  Garnish with cilantro and serve over rice or with naan bread.  ', 142, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(680, 1, 'Preheat oven to 375 degrees and spray muffin tin with canola oil.', 143, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(681, 2, 'In a small mixing bowl sift together flour and baking soda.  In another bowl, cream the sugar and butter and then add yogurt, eggs, cinnamon, and lemon zest. Beat until thoroughly combined.', 143, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(682, 3, 'Add the dry ingredients to the wet ingredients and mix just until blended, careful not to over mix.  Gently fold in blueberries and spoon the batter into the muffin tins, filling each cup two thirds full. ', 143, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(683, 4, 'Bake for 15 minutes or until the tops are golden brown and a toothpick inserted in center comes out clean.  Cool for 5 minutes before serving.  Makes 12 muffins.', 143, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(684, 1, 'Preheat oven to 350 degrees. Grease a baking pan with the butter. If you like thick power bars, opt for an 8 by 8-inch pan; for thinner bars, use a 9 by 13-inch pan', 144, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(685, 2, 'On a rimmed baking sheet toast the pecans, almonds, and coconut for about 7 minutes, or until the coconut is deeply golden. Toss once or twice along the way. Mix the oats, toasted nuts, coconut, and the cereal, together in a large bowl and set aside.', 144, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(686, 3, 'Combine the rice syrup, sugar, salt, espresso, and vanilla in a small saucepan over medium heat and stir constantly as it comes to a boil and thickens just a bit, about 4 minutes. Pour the syrup over the oat mixture and stir until it is evenly incorporated.', 144, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(687, 4, 'pread into the prepared pan and cool to room temperature before cutting into whatever size bars you desire.', 144, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(688, 1, 'Preheat oven to 375 degrees.  Sift dry ingredients into a large bowl; set aside.  ', 145, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(689, 2, 'In a medium bowl, beat eggs, add oil, milk yogurt and lemon zest.  Mix well.  Combine with dry ingredients.  Stir just until moistened.', 145, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(690, 3, 'Fold in cranberries.  Spoon into greased and floured muffin tins.  Top with chopped pecans.', 145, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(691, 4, 'Bake 20 minutes or until toothpick inserted in center comes out clean.  Cool several minutes on a wire rack; remove from pan and cool completely.', 145, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(692, 1, 'Heat oven to 350 degrees. Lightly oil an 8 x 8 baking pan or dish.', 146, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(693, 2, 'Prepare cake:  Melt chocolate into water in medium saucepan over medium-low heat.  Cool to lukewarm.  Add granulated sugar, oil, applesauce, egg, and vanilla extract and beat with whisk until smooth.  Measure buttermilk into a cup and stir in baking soda.  Set aside.', 146, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(694, 3, 'Whisk together all-purpose flour, cocoa, whole wheat flour, and a pinch of salt in a large bowl until thoroughly blended.  Add chocolate mixture and buttermilk.  Whisk again.', 146, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(695, 4, 'Pour batter into prepared pan and bake 35 minutes or until wooden pick inserted in center comes out clean.  Cool to room temperature.  ', 146, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(696, 5, 'Make frosting:  Dissolve coffee powder in hot water in medium bowl.  Add spread, confectioners'' sugar, cocoa, and vanilla extract and beat with electric mixer, scraping sides of bowl with spatula, until thoroughly blended.  Spread on cooled cake. ', 146, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(697, 1, 'Heat the oil in a large skillet over medium-low heat.  Add the onion and cook, stirring occasionally, for 7 minutes.  ', 147, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(698, 2, 'Sprinkle with the curry powder and cook, stirring, for 1 minute.  Add the yogurt and the cream and simmer gently for 3 minutes.  Stir in the salt and pepper.', 147, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(699, 3, 'Add the chicken and heat thoroughly. Serve over rice.', 147, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(700, 4, 'NOTE:  This dish is also good with steamed vegetables added or left over roast beef.', 147, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(701, 1, 'Preheat oven to 350 degrees.  Melt butter in a small saucepan over low heat.  Remove from heat and add brown sugar; stir until smooth.', 148, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(702, 2, 'Combine flours, baking soda, oats, and salt in a medium bowl.  Combine butter mixture with the dry ingredients; add egg, lightly beaten, and vanilla.', 148, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(703, 3, 'Fold in walnuts and chocolate.  Mix well, and spoon by tablespoonfuls onto lightly greased baking sheets.  Bake for 10-12 minutes or until tops are dry to the touch.', 148, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(704, 1, 'Heat oven to 350 degrees.  Grease 13 X 9 X 2 inch baking pan.', 149, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(705, 2, 'Stir together cocoa and baking soda in a large bowl; stir in 1/3 cup butter.  Add boiling water; stir until mixture thickens.  Stir in sugar, eggs and remaining 1/3 cup butter; stir  until smooth.  Add flour, vanilla and sat; blend completely.  Stir in chocolate chips.  Pour into prepared pan.', 149, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(706, 3, 'Bake 35 to 40 minutes or until brownies begin to pull away from sides of pan.  Cool completely in pan on wire rack.  Frost if desired.  Cut into squares.  ', 149, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(707, 1, 'Soak the chickpeas in water for 25 hrs.', 150, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 1),
(708, 2, 'Drain the chickpeas and put them into the container of a good processor or blender. Add the baking soda and salt. ', 150, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 2),
(709, 3, 'Turn the machine on and blend until you have the texture of coarse bread crumbs or fine bulgur wheat. You should NOT have a paste. ', 150, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 3),
(710, 4, 'Empty the chickpeas into a bowl. Add the onion, parsley, cumin, coriander, garlic, black pepper, lemon juice, and cayenne. ', 150, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 4),
(711, 5, 'Mix gently with a fork. Do not pat down. This mixture should be loose and crumbly. ', 150, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 5),
(712, 6, 'Put 2 inches of oil in a wok or other utensil for deep frying and set to a heat on a medium-low flame. You need a temperature of 350 to 375 degrees F.', 150, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 6),
(713, 7, 'While the oil heats, form the first batch of patties. Using a very light touch, form patties that are about 2 1/4 inches in diameter, about 3/4 inch thick in the center and less so at the edges. Do not pat down or try to be too neat. The patties should just about hold together.', 150, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 7),
(714, 8, 'Put as many patties into the hot oil as the utensil will hold in a single layer. Fry about 4 minutes or until the patties a reddish brown on both sides. Turn at least once during the frying process.', 150, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 8),
(715, 9, 'When the patties are done, remove them with a slotted spoon and drain on a paper towel. do all of the patties this way. ', 150, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 9),
(716, 10, 'Here''s some tips: ', 150, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 10),
(717, 11, '1.) Use the right oil: Olive oil is not good for frying, due to its low smoke point. Choose an oil with a higher smoke point, such as Canola, sunflower or avocado oil. ', 150, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 11),
(718, 12, '2.) Use fresh herbs & spices where possible. The fresher they are, the better they taste ', 150, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 12),
(719, 13, '3.) If you substitute dried chickpeas with canned, don''t add salt, since canned chickpeas contain salt anyway. ', 150, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 13),
(720, 14, '4.) Falafel is best served in a pita with salad. ', 150, '2010-02-06 03:26:36', '2010-02-06 03:26:36', 14),
(721, 0, 'Whisk together shallot and vinegar in a small bowl.  Whisk in oil until emulsified, then whisk in basil.  Add white pepper and salt, if desired.', 151, '2010-05-15 03:56:59', '2010-05-15 03:56:59', 1),
(722, 1, 'Toss together hominy, lima beans, tomatoes, and bell pepper in serving bowl.  Drizzle with dressing and toss again to coat.  Sprinkle with cheese, and serve topped with black pepper to taste.', 151, '2010-05-15 03:56:59', '2010-05-15 03:56:59', 2),
(723, 0, 'Bring broth, water, garlic and chicken to a boil in a large saucepan over medium-high heat.  Reduce heat to a simmer and cook, skimming any foam that rises to the top until the garlic is tender and the chicken is cooked through, 12 to 15 minutes.  Remove from the heat.  Transfer the garlic with a slotted spoon to a blender and the chicken to a clean cutting board.  ', 152, '2010-05-15 04:32:33', '2010-05-15 04:32:33', 1),
(724, 1, 'Meanwhile heat oil in a medium skillet over medium heat.  Add onion and poblano chile and cook, stirring, until beginning to brown, 8 to 10 minutes.  Add to the broth.  ', 152, '2010-05-15 04:32:33', '2010-05-15 04:32:33', 2),
(725, 2, 'Add 1/2 cup of the broth and chipotle pepper to the blender and process until smooth.  Pour the mixture back into the broth in the pan.  Stir in rice.  bring to a boil, reduce to a simmer and cook until the rice is tender, about 10 minutes.  ', 152, '2010-05-15 04:32:33', '2010-05-15 04:32:33', 3),
(726, 3, 'Shred the chicken and divide among 4 bowls.  Ladle the broth over the chicken and top with equal portions of radish, avocado and cilantro.  Serve it a wedge of lime.', 152, '2010-05-15 04:32:33', '2010-05-15 04:32:33', 4),
(727, 0, 'Place all ingredients in a saucepan and bring to a boil, stirring until sugar dissolves.  Cover and steep 1 hour.  Transfer to airtight container and refrigerate until cold, about 1 hour.  Strain until all solids are removed.', 153, '2010-05-23 04:16:45', '2010-05-23 04:16:45', 1),
(728, 1, 'Stir together all ingredients in a pitcher until cold, then strain into individual glasses half filled with ice.\r\n\r\n ', 154, '2010-05-23 04:19:22', '2010-05-23 04:19:22', 1),
(729, 0, 'Heat olive oil over medium heat in a heavy skillet and saute onion and shallots for about 6 minutes or until golden.  Add Aborio rice, and stir to coat 1 minute more.', 155, '2010-05-25 02:12:33', '2010-05-25 02:12:33', 1),
(730, 1, 'Add dry wine, stir well.  Add edamame, 1/2 cup chicken stock and salt.  Cook until nearly all liquid is absorbed, stirring constantly.  Add 5 1/2 cups broth (1/2 cups at a time), stirring constantly until each portion is absorbed before adding the next.  When done, rice should be creamy but al dente.', 155, '2010-05-25 02:12:33', '2010-05-25 02:12:33', 2),
(731, 2, 'Remove from heat, add butter and cheese; stir well.  Season with freshly ground pepper.  Drizzle each serving with balsamic vinegar to taste.', 155, '2010-05-25 02:12:33', '2010-05-25 02:12:33', 3),
(732, 0, 'In a medium bowl, combine the flour, sugar, baking powder, and baking soda.', 156, '2010-06-07 03:01:27', '2010-06-07 03:01:27', 1),
(733, 1, 'In a small bowl, combine the honey, orange juice, margarine, eggs, and vanilla; mix well.  Stir into the dry ingredients.', 156, '2010-06-07 03:01:27', '2010-06-07 03:01:27', 2),
(734, 2, 'Coat 12 muffin cups with canola oil spray.  Fill each cup 2/3 full with batter.  Bake at 375 degrees until golden, 15 to 20 minutes. Makes 12 servings.', 156, '2010-06-07 03:01:27', '2010-06-07 03:01:27', 3),
(735, 0, 'Preheat the oven to 350 degrees F (175 degrees C). Generously grease a 9x13 inch baking pan.', 157, '2010-06-08 04:33:00', '2010-06-08 04:33:00', 1),
(736, 1, 'In a large bowl, mix together the oats, brown sugar, wheat germ, cinnamon, flour, raisins and salt. Make a well in the center, and pour in the honey, egg, oil and vanilla. Mix well using your hands. Pat the mixture evenly into the prepared pan.', 157, '2010-06-08 04:33:00', '2010-06-08 04:33:00', 2),
(737, 2, 'Bake for 30 to 35 minutes in the preheated oven, until the bars begin to turn golden at the edges. Cool for 5 minutes, then cut into bars while still warm. Do not allow the bars to cool completely before cutting, or they will be too hard to cut.\r\n', 157, '2010-06-08 04:33:00', '2010-06-08 04:33:00', 3),
(738, 0, 'Place potatoes into a large pot and cover with salted water. Bring to a boil over high heat, then reduce heat to medium-low, cover, and simmer until just tender, about 15 minutes. Drain and allow to steam dry for a minute or two.\r\n', 158, '2010-06-08 04:40:57', '2010-06-08 04:40:57', 1),
(739, 1, 'Meanwhile, heat the vegetable oil in a large skillet over medium heat. Stir in the onion and garlic; cook and stir until the onion has softened and turned translucent, about 5 minutes. Season with cumin, cayenne pepper, curry powder, garam masala, ginger, and salt; cook for 2 minutes more. Add the tomatoes, garbanzo beans, peas, and potatoes. Pour in the coconut milk, and bring to a simmer. Simmer 5 to 10 minutes before serving.\r\n', 158, '2010-06-08 04:40:57', '2010-06-08 04:40:57', 2),
(740, 6, 'While the oil heats, form the first batch of patties. Using a very light touch, form patties that are about 2 1/4 inches in diameter, about 3/4 inch thick in the center and less so at the edges. Do not pat down or try to be too neat. The patties should just about hold together.', 159, '2010-06-08 05:06:26', '2010-06-08 05:06:26', 7),
(741, 11, '2.) Use fresh herbs & spices where possible. The fresher they are, the better they taste ', 159, '2010-06-08 05:06:26', '2010-06-08 05:06:26', 12),
(742, 7, 'Put as many patties into the hot oil as the utensil will hold in a single layer. Fry about 4 minutes or until the patties a reddish brown on both sides. Turn at least once during the frying process.', 159, '2010-06-08 05:06:26', '2010-06-08 05:06:26', 8),
(743, 12, '3.) If you substitute dried chickpeas with canned, don''t add salt, since canned chickpeas contain salt anyway. ', 159, '2010-06-08 05:06:26', '2010-06-08 05:06:26', 13),
(744, 8, 'When the patties are done, remove them with a slotted spoon and drain on a paper towel. do all of the patties this way. ', 159, '2010-06-08 05:06:26', '2010-06-08 05:06:26', 9),
(745, 13, '4.) Falafel is best served in a pita with salad. ', 159, '2010-06-08 05:06:26', '2010-06-08 05:06:26', 14),
(746, 9, 'Here''s some tips: ', 159, '2010-06-08 05:06:26', '2010-06-08 05:06:26', 10),
(747, 0, 'Soak the chickpeas in water for 25 hrs.', 159, '2010-06-08 05:06:26', '2010-06-08 05:06:26', 1),
(748, 1, 'Drain the chickpeas and put them into the container of a good processor or blender. Add the baking soda and salt. ', 159, '2010-06-08 05:06:26', '2010-06-08 05:06:26', 2),
(749, 2, 'Turn the machine on and blend until you have the texture of coarse bread crumbs or fine bulgur wheat. You should NOT have a paste. ', 159, '2010-06-08 05:06:26', '2010-06-08 05:06:26', 3),
(750, 3, 'Empty the chickpeas into a bowl. Add the onion, parsley, cumin, coriander, garlic, black pepper, lemon juice, and cayenne. ', 159, '2010-06-08 05:06:26', '2010-06-08 05:06:26', 4),
(751, 4, 'Mix gently with a fork. Do not pat down. This mixture should be loose and crumbly. ', 159, '2010-06-08 05:06:26', '2010-06-08 05:06:26', 5),
(752, 10, '1.) Use the right oil: Olive oil is not good for frying, due to its low smoke point. Choose an oil with a higher smoke point, such as Canola, sunflower or avocado oil. ', 159, '2010-06-08 05:06:26', '2010-06-08 05:06:26', 11),
(753, 5, 'Put 2 inches of oil in a wok or other utensil for deep frying and set to a heat on a medium-low flame. You need a temperature of 350 to 375 degrees F.', 159, '2010-06-08 05:06:26', '2010-06-08 05:06:26', 6),
(754, 0, 'Slice strawberries and place in a large bowl with powdered sugar.  Let stand 15 minutes.  For each drink, use 1/4 cup of this sugared strawberry mixture.', 160, '2010-06-12 04:02:05', '2010-06-12 04:02:05', 1),
(755, 1, 'In a shaker, mash 2 basil sprigs with 1/4 cup sugared strawberries.  Fill shake with ice and add 1 ounce fresh lemon juice and 1 1/2 ounce vokda.  Shake well. Pour into a large glass and top with 4 ounces soda water.  Garnish with a fresh basil leaf.', 160, '2010-06-12 04:02:05', '2010-06-12 04:02:05', 2),
(756, 0, 'Slice strawberries and place in a large bowl with powdered sugar.  Let stand 15 minutes.  For each drink, use 1/4 cup of this sugared strawberry mixture.', 161, '2010-06-12 04:03:14', '2010-06-12 04:03:14', 1),
(757, 1, 'In a shaker, mash 2 basil sprigs with 1/4 cup sugared strawberries.  Fill shaker with ice and add 1 ounce fresh lemon juice and 1 1/2 ounce vodka.  Shake well. Pour into a large glass and top with 4 ounces soda water.  Garnish with a fresh basil leaf.', 161, '2010-06-12 04:03:14', '2010-06-12 04:03:14', 2),
(758, 0, 'To make Sauce: Heat 1 tablespoon olive oil in saucepan or Dutch oven over medium heat. Sauté 1 1/2 cups onion and 3 garlic cloves in oil 5 to 7 minutes, or until soft. Add dried chilies, and sauté 3 minutes more. Stir in tomatoes and 2 cups water. Season with salt and pepper, and simmer 10 to 15 minutes, or until chiles are soft. Remove from heat, cool 5 minutes, then purée in blender or food processor until smooth.', 162, '2010-06-12 04:23:10', '2010-06-12 04:23:10', 1),
(759, 1, 'To make Enchiladas: Preheat oven to broil. Place poblano chiles on baking sheet, and broil 15 to 20 minutes, or until blackened on all sides, turning often. Cool in covered bowl, then peel off skins and remove seeds. Chop chiles into 1/4-inch pieces. ', 162, '2010-06-12 04:23:10', '2010-06-12 04:23:10', 2),
(760, 2, 'Preheat oven to 375°F. Heat olive oil in skillet over medium heat. Sauté 1/2 cup onion and 2 garlic cloves in oil 3 to 5 minutes, or until soft. Transfer to mixing bowl, and add queso fresco, 1/2 cup Monterey Jack cheese, 2 tablespoons cilantro, and chopped chiles.\r\n\r\n', 162, '2010-06-12 04:23:10', '2010-06-12 04:23:10', 3),
(761, 3, 'Spread tortillas on baking sheet. Warm 3 minutes in oven to soften.\r\n', 162, '2010-06-12 04:23:10', '2010-06-12 04:23:10', 4),
(762, 4, 'Spread 1 cup sauce over bottom of 13- x 9-inch baking dish. Divide cheese mixture among tortillas, and roll loosely. Place filled, rolled tortillas in baking dish. Top with enough sauce to moisten all the stuffed tortillas, and sprinkle with remaining Monterey Jack cheese. Bake 15 to 20 minutes, or until Sauce is bubbly and cheese is melted. Sprinkle with cilantro before serving. \r\n', 162, '2010-06-12 04:23:10', '2010-06-12 04:23:10', 5),
(763, 5, 'NOTE:  There will be about 2 cups of enchilada sauce remaining for another use.', 162, '2010-06-12 04:23:10', '2010-06-12 04:23:10', 6),
(764, 0, 'To make Sauce: Heat 1 tablespoon olive oil in saucepan or Dutch oven over medium heat. Sauté 1 1/2 cups onion and 3 garlic cloves in oil 5 to 7 minutes, or until soft. Add dried chilies, and sauté 3 minutes more. Stir in tomatoes and 2 cups water. Season with salt and pepper, and simmer 10 to 15 minutes, or until chiles are soft. Remove from heat, cool 5 minutes, then purée in blender or food processor until smooth.', 163, '2010-06-12 04:23:54', '2010-06-12 04:23:54', 1),
(765, 1, 'To make Enchiladas: Preheat oven to broil. Place poblano chiles on baking sheet, and broil 15 to 20 minutes, or until blackened on all sides, turning often. Cool in covered bowl, then peel off skins and remove seeds. Chop chiles into 1/4-inch pieces. ', 163, '2010-06-12 04:23:54', '2010-06-12 04:23:54', 2),
(766, 3, 'Spread tortillas on baking sheet. Warm 3 minutes in oven to soften.\r\n', 163, '2010-06-12 04:23:54', '2010-06-12 04:23:54', 4);
INSERT INTO `steps_bak` (`id`, `order_num`, `instruction`, `recipe_id`, `created_at`, `updated_at`, `order_num_test`) VALUES
(767, 4, 'Spread 1 cup sauce over bottom of 13- x 9-inch baking dish. Divide cheese mixture among tortillas, and roll loosely. Place filled, rolled tortillas in baking dish. Top with enough sauce to moisten all the stuffed tortillas, and sprinkle with remaining Monterey Jack cheese. Bake 15 to 20 minutes, or until sauce is bubbly and cheese is melted. Sprinkle with cilantro before serving. \r\n', 163, '2010-06-12 04:23:54', '2010-06-12 04:23:54', 5),
(768, 5, 'NOTE:  There will be about 2 cups of enchilada sauce remaining for another use.', 163, '2010-06-12 04:23:54', '2010-06-12 04:23:54', 6),
(769, 0, 'To make Sauce: Heat 1 tablespoon olive oil in saucepan or Dutch oven over medium heat. Sauté 1 1/2 cups onion and 3 garlic cloves in oil 5 to 7 minutes, or until soft. Add dried chilies, and sauté 3 minutes more. Stir in tomatoes and 2 cups water. Season with salt and pepper, and simmer 10 to 15 minutes, or until chiles are soft. Remove from heat, cool 5 minutes, then purée in blender or food processor until smooth.', 164, '2010-06-12 04:24:30', '2010-06-12 04:24:30', 1),
(770, 1, 'To make Enchiladas: Preheat oven to broil. Place poblano chiles on baking sheet, and broil 15 to 20 minutes, or until blackened on all sides, turning often. Cool in covered bowl, then peel off skins and remove seeds. Chop chiles into 1/4-inch pieces. ', 164, '2010-06-12 04:24:30', '2010-06-12 04:24:30', 2),
(771, 2, 'Spread tortillas on baking sheet. Warm 3 minutes in oven to soften.\r\n', 164, '2010-06-12 04:24:30', '2010-06-12 04:24:30', 3),
(772, 3, 'Spread 1 cup sauce over bottom of 13- x 9-inch baking dish. Divide cheese mixture among tortillas, and roll loosely. Place filled, rolled tortillas in baking dish. Top with enough sauce to moisten all the stuffed tortillas, and sprinkle with remaining Monterey Jack cheese. Bake 15 to 20 minutes, or until sauce is bubbly and cheese is melted. Sprinkle with remaining cilantro before serving. \r\n', 164, '2010-06-12 04:24:30', '2010-06-12 04:24:30', 4),
(773, 4, 'NOTE:  There will be about 2 cups of enchilada sauce remaining for another use.', 164, '2010-06-12 04:24:30', '2010-06-12 04:24:30', 5),
(774, 0, 'Preheat oven to 425 degrees.  Line 12 (1/2 cup) muffin tins with paper liners or coat with cooking spray.', 165, '2010-06-15 03:54:15', '2010-06-15 03:54:15', 1),
(775, 1, 'Thoroughly combine cream cheese, honey, lemon zest and 1/4 teaspoon vanilla in a small bowl, set aside.', 165, '2010-06-15 03:54:15', '2010-06-15 03:54:15', 2),
(776, 2, 'Whisk flour, baking powder, baking soda and salt in a large bowl.  Lightly beat eggs in a medium bowl; add brown sugar and the remaining 1 teaspoon vanilla and whisk until the sugar is dissolved, about 1 minutes.  Gradually whisk in buttermilk and oil until smooth.  Add the wet ingredients to the dry ingredients ans stir until just combined; do not over mix.  Fold in date or figs.', 165, '2010-06-15 03:54:15', '2010-06-15 03:54:15', 3),
(777, 3, 'Spoon half the batter into the prepared muffin cups.  Add 1 generous teaspoon of the reserved cheese filling to the center of each muffin, and cover with the remaining batter.  (The filling should not be visible.)  Sprinkle the muffins with sugar.  ', 165, '2010-06-15 03:54:15', '2010-06-15 03:54:15', 4),
(778, 4, 'Bake the muffins until the edges start to brown and the tops spring back when gently pressed, 13 to 15 minutes.  Let cool in the pan for 5 minutes before turning out onto a wire rack to cool. ', 165, '2010-06-15 03:54:15', '2010-06-15 03:54:15', 5),
(779, 0, 'Cook pasta following package directions.  Drain well.', 166, '2010-06-23 02:39:54', '2010-06-23 02:39:54', 1),
(780, 1, 'While pasta is cooking, heat oil in large skillet over medium-high heat.  Add mushrooms; saute for 10 minutes.', 166, '2010-06-23 02:39:54', '2010-06-23 02:39:54', 2),
(781, 2, 'Stir in cream, peas, sun-dried tomatoes, prosciutto, salt, nutmeg and pepper.  Bring to a simmer.  Stir in 1/4 cup grated Parmesan cheese.', 166, '2010-06-23 02:39:54', '2010-06-23 02:39:54', 3),
(782, 3, 'Toss cooked pasta with sauce.   If desired, sprinkle with additional cheese and garnish with herbs.', 166, '2010-06-23 02:39:54', '2010-06-23 02:39:54', 4),
(783, 0, 'For the dough, pour water and 1/2 teaspoon salt into small bowl.  Sprinkle with the yeast, stir well.  Let sit until bubbly, about 8 minutes.', 167, '2010-06-23 02:50:02', '2010-06-23 02:50:02', 1),
(784, 1, 'Combine both flours and remaining salt in a food processor.  Add the yeast water and 2 tablespoons olive oil.  Process.  If mixture appear dry, add 1 to 2 tablespoons water.  Process until dough forms a ball and is tacky.', 167, '2010-06-23 02:50:02', '2010-06-23 02:50:02', 2),
(785, 2, 'Cover counter with plastic wrap.  Knead dough 6 to 8 ties until smooth.  Add 1 tablespoon olive oil to a large bowl; add the dough.  Coat the dough in the oil, and leave in bowl.  Cover with plastic wrap.  Sit in a warm place until dough has doubled in size, about 45 minutes.  Punch the dough down, divide into 2 even pieces.  pat each piece into a roughly 6-inch disc. Return to bowl, cover to 30 minutes.', 167, '2010-06-23 02:50:02', '2010-06-23 02:50:02', 3),
(786, 3, 'Heat oven to 450 degrees, with rack on lowest level.  Toss leeks with remaining olive oil.  Reserve.  For each pizza, roll or pat out one disc, on a cornmeal-dusted surface, to a 11-inch circle; transfer to a cornmeal-dusted cookie sheet.  Arrange half the mozzarella, tomatoes and Parmigiano Reggiano over each pizza.  Sprinkle with salt and pepper.  Bake or 10 minutes.  Add leeks and sage.  Bake until pizzas are bubbly and golden brown, 5 to 10 minutes more.', 167, '2010-06-23 02:50:02', '2010-06-23 02:50:02', 4),
(787, 0, 'Preheat oven to 450 degrees.  Place eggplant on a medium baking sheet.  Bake 20 to 30 minutes in the preheated oven, until tender.  Remove from heat, cool, peel, and chop.', 168, '2010-06-25 04:54:54', '2010-06-25 04:54:54', 1),
(788, 1, 'Heat oil in a medium skillet over medium heat. Mix in cumin seeds and onion.  Cook and stir until onion is tender.', 168, '2010-06-25 04:54:54', '2010-06-25 04:54:54', 2),
(789, 2, 'Mix ginger, garlic, curry powder, and tomato into the saucepan, and cook about 1 minute.  Stir in yogurt.  Mix in eggplant and jalapeno pepper, and season with salt.  Cover, and cook 10 minutes over high heat.  Remove cover, reduce heat to low, and continue cooking about 5 minutes.  Garnish with cilantro and serve over rice or with naan bread.  ', 168, '2010-06-25 04:54:54', '2010-06-25 04:54:54', 3),
(790, 0, 'mix', 169, '2010-07-03 06:01:22', '2010-07-03 06:01:22', 1),
(791, 1, 'rise', 169, '2010-07-03 06:01:22', '2010-07-03 06:01:22', 2),
(792, 2, 'drink', 169, '2010-07-03 06:01:22', '2010-07-03 06:01:22', 3),
(793, 0, 'Line a 9-inch square baking pan with plastic wrap.  Melt 1/4 cup light butter in a saucepan over medium heat.   Add 1/4 cup sugar, 1/3 cup unsweetened cocoa, and 1 egg; cook 1 minute. ', 170, '2010-07-03 06:25:29', '2010-07-03 06:25:29', 1),
(794, 1, 'Stir in graham cracker crumbs, rolled oats, shredded coconut, walnuts, and 1 tsp. vanilla.  Pat the mixture into the bottoms of the pan.  Freeze until firm, 30 minutes. ', 170, '2010-07-03 06:25:29', '2010-07-03 06:25:29', 2),
(795, 2, 'With an electric mixer, beat 4 tsp. smart balance and skim milk.  Beat in sifted confectioners'' sugar and 1/2 tsp. vanilla.  Spread over the crust and chill 15 minutes.  Microwave bittersweet chocolate and 2 tsp. Smart balance 10 seconds; stir.  Spread over the fillings; chill 2 hours.  Cut into 20 bars. ', 170, '2010-07-03 06:25:29', '2010-07-03 06:25:29', 3);
